INSERT INTO `p2p_article` VALUES (2,'资费说明','','<p class=\"ral-title\" style=\"font-size:16px;font-weight:bold;\">\r\n资费说明\r\n</p>',20,1457977748,1459278227,0,1,'',0,0,1589,18,'','','','','',''),(3,'隐私保护','','<div class=\"lh26\"><b><span style=\"font-size:14px;\">隐私保护我们有哪些措施保障您的隐私安全</span></b><div><ul><li>　? p2p贷款严格遵守国家相关法律法规，对用户的隐私信息进行严格的保护。</li>\r\n<li>　? 我们采用业界最先进的加密技术，用户的注册信息、账户收支信息都已进行高强度的加密处理，不会被不法分子窃取到。</li>\r\n<li>　? p2p贷款设有严格的安全系统，未经允许的员工不可获取您的相关信息。</li>\r\n<li>　? p2p贷款绝不会将您的账户信息、银行信息以任何形式透露给第三方。</li>\r\n</ul>\r\n</div>\r\n<div><b><span style=\"font-size:14px;\">个人信息安全：</span></b></div>\r\n<div>p2p贷款是一个实名认证平台，p2p贷款会保证用户信息隐私的安全，用户在平台上交流的过程中，也要时刻注意保护个人隐私，截图注意覆盖个人信息，不要透露真实姓名与住址等，以防个人信息被盗取造成损失。</div>\r\n</div>',3,1457977748,1457977748,0,1,'',0,0,1058,19,'','','','','',''),(4,'咨询热点','','咨询热点',4,1457977748,1457977748,0,0,'',0,0,159,20,'','','','','',''),(6,'公司简介','','公司简介',6,1457977748,1457977748,0,1,'',0,0,92,22,'','','','','',''),(7,'2014-5-9     p2p信贷即将上线','','<br />',5,1457977748,1461092879,0,1,'',0,0,1075,23,'','','','','',''),(8,'常见问题','','常见问题',1,1457977748,1457977748,0,1,'',0,0,82,27,'','','','','',''),(9,'平台原理','','<div class=\"blank20\"></div>\r\n<div class=\"tc\">\r\n</div>\r\n<div class=\"blank20\"></div>\r\n<div class=\"b f14\" style=\"color:#2e5f9b;\">\t\tp2p信贷统平台机制\t</div>\r\n<div class=\"blank10\"></div>\r\n<div style=\"color:#585858;\">p2p信贷(fanwe.com)为有资金需求和理财需求的个人搭建了一个公平、透明、稳定、高效的网络互动平台。用户可以在p2p信贷上获得信用评级、发布借款请求满足个人的资金需要；也可以把自己的闲余资金通过p2p信贷出借给信用良好有资金需求的个人，在获得良好的资金回报率的同时帮助了他人。</div>\r\n<div class=\"blank20\"></div>\r\n<div class=\"b f14\" style=\"color:#2e5f9b;\">p2p信贷借贷流程\t</div>\r\n<div class=\"blank10\"></div>\r\n<div class=\"tc\">\r\n<div class=\"blank20\"></div>',1,1457977748,1457977748,0,1,'u:index|aboutp2p',0,0,2,26,'','','','aboutp2p','',''),(10,'如何借款','','<div class=\"border\">        \t<div class=\"tit\"><h3>贷款方式</h3>\r\n<a href=\"./index.php?ctl=borrow\">申请贷款</a></div>\r\n            <table cellspacing=\"0\" border=\"0\">            \t<tbody><tr class=\"even\"><td style=\"border-right:1px solid #dce7fa;\">借款额度</td>\r\n<td> 3,000 至 1,000,000人民币</td>\r\n</tr>\r\n                <tr class=\"odd\"><td style=\"border-right:1px solid #dce7fa;\">借款利率</td>\r\n<td> 6% ? 24%（取决于借贷双方以及借款人信用等级）</td>\r\n</tr>\r\n                <tr class=\"even\"><td style=\"border-right:1px solid #dce7fa;\">借款期限</td>\r\n<td> 3 / 6 / 9 / 12 / 18 / 24个月</td>\r\n</tr>\r\n                <tr class=\"odd\"><td style=\"border-right:1px solid #dce7fa;\">还款方式</td>\r\n<td> 每月还款（等额本息还款法）</td>\r\n</tr>\r\n                <tr class=\"even\"><td style=\"border-right:1px solid #dce7fa;\">服务费用</td>\r\n<td> 根据您的当前等级而定，等级越高，费用越低</td>\r\n</tr>\r\n                <tr class=\"odd\"><td style=\"border-right:1px solid #dce7fa;\">管理费用</td>\r\n<td> 将根据借款期限，每月向借入者收取借款本金的0.3%作为借款管理费</td>\r\n</tr>\r\n            </tbody>\r\n</table>\r\n        </div>\r\n\t\t\t\t<div class=\"border\">        \t<div class=\"tit\"><h3>贷款资格</h3>\r\n</div>\r\n           \t<div class=\"titcen\">     \t                 <p style=\"background:#ecf7ff;\"><span style=\"color:#ff8500;\">年龄：</span>22?65周岁</p>\r\n                       <p><span style=\"color:#ff8500;\">工作与收入：</span>请先确认您的身份</p>\r\n\t                 <ul>                     <li style=\"background:#ecf7ff;list-style:square;padding-left:20px;line-height:34px;list-style-position:inside;\"><span style=\"color:#ff8500;\">私营业主(包含网店商家)：</span>有一年以上的营业执照;近半年可体现月均流水(对公或对私)不低于2万元。</li>\r\n                     <li style=\"background:#ecf7ff;list-style:square;padding-left:20px;line-height:34px;list-style-position:inside;\"><span style=\"color:#ff8500;\">企业员工：</span>在央企,国企及注册资本高于100万元人民币的一般民营企业,有半年以上的工作合同或相关证明,<br />\r\n可体现月收入不低于2000元,。</li>\r\n\t\t\t\t\t <li style=\"background:#ecf7ff;list-style:square;padding-left:20px;line-height:34px;list-style-position:inside;\"><span style=\"color:#ff8500;\">政府机关及事业单位工作人员：</span>正式工作人员,可体现月收入不低于1200元。</li>\r\n                 </ul>\r\n           \t</div>\r\n        </div>\r\n<div class=\"border\">\t\t\t<div class=\"tit\">            \t  <h3>快速问答</h3>\r\n                  <a href=\"./index.php?ctl=help\">了解更多</a>            </div>\r\n\t\t\t<div class=\"titcen\">\t\t\t\t<h4>Q：如何判断我是否有申请资格？</h4>\r\n\t\t\t\t<p>A：只要有您有相对稳定的收入，并能出示相关的证明文件就拥有申请贷款的资格。</p>\r\n\t\t\t \t\t\t\t<h4>Q：什么是信用等级？较高的信用等级有什么优势？</h4>\r\n\t\t\t\t<p>A：信用等级是p2p信贷用来评估借款人信用所使用的一套体系,目前p2p信贷信用等级共分7级，从最高的AA\t\t\t\t级到最低的HR级。您的信用等级越高，能得到的借款额度越高，提高信用等级，可以增加借出者对您的信任度、并能以更低的成本成功借款、</p>\r\n\t\t\t\t\t\t\t<h4>Q：我上传的隐私会不会被泄露？</h4>\r\n\t\t\t\t<p>A：不会，保护用户的隐私和数据安全是p2p信贷&nbsp;最重要的责任之一。在传输层中,采用加密数据进行传输以\t\t\t\t防止网络分包被截获造成数据泄露。同时p2p信贷还启用了侵扰监测系统来监测那些内部和外部易受侵扰的路径，并运用其他一些人工措施来加强保护用户数据的安全。 </p>\r\n\t\t\t\t\t\t\t\t<h4>Q：能否提前还贷？</h4>\r\n\t\t\t\t<p>A：您可以随时还清整笔贷款，您仅需向借出者支付一期本息以及剩余本金的1%的违约金。</p>\r\n\t\t\t</div>\r\n        </div>',1,1457977748,1457977748,0,1,'u:index|borrow#aboutborrow',0,0,0,25,'','','','aboutborrow','',''),(11,'如何理财','./public/attachment/201011/4cdd501dc023b.png','<div>\r\n\t<div id=\"step\">\r\n\t\t<img alt=\"\" src=\"./public/images/aboutfinacing/reg_fwd.png\" />&nbsp;只需30秒,您即可注册成为p2p信贷用户<br />\r\n<img alt=\"\" class=\"logo_hack\" src=\"./public/images/aboutfinacing/blue_sign.png\" /> \r\n\t</div>\r\n\t<div id=\"step\">\r\n\t\t<img alt=\"\" src=\"./public/images/aboutfinacing/lender.png\" />&nbsp;为了保证您的资金安全，您需先用手机验证、身份证验证2项实名验证，方可开始投资<br />\r\n<img alt=\"\" class=\"logo_hack\" src=\"./public/images/aboutfinacing/blue_sign.png\" /> \r\n\t</div>\r\n\t<div id=\"step\">\r\n\t\t<img alt=\"\" src=\"./public/images/aboutfinacing/choose.png\" />&nbsp;您可以根据自己的风险偏好，以及回报率要求，来选择最适合您的借款机会<br />\r\n<img alt=\"\" class=\"logo_hack\" src=\"./public/images/aboutfinacing/blue_sign.png\" /> \r\n\t</div>\r\n\t<div id=\"step\">\r\n\t\t<img alt=\"\" src=\"./public/images/aboutfinacing/lender_money.png\" />&nbsp;在您充值之后，您便可以点对点的将您的资金进行出借给您意向的借款人<br />\r\n<img alt=\"\" class=\"logo_hack\" src=\"./public/images/aboutfinacing/blue_sign.png\" /> \r\n\t</div>\r\n\t<div id=\"step\">\r\n\t\t<img alt=\"\" src=\"./public/images/aboutfinacing/interest.png\" />&nbsp;经p2p信贷审核的借款成功后，借入者将每月按时向您及其他借出者归还本息<br />\r\n\t</div>\r\n</div>\r\n<div style=\"padding:10px 50px 10px 50px;\">\r\n\t<div class=\"about_title2\">\r\n\t\tp2p信贷投资原理\r\n\t</div>\r\n\t<div style=\"margin:8px 0px 8px 0px;\">\r\n\t</div>\r\n\t<div style=\"font-size:13px;\">\r\n\t\t<p>\r\n\t\t\tp2p信贷(fanwe.com)为有资金需求和理财需求的个人搭建了一个公平、透明、稳定、高效的网络互动平台。\t\t                    用户可以在p2p信贷上获得信用评级、发布借款请求满足个人的资金需要；也可以把自己的闲余资金通过p2p信贷出借给信用良好有资金需求的个人，\t\t                    在获得良好的资金回报率的同时帮助了他人。\r\n\t\t</p>\r\n\t</div>\r\n</div>\r\n<div>\r\n\t<img alt=\"p2p借贷系统平台原理\" class=\"logo_hack\" src=\"./public/images/aboutfinacing/principle.jpg\" /> \r\n</div>',7,1457977748,1457977748,0,1,'u:index|deals&act=about&u=financing',0,0,1,24,'','','','financing','',''),(12,'p2p信贷费率','','<div class=\"blank20\"></div>\r\n<div class=\"b f12\">一、理财费用</div>\r\n<p class=\"f_red\">p2p信贷系统不收取理财人任何费用，充值提现费用为第三方支付公司收取</p>\r\n<div class=\"blank20\"></div>\r\n<div class=\"b f12\">二、贷款费用</div>\r\n1、服务费<br />\r\np2p信贷系统收取的服务费将全部存于风险准备金账户用于p2p信贷系统的本金保障计划。服务费将按照借款人的信用等级来收取： <div class=\"blank20\"></div>\r\n<table style=\"text-align:center;background-color:#ccc;width:100%;\" border=\"0\" cellspacing=\"1\" align=\"center\"><tbody><tr style=\"background:#eff5fe;height:30px;\"><td class=\"tc\">信用等级 </td>\r\n<td class=\"tc\" width=\"10%\">AA </td>\r\n<td width=\"10%\" tc?=\"\">A </td>\r\n<td class=\"tc\" width=\"10%\">B </td>\r\n<td class=\"tc\" width=\"10%\">C </td>\r\n<td class=\"tc\" width=\"10%\">D </td>\r\n<td class=\"tc\" width=\"10%\">E </td>\r\n<td class=\"tc\" width=\"10%\">HR </td>\r\n</tr>\r\n<tr style=\"background:#fff;height:30px;\"><td class=\"tc\">费率</td>\r\n<td class=\"tc\">0%</td>\r\n<td class=\"tc\">1%</td>\r\n<td class=\"tc\">1.5%</td>\r\n<td class=\"tc\">2%</td>\r\n<td class=\"tc\">2.5%</td>\r\n<td class=\"tc\">3%</td>\r\n<td class=\"tc\">5%</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n2、账户管理费<br />\r\np2p信贷系统将按照借款人的借款期限，每月向借款人收取其借款本金的0.3%作为借款管理费。<div class=\"blank20\"></div>\r\n<div class=\"b f12\">三、充值提现费用</div>\r\n1、充值费用（由第三方平台收取）<br />\r\n第三方支付平台将在您充入资金时扣除0.5%作为转账费用。充值费用上限为100元。超过100元的部分由p2p信贷承担。<br />\r\n<p style=\"color:#8e8e8e;\">注：充值时可以使用一张充值免费券，抵去该笔充值费用。（每位新注册理财用户（完成绑定身份证和手机号）将自动获得一张充值免费券，并可通过参与活动的方式获得更多充值免费券。）</p>\r\n<div class=\"blank20\"></div>\r\n2、提现费用（由第三方平台收取）<br />\r\n当借款人要求将借款资金转至指定银行账户时，会发生转账费用，第三方支付平台将按以下标准收取相关费用。<table style=\"text-align:center;background-color:#ccc;width:100%;\" border=\"0\" cellspacing=\"1\" align=\"center\"><tbody><tr style=\"background:#eff5fe;height:30px;\"><td width=\"25%\"><div align=\"center\">金额 </div>\r\n</td>\r\n<td width=\"25%\"><div align=\"center\">2万元以下 </div>\r\n</td>\r\n<td width=\"25%\"><div align=\"center\">2万元（含）－5万元 </div>\r\n</td>\r\n<td width=\"25%\"><div align=\"center\">5万元（含）－100万元 </div>\r\n</td>\r\n</tr>\r\n<tr style=\"background:#fff;height:30px;\"><td><div align=\"center\">收费 </div>\r\n</td>\r\n<td><div align=\"center\">1元/笔 </div>\r\n</td>\r\n<td><div align=\"center\">3元/笔 </div>\r\n</td>\r\n<td><div align=\"center\">5元/笔 </div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"blank20\"></div>',1,1457977748,1457977748,0,1,'u:index|aboutfee',0,0,0,23,'','','','aboutfee','',''),(13,'审核之借出者篇','','在p2p信贷上成为借出者十分简便，用户免费注册后通过手机绑定，身份证验证和借出学习即可成为p2p信贷借出者，成为借出者后用户可以选择符合自己标准的借款列表借出。关于借款列表的选择，我们有专门的建议，这里主要介绍一下信用审核对于借出者选择的影响。p2p信贷的信用审核系统包括了基本信用审核（目前包括身份证明、工作证明、学历证明、社区网认证）和附加信用审核（目前包括购车证明、微博认证、信用报告认证、收入认证、结婚证明）两个方面。要通过信用审核要求借入者上传自己的相关资料，p2p信贷的审核人员对这些资料进行严格审查，尽可能确定资料的真实性。基本信用审核表明借入者的真实性和基本信用情况（经验表明工作、学历在很大程度上说明了借入者的信用状况），而附加信用审核的材料获得有一定的难度，且具有一定门槛（购车证明、完税证明、个人信用报告等审核对借出者的经济基础有较高要求），借入者能够通过附加信用审核说明他对借款更加重视，也具备更强的还款能力。通过审核的资料在借入者发布借款请求时会部分披露给借出者，从而让借出者更加了解借入者的情况，以便作出正确的判断。当借入者发布借款时，为保护借出者的利益，我们要求借入者至少要通过基本信用审核。 在p2p信贷上选择借款列表时，除了要看借入者的借款描述和用途外，更要看借入者披露的信息是否足以证明自己的还款意愿和能力（一般来说，著名高校毕业、就职于知名企业或政府部门、社区网使用活跃、已购车、已婚、收入较高等都能直接或间接说明借入者还款意愿和能力更强）。为保护借出者的利益，借入者要在p2p信贷上披露信用信息必须通过相应的认证，也就是说借入者通过越多的审核借出者对借入者进行判断的依据也就越多。所以，借出者应尽量选择基本信用状况优秀或是基本资料并不出众但是通过了较多附加信用审核的借入者。特别地，当借入者发布较高额的借款请求时，除非通过其它渠道对借入者有所了解，否则我们建议借出者要主动要求借入者通过更多的附加信用审核（可以通过借款列表内的留言板进行留言）。',6,1457977748,1457977748,0,1,'',0,0,0,28,'','','','','',''),(14,'审核之借入者篇','','在p2p信贷上申请成为借入者，完成基本信用审核后才可以发布借款，基本信用审核是p2p信贷审核的门槛，提交基本信用审核申请的难度较低，借入者通过基本信用审核后即可发布借款请求。附加信用审核作为基本信用审核的补充，能够提高借入者的信用等级，增加借出者对借入者的信任，提高借款成功率。 p2p信贷的基本信用审核目前包括身份证认证，学历认证，工作认证和社区网认证。要通过基本信用审核需要提供身份证原件的照片或扫描件，中国高等教育学生信息网学历认证在线验证码（登录学信网注册后即可方便获得），工作证明原件照片或扫描件及常使用的社区网账号（目前仅限于开心网和人人网），这些材料获取容易，且包括了用户的基本信息（借入者在发布借款请求时，我们会在保护用户隐私的前提下有选择的披露部分借入者信息以便借出者作出判断），能够让借出者对借入者有初步了解。 附加信用审核目前包括新浪微博认证，收入证明，个人信用报告认证，购车证明，结婚证明。通过附加信用审核可以提高信用等级，等级越高，借款成功的可能性越大，借款利率也会相应降低。因而我们提倡借款前尽可能多地完成附加信用审核。某些附加信用审核材料的获得较基本信用审核困难一些，比如个人信用报告，完税证明，等都需要到专门的机构获得。虽然材料的获取有一定难度，但是只要您提供的材料真实，通过这些审核后借出者对您的了解和信任度会有显著提高，借款也更易成功。',6,1457977748,1457977748,0,1,'',0,0,0,29,'','','','','',''),(15,'选择借款列表','','借款列表是p2p信贷借入者发出的借款请求。借款列表中包括借款数额、借款目的、借款期限和借款人对如何使用这笔借款的描述等信息。通过借款列表您还可以了解借款人已上传哪些信用审核资料及该借款人的信用等级。p2p信贷上有许多借款列表可供选择。点击“我要借出”标签，您就可以浏览所有的借款列表。“正在进行中的列表”显示的是目前可以投标的一些借款，“等待复审的列表”显示的是已经完成招标，正在审核中的借款。您也可以查看所有借款列表，并通过招标剩余时间、借款数额、借款进度、借款人信用等级等条件，进一步详细搜索。 您可以根据p2p信贷为您提供的信息选择适合您投资的借款列表。如果您是风险爱好者，您可以选择信用等级较低、借款期限较长但利息率高的借款列表。如果您是风险规避者，您可以选择信用等级高、借款期限短但利息率较低的借款列表。p2p信贷保证您完全享有真实、有效的借款人信息，以便您做出明智的选择，这样您的投资就会有稳定、丰厚的回报。 想了解更多投资策略，请参考“投资策略”与“分散投资降低风险”。',6,1457977748,1457977748,0,1,'',0,0,0,30,'','','','','',''),(16,'借款失败原因','','<p>1．信息太少，有的借款者发布的借款列表内容很少，甚至只有一个图标或者一张没有真实头像的图片，没有明确的借款原因。这样的借款列表不能让人产生信任感，借出者会因为真实信息太少又不能保证按时还款而不会投标。</p>\r\n<p>&nbsp;2．借款的用途不可靠，有的借款者借款用途风险太大或者不合法，有的甚至带有赌博性质，比如要去股市再赌一把等，这种风险太大的借款项目一般出借人也不会选择。&nbsp;</p>\r\n<p>3．借款描述存在明显问题，比如有的借款列表描述中，每月收入除去每月应还款数额后剩余金额不足以抵消每月开支，没有足够的还款能力。</p>\r\n<p>4．低级的骗子，有的借入者直接抄袭别人的借款列表信息，但是一些基本信息存在明显的矛盾之处。&nbsp;</p>\r\n<p>5．信誉不好者，在p2p信贷有逾期行为的借款者会被记录到黑名单中，随着逾期时间的增长，我们会逐步公布逾期借款者的信息，有了逾期记录的借款者再次借款会有一定难度。&nbsp;</p>\r\n<p>6．发布借款列表后即消失，对于借出者的合理的提问要求不予回应。&nbsp;</p>\r\n<p>7．个人基本情况并不优秀，而且通过的附加信用审核很少或是没有通过附加信用审核。</p>',6,1457977748,1457977748,0,1,'',0,0,0,31,'','','','','',''),(17,'其他借出技巧','','<p>1.不要盲目跟投 盲目跟投是初级借出者常见的错误之一。不管借款人的信用级别，不看借款列表详情，就亦步亦趋的跟着其他出借人投标，这是危险且对自有资金不负责的行为。一些明显存在较大风险的借款列表很可能由于一些借出者的盲目跟投而满标，进而产生潜在风险。&nbsp;</p>\r\n<p>2.不要在投资中夹杂过多感情因素 p2p借贷系统建立的初衷是让大家帮助大家，但归根结蒂对于出借人来说这里是一个投资的平台是一个理财的途径，如果出借人承担了与回报不相符的风险那么出借人对于借入者的帮助也是无力和不可持续的。所以，借出者不要完全基于感情因素（喜欢，同情等）去投标，在帮助人的同时一定要考虑自己的风险与回报是否匹配。&nbsp;</p>\r\n<p>3.关注借入者的网络行为 我们生活在网络互动日益频繁，网络生活占日常生活比重日益加大对时代，p2p借贷系统也正是在这样的大环境下应运而生。所以，在判断借款人信用的时候除了以参考p2p借贷系统给出的信用级别为主外，还可以关注该用户的网络行为。比如他/她的网络日志，他/她的社交网站，微博等等。通常来讲，一个用户可考证的网络行为可以从一个侧面在某种程度上反映出他/她的信用水平。&nbsp;</p>\r\n<p>4.主动向借入者提问 经验表明优秀的贷款审核员对借入者的人工判断在某些时候甚至会优于最好的信用模型。所以，p2p借贷系统鼓励借出者对借入者提出与借款相关的问题，或是要求借入者提供一些附加的信用材料。在借款列表中的留言板上对借入者提问，借入者会在第一时间得到通知。当借入者回答您的提问时，您也会收到邮件提醒。&nbsp;</p>\r\n<p>5.关注借款人信用等级以外的其他信息 毋庸置疑，借款人的信用等级在很大程度上说明了借款人的信用情况，但是有时通过借入人是哪个院校毕业的、他/她做过哪些认证、他/她之前的还款情况怎样、他/她的借款用途是什么、他/她准备如何还款等其他信息也能在一定程度上判断出借款人是否有还款能力和还款意愿。</p>',6,1457977748,1457977748,0,1,'',0,0,0,32,'','','','','',''),(18,'提高借款成功率','','<p>提高借款成功率 借款能否成功主要看出借人对借入者的看法，如果借入者有良好的还款意愿和还款能力，且能够提供真实的证明材料，则出借人更愿意对其投资。具体来说，一笔成功的借款需要具备的条件有真实的借款用途，真诚的借款意愿，充足的还款能力，可靠的证明材料。简而言之就是，提供真实的资料，增加信用等级，以真诚打动出借人。&nbsp;</p>\r\n<p>分开来讲要注意的地方有：</p>\r\n<p>&nbsp;　　1．尽量通过更多的附加信用审核。附加信用审核的通过有一定的难度，通过附加信用审核可以证明借入者的还款意愿和还款能力，而且每通过一项审核，审核人员会根据您提供的材料进行评分，信用分数越高，信用等级相应地也会提高，不喜欢高风险的借出者也比较愿意对您的信用列表投标。&nbsp;</p>\r\n<p>　　2．借款时在不泄露个人隐私前提下提供尽可能多的披露个人信用信息，目前可披露的信息包括毕业院校，工作单位，社区网使用状况，婚姻状况，购车状况，信用报告情况，收入状况等，其中有些内容借款时必须披露，有些则可以在通过相应的认证后选择性的披露。通常著名高校毕业，知名企业或政府机关就业，社区网站活跃，已婚，购车等情况比较吸引借出者。同时，借款描述中详细的借款用途，可靠的还款来源，合理认真的收支计划等也能反映借入者的认真态度，更容易筹集到借款。&nbsp;</p>\r\n<p>　　3．可以将自己的借款分享到人人网，开心网或新浪微博，吸引有意愿和能力的好友来投标，同时好友的关注，投标及评论也可以吸引其他借出者。</p>',6,1457977748,1457977748,0,1,'',0,0,0,33,'','','','','',''),(19,'如何判断借款列表','','在p2p借贷系统上借出闲置资金，在帮助别人的同时获取稳定的收入， 实现社会资本的再分配，是一种双赢的选择。但是平台上发布借款的人数众多且参差不齐，必然存在借款者不能按时还款的情况。为了保证自己的资金能够收回，如何选择可靠的借款列表进行投资就需要慎重考虑。对于大多数投资人来说，一个大原则就是做熟不做生，投稳不投险。 对于朋友发布的借款列表，可以通过私下亲自接触来了解，这种情况能够获取第一手资料，稳定性更高。对于朋友的朋友发布的借款列表，可以通过朋友间接了解，或经朋友介绍直接了解。 对于陌生人发布的借款列表，首先要看他/她的信用等级。等级可以从很大程度上反映借入者的信用水平，一般而言信用等级越高违约的可能性就越低。其次要看他通过的信用审核，基本信用审核（目前包括身份证明、工作证明、学历证明、社区网认证）可以表明借入者身份的真实性和基本信用情况，成为借入者发布借款至少要通过基本信用审核；附加信用审核（目前包括购车证明、微博认证、信用报告认证、收入认证、结婚证明）能反映其对借款的重视程度，也能表明其还款能力。所以借出者可以选择基本情况优秀或是通过较多附加信用审核的借出者。最后要看一下他/她的借款描述，以及借款条件。借款用途和还款计划描述详尽可靠，且借款数额和借款利率与借款描述和借款人信用等级相符的借款人较为可靠。如果经过以上判断还有疑问的可以通过借款列表的留言板给借款者留言，通过借款者的回答来更进一步了解借款者。',6,1457977748,1457977748,0,1,'',0,0,0,34,'','','','','',''),(20,'借入者注意事项','','<p>用户到p2p信贷发布借款，基本上都是近期有资金需求想要尽快筹到所需资金的，有的借入者对于借贷流程不熟悉，没有成功借到钱。借款失败的原因可能有很多，p2p信贷给出的建议是：作为借入者当有所为有所不为。&nbsp;</p>\r\n<p>有所为：</p>\r\n<p>　　1．尽可能详尽地完善个人资料，完成信用审核，资料要真实可靠，投资者都会偏向于比较可靠的借入者，真实的照片，可查询的社区网站，通过较多的附加信用审核等等都可以获得更多人的关注。&nbsp;</p>\r\n<p>　　2．邀请好友加入，熟悉的人对彼此都很了解，会有更强的投资意愿。而且好友的评价也可以成为投资者的参考意见。&nbsp;</p>\r\n<p>　　3．尽可能详细耐心地回答借出者的提问，通过沟通加深彼此的了解，对各种可能出现的情况提前进行说明，借出者在获得自己想要的信息之余还会对您的耐心细心留下深刻的印象。&nbsp;</p>\r\n<p>有所不为：&nbsp;</p>\r\n<p>　　1．不提供任何虚假信息。p2p信贷的后台审核人员对于用户资料的甄别非常认真严格，能够避免大部分欺诈借款的通过，而且p2p信贷用户之间的交流也可以让一些骗子无所遁形，不要存在侥幸心理，一旦被识别出虚假信息，用户信用会受到非常大的影响，信用恢复也非常困难，没有人愿意将钱投给有诈骗前科的人。&nbsp;</p>\r\n<p>　　2．在不了解平台原理借贷流程的情况下发布借款，屡次流标，有了多次流标记录会让借出者对用户产生怀疑，再次发布借款的成功率也不会太高。&nbsp;</p>\r\n<p>　　3．不要将自己的一些隐私如身份证号，详细住址等公布在公共区域，警惕骗子利用您的信息行骗。 希望您能够在p2p信贷成功借到资金。</p>',6,1457977748,1457977748,0,1,'',0,0,0,35,'','','','','',''),(21,'投资策略','','<font color=\"#444444\" face=\"Arial, Tahoma, Helvetica, 宋体\"><span style=\"line-height:19px;\">一旦您决定通过p2p信贷进行投资，您就可以利用我们为您提供的工具、数据和p2p信贷独一无二的优势??透明性，开始构建专属于您的投资组合。 在您构建投资组合时先要明确的是您的风险偏好和承受损失的能力。通常来讲较高的收益会对应较高的风险，低风险也只会带来较低的收益。具体到p2p信贷来讲，信用等级高、信用信息优秀（毕业于著名高校，在有实力的公司任职等）且信用资料完善的借入者违约几率极低，所以支付给您的利息也会相对较低（还是高于一般理财产品），较低信用级别或是信用信息并不出众的借入者则会支付更多的利息，但是相对而言违约率也会有所增加。通过浏览借款人的详细资料（包括毕业院校，婚姻状况，工作情况，p2p信贷借款记录，借款描述，财务状况等）、信用等级，p2p信贷审核记录以及亲身与之交流，您可以挑选出更适合您风险偏好的贷款。如果您承受风险的能力较强，为了追求更高的收益您可以制定较为激进的投资策略并在您的投资组合中更多的加入信用级别相对较低的借入者，反之，如果您厌恶风险，追求更加稳定的回报，您可以制定更加稳健的投资策略在您的投资组合中更多的考虑高信用级别的借款人。同时，您的投资策略还应随着您的财务状况的变化做出相应的调整。</span></font>',6,1457977748,1457977748,0,1,'',0,0,0,36,'','','','','',''),(22,'无抵押贷款骗局','','<p>目前全国很多地方出现了小额无抵押贷款信息，这些公司均是不限地区，也不需要任何抵押，只需身份证就可以放贷款。事实证明这些信息基本都是欺诈信息。 无抵押贷款，正规金融机构只有个别银行推出了公务员担保的小额无抵押贷款及农村信用社的多户联保，而且需要按照正规流程:到银行面签合同，提供工资卡的银行对帐单等。事实上这些业务在实践中也不断出现问题，甚至多数已经名存实亡，或者不断提高要求导致贷款量逐渐萎缩。至于民间机构（包括新成立的小额贷款公司），则多数不敢涉足，或者欲尝辄止，难成气候。 纵观目前出现的骗局，他们都有一定的行为模式，共同之处可能包括：&nbsp;</p>\r\n<p>　　1．公司名头比较吓人，所谓的“xx贷款集团”等，甚至有个别还提供营业执照复印件，造假痕迹十分明显。事实上，所谓的“xx贷款集团”，根本不可能在工商部门登记注册，即使提供的营业执照复印件，也是仿造的；&nbsp;</p>\r\n<p>　　2．一般只提供手机号、联系人和QQ，无固定电话，无办公地址，通过网上搜索该号码可以看到在全国不同城市的业务都是用同一号码，非常有问题；&nbsp;</p>\r\n<p>　　3．一般都说明公司在全国各大中城市均设有分支机构，各地都可以方便的办理业务；&nbsp;</p>\r\n<p>　　4．放贷条件十分宽松，手续简便，只需提供基本资料如身份证，户口本或营业执照，无需抵押；&nbsp;</p>\r\n<p>　　5．利率看似合理，月息1%?3%不等；&nbsp;</p>\r\n<p>　　6．当借款人联系后，骗子们会找出各种理由要求先收取前期费用（如预付利息，律师费，核实费，保险费，手续费，保证金等）；&nbsp;</p>\r\n<p>　　7．当借款人付费后，发现骗子再也无法联系上；&nbsp;</p>\r\n<p>p2p借贷系统在这里真诚提醒您：&nbsp;</p>\r\n<p>　　1．请到对方公司进行实地查看，并签订正式合同。&nbsp;</p>\r\n<p>　　2．请仔细辨别公司是否为正当经营的企业。&nbsp;</p>\r\n<p>　　3．请不要在贷款未到账之前支付任何前期费用。 p2p信贷提供一个借入借出者自由交流的平台，借入借出者的准入都要求通过实名身份验证，发布借款需要通过各项审核，借款完成放标前需要通过视频验证，电话验证各项验证，尽可能的保证借款的安全，但是我们的措施不能做到万无一失，我们通过审核认证等行为尽可能详细地了解用户信息，对用户的投资理财给出专业的建议，您可以基于我们的建议作出自己的决定。</p>',6,1457977748,1457977748,0,1,'',0,0,0,37,'','','','','',''),(23,'新手上路','','如果您是一个投资新手，不知道从何开始，p2p信贷是您不二的选择，我们为您提供流水化的、简单的投资过程，帮您实现轻松理财。 信息的透明度是我们一贯坚持的理念。p2p信贷为您提供完全透明、真实的信息，使您能够做出正确的投资选择。通过借款人的信用记录、投标进程的即时更新，您可以全程了解您投资的去向。另外，很重要的一点是您可以了解您把钱借给了谁，用做什么用途。我们的借款人是真实存在的个体，而不是像一些公司那样，让您无从得知投资的用途。 作为一个投资新手，您可以阅读一些有关投资方面的书，也可以向身边的朋友寻求一些建议。p2p信贷也为您提供了一个简单易行的理财方法。但是这并不意味着在p2p信贷投资没有任何风险，您也有可能遇到不按时还款的借款人、甚至坏账。这就是我们为什么建议您分散投资，使您的投资组合多样化。详情请参考“分散投资降低风险”。',6,1457977748,1457977748,0,1,'',0,0,0,38,'','','','','',''),(24,'分散投资降低风险','','p2p借贷系统网络平台的一大优势在于丰富、透明、全面的信息，您可以轻松接触到所有借入者的必要资料，加之平台最低允许单笔50元的投资，您可以轻松投资多个借入者。 投资多个借入者的一大好处在于有效降低风险。虽然不管投资多么分散单笔投资的违约率是不会改变的，但是由于资金分散，单笔投资规模较小，一笔投资不能收回不会严重影响收益率。反之，如果投资过于集中，一旦出现违约会对投资收益造成严重影响甚至给您带来损失。因而我们建议您在投资时尽量将资金分成多笔投出，不要集中在一笔或者几笔上。具体应该分散到什么程度跟您的投资策略息息相关，当您更多的选择低信用级别的借入者以追求高收益时，您应适当加大分散程度。反之，当您更多的选择高信用级别的借款人以追求稳定的回报时，可以适当降低分散程度从而减少您的工作量。原则上讲，我们建议您将手中的资金分成至少20份投出。 另外，分散投资可以让您帮助更多的借入者，在投资的同时享受帮助他人的乐趣。分散投资还可以让您有效的建立投资组合，具体请参考“投资策略”。',6,1457977748,1457977748,0,1,'',0,0,0,39,'','','','','',''),(25,'风险与收益','','在任何投资中，收益和风险都形影相随，收益以风险为代价，风险用收益来补偿。投资者投资的目的是为了得到收益，与此同时，又不可避免地面临着风险，在p2p信贷投资也是如此。 通过p2p信贷，您可以注册成为借出者并投资购买一个或多个借款列表中的部分或者全部债权。当一个借入者加入p2p信贷并提交了相应的资料后（包括工作证明、社区网证明、学历证明、身份验证、微博验证、购车证明、结婚证明、个人信用报告、收入证明等），我们会严格审查资料，尽可能确定资料的真实性，并利用我们的信用评估系统授予该借入者一个p2p信贷信用等级。通过审核的资料会在借入者发布借款时部分的披露给借出者，以便借出者做出正确的判断（一般来说，著名高校毕业、就职于知名企业或政府部门、社区网使用活跃、已购车、已婚、收入较高等都能直接或间接说明借入者还款意愿和能力更强）。而借入者的信用等级则由其通过审核的数量和其之前在网站上的借贷行为决定。通常，信用等级越高披露的信用资料越优秀出现违约的几率也就越小，反之则违约几率加大。 更小的违约几率代表更加确定的收益，但是由于借入者信用级别较高，或是他的信用资料很优秀时，她/他所接受的利息通常较低。因而投资这类借入者通常会带来风险小、稳定但是较低的收益。反之，较低的信用级别代表相对较大的风险，但当借入者信用级别较低，且信用资料并不出众时，她/他所接受的利息会相对较高。于是，投资低信用等级借入者通常会带来具有一定风险但是较高的收益。 了解了风险与回报的关系您就可以根据您的风险偏好来选择借入者进行投资了。p2p信贷网络平台的优势让您可以将您手中的资金分散投给多个借入者，于是您可以制定自己的投资策略，构建自己的投资组合。具体请参考“投资策略”于“分散投资降低风险”。',6,1457977748,1457977748,0,1,'',0,0,0,40,'','','','','',''),(26,'信用等级的解读','','最近，部分用户反映不是很理解我们的信用等级，我在这里做一下说明。如果大家读过本栏目中的“风险与收益”、“投资策略”以及“如何判断借款列表” 那么一定知道借入者信用水平有高有低，潜在的违约率也不尽相同。目前，p2p借贷系统根据借入者提交的信用审核资料将借入者分成7个信用等级，由高到低分别是 AA、A、B、C、D、E、HR。其中，AA为信用水平最高级，代表极低的违约率，同时，这类借款人通常接受的利率也较低。反过来，HR则代表低信用水平，潜在的违约风险也较其他信用等级为高，所以需要提供更高的利息来弥补出借人承担的风险。具体分数线以及等级的划分可以参考“我的帐户”内的“信用审核”页面。 p2p借贷系统信用审核',6,1457977748,1457977748,0,1,'',0,0,0,41,'','','','','',''),(27,'政策法规','','<div class=\"blank20\"></div>\r\n<div class=\"f_dgray b f12\">    一、民间借贷的定义</div>\r\n<div class=\"blank20\"></div>\r\n民间借贷是指自然人之间、自然人与法人之间、自然人与其它组织之间借贷。民间借贷是《民法通则》中一种民事法律行为，行为人在具有完全民事行为能力（即年满18周岁，且不存在足以影响自身行为的精神疾病的情形）、意思表示真实，借款合同符合法律、行政法规规定，则该借款合同完全受到《合同法》等法律的保护。民间借贷是民间资本的一种投资渠道，作为银行金融的有效补充已逐渐成为民间金融的一种重要形式。<div class=\"blank20\"></div>\r\n<div class=\"f_dgray b f12\">    二、民间借贷的法律环境</div>\r\n<div class=\"blank20\"></div>\r\n《国务院关于鼓励和引导民间投资健康发展的若干意见》：新36条出台，鼓励民间资本进入金融领域，发起设立金融中介服务机构。<div class=\"blank20\"></div>\r\n《中华人民共和国合同法》从法律上肯定了民间借贷行为的合法性，并从法律层面保护出借人收回借贷资金和利息的权利。<div class=\"blank20\"></div>\r\n《合同法》第211条：“自然人之间的借款合同对支付利息没有约定或约定不明确的，视为不支付利息。自然人之间的借款合同约定支付利息的，借款的利率不得违反国家有关限制借款利率的规定”。<div class=\"blank20\"></div>\r\n最高人民法院《关于人民法院审理借贷案件的若干意见》第6条：“民间借贷的利率可以适当高于银行的利率，各地人民法院可以根据本地区的实际情况具体掌握，但最高不得超过银行同类贷款利率的四倍，（包含利率本数）。超出此限度的，超出部分的利息不予保护”。<div class=\"blank20\"></div>\r\n<div class=\"f_dgray b f12\">    三、p2p信贷的合法性</div>\r\n<div class=\"blank20\"></div>\r\n《合同法》第二十三章“居间合同”中明确规定，居间人提供贷款合同订立的媒介服务，可依法向委托方收取相应的报酬。因此贷款服务机构的存在和服务费的收取都是符合法律规定并受法律保护的。<div class=\"blank20\"></div>\r\np2p信贷既不吸储，也不放贷，作为一个网络信用管理及借贷服务中介机构，其业务范围和经营活动完全符合相关法律和国家的政策规定。p2p信贷将在国家法律和相关政策的指引下，为广大借款人、出借人提供优质、高效的服务。<div class=\"blank20\"></div>\r\n<div class=\"f_dgray b f12\">    四、政策倾向</div>\r\n<div class=\"blank20\"></div>\r\n<a href=\"http://finance.qq.com/a/20111110/006098.htm?qq=0&amp;ADUIN=1053718065&amp;ADSESSION=1320928475&amp;ADTAG=CLIENT.QQ.3847_.0\" target=\"_blank\"> “央行：“民间借贷有合法性 利率不得高于银行4倍”</a><div class=\"blank20\"></div>\r\n央行有关负责人表示，在遵守相关法律前提下，自然人、法人及其他组织间有自由借贷的权利。只要不违反法律的强制性规定，民间借贷关系都受法律保护。民间借贷是正规金融的有益补充。',3,1457977748,1457977748,0,1,'u:index|aboutlaws',0,0,4,42,'','','','aboutlaws','',''),(28,'选择p2p信贷','','<div style=\"padding:10px;\">\r\n\t<div class=\"about_title2\">\r\n\t\t稳定的回报\r\n\t</div>\r\n\t<div style=\"margin:8px 0px 8px 0px;\">\r\n\t</div>\r\n\t<div style=\"font-size:13px;\">\r\n\t\t<p>\r\n\t\t\t在股票、债券、银行存款等传统投资方式之外，p2p信贷为您提供了一种新的投资途径，您可以将钱5.9%?23.4%不等的年利率，出借给哪些有需要的借入者，\t\t\t\t然后每月回收本金和利息，从而获取稳定的投资回报。\r\n\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"padding:10px;\">\r\n\t<div class=\"about_title2\">\r\n\t\t帮助他人\r\n\t</div>\r\n\t<div style=\"margin:8px 0px 8px 0px;\">\r\n\t</div>\r\n\t<div style=\"font-size:13px;\">\r\n\t\t<p>\r\n\t\t\t在p2p信贷上，您可以自由的选择将钱出借给您希望帮助的群体，如医生、警察、消防员，或者创业人群等。\t\t\t\t您也可以通过借款目的来选择您出借的对象，如教育培训借款，婚礼筹备借款等。这一切都将是您在获取稳定回报的同时，实现了帮助他人的人生价值。\r\n\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"padding:10px;\">\r\n\t<div class=\"about_title2\">\r\n\t\t详尽客观的借入者信息\r\n\t</div>\r\n\t<div style=\"margin:8px 0px 8px 0px;\">\r\n\t</div>\r\n\t<div style=\"font-size:13px;\">\r\n\t\t<p>\r\n\t\t\tp2p信贷以客观公正的态度，尽最大的努力去审核借入者的每一项信用信息。包括借入者的工作情况，家庭情况，收入情况，信用情况等。\t\t\t\tp2p信贷将这些信用信息分析整理后，最大限度地提供给出借者，以帮助出借者做出客观正确的出借抉择。\r\n\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"padding:10px;\">\r\n\t<div class=\"about_title2\">\r\n\t\t分散投资\r\n\t</div>\r\n\t<div style=\"margin:8px 0px 8px 0px;\">\r\n\t</div>\r\n\t<div style=\"font-size:13px;\">\r\n\t\t<p>\r\n\t\t\t我们同时也要提醒您，在p2p信贷的出借并不是100%安全的，借出的金额也存在一定的违约风险。然而通过p2p信贷，您可以将您的总出借金额，\t\t\t\t以最低50元一笔的方式分散出借给很多借入者，这样的分散投资将大大降低您的整体投资风险。\r\n\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"padding:10px;\">\r\n\t<div class=\"about_title2\">\r\n\t\t灵活的投资周期\r\n\t</div>\r\n\t<div style=\"margin:8px 0px 8px 0px;\">\r\n\t</div>\r\n\t<div style=\"font-size:13px;\">\r\n\t\t<p>\r\n\t\t\tp2p信贷提供3个月、6个月、9个月、12个月、18个月、24个月、和36个月7种借款期限选择。因此出借者可以根据自己的需要，将钱投资给不一样周期的借款人。\t\t\t\t同时，由于借入者是每月还款，因此出借者很快就可以开始回收投资，并非要等到借款到期时才可拿回本金。在回收本息的过程中，\t\t\t\t出借者可以将回收的钱出借给其他借款人来获取更多的回报，也可将钱自由支配，用于其他用途。\r\n\t\t</p>\r\n\t</div>\r\n</div>',25,1457977748,1457977748,0,1,'u:index|deals&act=about&u=choose',0,0,16,43,'','','','choose','',''),(29,'投资回报','','<div style=\"margin-top:10px;padding:10px;\">\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t通过p2p信贷，您可以将手中的富余资金出借给信用良好但缺少资金的大学生、工薪阶层、微小企业主、农民，帮助他们实现教育培训、电脑或家电购买、\t\t\t装修、兼职创业、脱贫致富等理想，同时还能通过利息收入为您带来较高的稳定收益，\t\t\t实现精神和物质的双重回报。根据p2p信贷的历史经验数据，资金年收益始终保持在10%以上。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">各类型投资产品收益及风险对比分析</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;\" class=\"dunDetail\">\t\t<table width=\"480\" style=\"text-align:center;background:#d3d4d8;\" border=\"0\" cellspacing=\"1\">\t\t\t<tbody><tr bgcolor=\"#e1f0ff\" style=\"font-weight:bold;height:37px;\">\t\t\t\t<td>产品</td>\r\n\t\t\t\t<td>年收益</td>\r\n\t\t\t\t<td>风险级别</td>\r\n\t\t\t\t<td>流动性</td>\r\n\t\t\t</tr>\r\n\t\t\t<tr style=\"height:37px;\" bgcolor=\"#ffffff\">\t\t\t\t<td>一年期定存</td>\r\n\t\t\t\t<td>2.6%</td>\r\n\t\t\t\t<td>★</td>\r\n\t\t\t\t<td>★</td>\r\n\t\t\t</tr>\r\n\t\t\t<tr style=\"height:37px;\" bgcolor=\"#ffffff\">\t\t\t\t<td>一年期国债</td>\r\n\t\t\t\t<td>2.6%</td>\r\n\t\t\t\t<td>★</td>\r\n\t\t\t\t<td>★</td>\r\n\t\t\t</tr>\r\n\t\t\t<tr style=\"height:37px;\" bgcolor=\"#ffffff\">\t\t\t\t<td>银行理财产品</td>\r\n\t\t\t\t<td>3%?6%</td>\r\n\t\t\t\t<td>★★</td>\r\n\t\t\t\t<td>★</td>\r\n\t\t\t</tr>\r\n\t\t\t<tr style=\"height:37px;\" bgcolor=\"#ffffff\">\t\t\t\t<td>开放式基金</td>\r\n\t\t\t\t<td>不确定</td>\r\n\t\t\t\t<td>★★★</td>\r\n\t\t\t\t<td>★★★★★</td>\r\n\t\t\t</tr>\r\n\t\t\t<tr style=\"height:37px;\" bgcolor=\"#ffffff\">\t\t\t\t<td>股票</td>\r\n\t\t\t\t<td>不确定</td>\r\n\t\t\t\t<td>★★★★★</td>\r\n\t\t\t\t<td>★★★★</td>\r\n\t\t\t</tr>\r\n\t\t\t<tr style=\"height:37px;\" bgcolor=\"#ffffff\">\t\t\t\t<td>p2p信贷</td>\r\n\t\t\t\t<td>10%以上</td>\r\n\t\t\t\t<td>★</td>\r\n\t\t\t\t<td>★★</td>\r\n\t\t\t</tr>\r\n\t\t</tbody>\r\n</table>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">一年期定期存款、国债</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t定期存款与国债的风险，在众多理财途径里面无疑最低的，然而锁定期长，2％左右的回报率，在通过膨胀日益高涨，CPI高于3％的今天，\t\t\t却让资金难以抗衡通胀，从长期来看购买力将越来越低。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">银行理财产品</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t在银行里，锁定期1年以上的理财产品，年化回报率一般在在3－6％左右，但是动辄几百万的投资门槛，将很多理财者拒之门外。相比起来，\t\t\t通过p2p借贷系统借出，资金的回收情况则要灵活的多。此外，理财产品背后的还款来源则是政府的财政贷款，房地产信托等。这些对象的财务情况并非完全透明，\t\t\t对于普通用户来说，往往只能看到表面的情况，难以真正理解其中的风险。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">股票、基金</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t随着中国金融行业的发展，股票和基金已经慢慢地成为了很多人投资理财的选择。然而，股票和激励里那些复杂的概念，创业版，物联网，\t\t\t有色板块，明星基金经理，内部消息等等词汇，我们已慢慢耳熟能详，我们也一次次地期望那个暴富的故事发生在我们身上，然而在现实生活中，\t\t\t却往往发现并不那么给力，我们面临的更多的总是长期套牢。相比起来，通过分散投资，通过借钱还款这样简单明了的赚钱模式，获得稳定的10%以上收益，\t\t\t也许更适合普通的投资者。\t\t</p>\r\n\t</div>\r\n</div>',7,1457977748,1457977748,0,1,'u:index|deals&act=about&u=respond',0,0,23,44,'','','','respond','',''),(30,'投资风险','','<div style=\"margin-top:10px;padding:10px;\">\t<div class=\"about_title2\">p2p信贷的审核机制</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\tp2p信贷结合了国内外先进的信用审查及风险控制机制，形成了一整套贯穿于前期咨询、贷前审核、贷后跟进、回款管理的全面而严密的信用服务流程。\t\t\t截至目前为止，p2p信贷系统上半年以来，坏账率仅为0.8%，远低于同行业1.7%的平均水平。<br />\r\n\t\t\t前期审核阶段，p2p信贷系统将通过对用户的各种材料，以及电话核实的手段，来考查用户的偿还能力，信用习惯，和稳定性三方面。审核时依据的材料包括用户的工作证明，\t\t\t银行流水单，个人信用报告，房产证明，结婚证明等。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">p2p信贷系统的催收机制</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t除了前期严格的审核手段之外，若借款人出现逾期还款情况，p2p信贷将在不同的阶段进行不同程度的催收。<br />\r\n\t\t\t逾期初期，p2p信贷客服将通过电话与借款人进行沟通，做出善意的还款提醒，同时了解用户的逾期原因，并提醒保持良好信用的重要性。<br />\r\n\t\t\t如果p2p信贷客服沟通期间，借款人不积极配合，或者在15天以后依然不进行还款，则p2p信贷将尝试与借款人的联系人等其他联系方式进行沟通。<br />\r\n\t\t\t如果借款用户恶意逃避，或者逾期超过30天，p2p信贷将把借款人的催收委托给第三方全国性催收机构协助催收，同时逐步在借款人的借款详情里公布其逾期信息。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">分散投资，降低风险</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\tp2p信贷平台，为小额资金的分散投资提供了可能，根据经济学原理，每位借款人的还款是独立性极强的事件，这样风险就被大大分散。 <br />\r\n\t\t\t例如，您将10万元借给一个借入者，假设违约率为1％，年利率为12％，一旦出现那1％的机率，该借款人违约不还，那么您所承受的风险将是100%。\t\t\t但是，如果您能将10万元分成100元一笔，借出给1000个违约率为1%，\t\t\t年利率为12%的借款人由于不同的借款人之间有极强的独立性，在这种投资方式下损失本金的概率将会变得非常低，约等于零。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">风险保证金体系，逾期本金垫付</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\tp2p信贷的风险保证金。风险保证金在理财者的出借资金遇到回收问题时，用以补偿其本金的损失，这将在很大程度上保证理财者的资金安全。<br />\r\n\t\t\t目前p2p信贷的保证金处于试运行阶段，并免费将所有E级以上用户申请的借款纳入风险保证体系。当纳入风险保证体系的借款人逾期后，风险金将向理财者垫付本金，\t\t\t同时该笔借款未来的本息、罚息等收益权，将归风险保证金所有。<br />\r\n\t\t\t风险保证金具体细则，将在正式上线后公布。\t\t</p>\r\n\t</div>\r\n</div>',7,1457977748,1457977748,0,1,'u:index|deals&act=about&u=risk',0,0,24,45,'','','','risk','',''),(31,'政策法规','','<div style=\"margin-top:10px;padding:10px;\">\t<div class=\"about_title2\">民间借贷的定义</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t民间借贷是指自然人之间、自然人与法人之间、自然人与其它组织之间借贷。民间借贷是《民法通则》中一种民事法律行为，\t\t\t行为人在具有完全民事行为（即年满18周岁，且不存在足以影响自身行为的精神疾病的情形）、意思表示真实，借款合同符合法律、\t\t\t行政法规规定，则该借款合同完全受到《合同法》等法律的保护。民间借贷是民间资本的一种投资渠道，\t\t\t作为银行金融的有效补充已逐渐成为民间金融的一种重要形式。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">P2P民间借贷的法律环境</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t《国务院关于鼓励和引导民间投资健康发展的若干意见》：新36条出台，鼓励民间资本进入金融领域，发起设立金融中介服务机构。<br />\r\n\t\t\t《中华人民共和国合同法》从法律上肯定了民间借贷行为的合法性，并从法律层面保护出借人收回借贷资金和利息的权利。<br />\r\n\t\t\t《合同法》第211条：“自然人之间的借款合同对支付利息没有约定或约定不明确的，视为不支付利息。自然人之间的借款合同约定支付利息的，\t\t\t借款的利率不得违反国家有关限制借款利率的规定”<br />\r\n\t\t\t最高人民法院《关于人民法院审理借贷案件的若干意见》第6条：“民间借贷的利率可以适当高于银行的利率，\t\t\t各地人民法院可以根据本地区的实际情况具体掌握，但最高不得超过银行同类贷款利率的四倍，（包含利率本款）。超出此限度的，超出部分的利息不予保护”。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">p2p信贷的合法性</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t《合同法》第二十三章“居间合同”中明确规定，居间人提供贷款合同订立的媒介服务，可依法向委托方收取相应的报酬。\t\t\t因此贷款服务机构的存在和服务费的收取都是符合法律规定并受法律保护的。<br />\r\n\t\t\tp2p信贷既不吸储，也不放贷，作为一个网络信用管理及借贷服务中介机构，其业务范围和经营活动完全符合相关法律和国家的政策规定。\t\t\tp2p信贷将在国家法律和相关政策的指引下，为广大借款人、出借人提供优质、高效的服务。\t\t</p>\r\n\t</div>\r\n</div>',7,1457977748,1457977748,0,1,'u:index|deals&act=about&u=rule',0,0,23,46,'','','','rule','',''),(32,'投资小提示','','<div style=\"margin-top:10px;padding:10px;\">\t<div class=\"about_title2\">不要盲目跟投</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>p2p信贷结合了国内外先进的信用审查及风险控制机制，形成了一整套贯穿于前期咨询、贷前审核、贷后跟进、回款管理的全面而严密的信用服务流程。截至目前为止，p2p信贷上线半年以来，坏账率仅为0.8%，远低于同行业1.7%的平均水平。<br />\r\n\t\t\t前期审核阶段，p2p信贷将通过对用户的各种材料，以及电话核实的手段，来考查用户的偿还能力，信用习惯和稳定性三方面。审核时依据的材料包括用户的工作证明、银行流水单、个人信用报告、房产证明、结婚证明等。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">不要在投资中夹杂过多感情因素</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t除了前期严格的审核手段之外，若借款人出现逾期还款情况，p2p信贷将在不同的阶段进行不同程度的催收。<br />\r\n\t\t\t逾期初期，p2p信贷客服将通过电话与借款人进行沟通，做出善意的还款提醒，同时了解用户的逾期原因，并提醒保持良好信用的重要性。  <br />\r\n\t\t\t如果p2p信贷客服沟通期间，借款人不积极配合，或者在15天以后依然不进行还款，则p2p信贷将尝试与借款人的联系人等其他联系方式进行沟通。<br />\r\n\t\t\t如果借款用户恶意逃避，或者逾期超过30天，p2p信贷将把借款人的催收委托给第三方全国性催收机构协助催收，同时逐步在借款人的借款详情里公布其逾期信息。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">关注借入者的网络行为</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\tp2p信贷平台，为小额资金的分散投资提供了可能，根据经济学原理，每位借款人的还款是独立性极强的事件，这样风险就被大大分散。<br />\r\n\t\t\t例如，您将10万元借给一个借入者，假设违约率为1％，年利率为12％，一旦出现那1％的机率，该借款人违约不还，那么您所承受的风险将是100%损失。\t\t\t但是，如果您将10万元分成100元一笔，借出给1000个违约率为1%，年利率为12%的借款人，由于不同的借款人之间有极强的独立性，在这种投资方式下损失本金的概率将会变得非常低，约等于零。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">主动向借入者提问</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\tp2p信贷即将推出风险保证金。风险保证金在理财者的出借资金遇到回收问题时，用以补偿其本金的损失，这将在很大程度上保证理财者的资金安全。<br />\r\n\t\t\t目前p2p信贷的保证金处于试运行阶段，并免费将所有E级以上用户申请的借款纳入风险保证体系。当纳入风险保证体系的借款人逾期后，风险金将向理财者垫付本金，\t\t\t同时该笔借款本来的本息、罚息等收益权，将规风险保证金所有。\t\t\t<br />\r\n\t\t\t风险保证金具体细则，将在正式上线后公布。\t\t</p>\r\n\t</div>\r\n</div>\r\n<div style=\"margin-top:20px;padding:10px;\">\t<div class=\"about_title2\">关注借款人信用等级以外的其他信息</div>\r\n\t<div style=\"border-bottom:1px solid #9c9c9c;margin:8px 0px 8px 0px;\"></div>\r\n\t<div style=\"font-size:13px;line-height:20px;\">\t\t<p>\t\t\t毋庸置疑，借款人的信用等级在很大程度上说明了借款人的信用情况，但是有时通过借入人是哪个院校毕业的、他/她做过哪些认证、他/她之前的还款情况怎样、\t\t\t他/她的借款用途是什么、他/她准备如何还款等其他信息也能在一定程度上判断出借款人是否有还款能力和还款意愿。\t\t</p>\r\n\t</div>\r\n</div>',7,1457977748,1457977748,0,1,'u:index|deals&act=about&u=clew',0,0,837,47,'','','','clew','',''),(33,'本金保障计划','','<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">什么是本金保障计划？</h3>\r\n<p>本金保障指当理财人（借出者）投资的借款出现严重逾期时（即逾期超过30天），p2p信贷系统将向理财人垫付此笔借款未归还的剩余出借本金或本息（具体情况视投资标的类型的具体垫付规则为准），从而为理财人营造一个安全的投资环境，保证投资人的本金安全。</p>\r\n<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">理财人（出借者）需要向p2p信贷系统支付本金保障计划服务的费用吗？</h3>\r\n<p>当前理财人无需支付任何费用，通过身份认证成为借出者即可享受此服务。</p>\r\n<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">如果我投资的借款发生逾期了，p2p信贷系统如何赔付？</h3>\r\n<p>当您投资的借款发生逾期30天后，p2p信贷风险备用金账户会在一个工作日内将此笔借款的应赔付金额自动充入您的p2p信贷账户中（具体情况视投资标的类型的具体垫付规则为准）。</p>\r\n<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">我在p2p信贷上的所有理财投资是否都适用p2p信贷本金保障计划？</h3>\r\n<p>是的，每项投资的具体垫付规则视投资标的具体类型而定。</p>\r\n<div class=\"bztitle\">风险备用金账户规则</div>\r\n<p>“风险备用金账户”是指为p2p信贷系统所服务的所有理财人的共同利益考虑、以p2p信贷名义单独开设并由其管理的一个专款专用账户。</p>\r\n<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">“风险备用金账户”资金来源：</h3>\r\n<p>“风险备用金账户”资金当前全部来源于p2p信贷系统根据其与借款人签署的协议向其所服务的借款人所收取的服务费（以下简称“服务费”），p2p信贷系统在依协议向借款人收取服务费的同时，将在收取的服务费中按照贷款产品类型及借款人的信用等级等信息计提风险备用金（详见《p2p信贷系统风险备用金账户?产品垫付规则明细表》）。计提的风险备用金将存放入“风险备用金账户”进行专户管理。各产品类型及信用等级等所对应的风险备用金的计提标准和方式由p2p信贷制定并解释，p2p信贷有权根据实际业务需要对相关内容进行调整，如作修改，p2p信贷将及时进行披露。 </p>\r\n<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">“风险备用金账户”资金用途：</h3>\r\n<p>“风险备用金账户”资金将专门用于在一定限额内弥补p2p信贷所服务的理财人（债权人）由于借款人（债务人）的违约所遭受的本金或本息的损失（具体赔付金额以所投资的产品类型的垫付规则为准），即当借款人（债务人）逾期还款超过30日时，p2p信贷将按照“风险备用金账户”资金使用规则从该账户中提取相应资金用于偿付理财人（债权人）应收取的本金或本息金额（不同产品的垫付范围请参考《p2p信贷系统风险备用金账户?产品垫付规则明细表》）（以下统一简称“逾期应收赔付金额”）。</p>\r\n<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">“风险备用金账户”资金使用规则：</h3>\r\n<p>“风险备用金账户”资金使用遵循以下规则：<br />\r\n1、违约偿付规则，即当借款人（债务人）逾期还款超过30 日时，方才从“风险备用金账户”资金中抽取相应资金偿付理财人（债权人）逾期应收赔付金额。<br />\r\n2、时间顺序规则，即“风险备用金账户”资金对理财人（债权人）逾期应收赔付金额的偿付按照该债权发生的时间顺序进行偿付分配，先偿付时间发生在前的债权，后偿付时间发生在后的债权。<br />\r\n3、债权比例规则， “风险备用金账户”资金对同一借款协议下的不同理财人（债权人）逾期应收赔付金额的偿付按照各债权金额占同协议内发生的债权总额的比例进行偿付分配；或，当“风险备用金账户”资金当期余额不足以支付当期（每月为一期）所有应享受该账户的理财人所对应的逾期赔付金额时，则当期应享受该账户的理财人按照各自对应的逾期应收赔付金额占当期所有理财人对应的逾期应收赔付总额的比例进行偿付分配。<br />\r\n4、有限偿付规则，即“风险备用金账户”资金对理财人（债权人）逾期应收赔付的偿付以该账户的资金总额为限，当该账户余额为零时，自动停止对理财人逾期应收赔付金额的偿付，直到该账户获得新的风险备用金。<br />\r\n5、收益转移规则，即当理财人享有了“风险备用金帐户”对某笔逾期债权赔付金额的足额偿付后，该债权对应的借款人其后为该笔债权所偿还的本金、利息及罚息归属“风险备用金账户”；如债权有抵押、质押及其他担保的，则平台代借款人处置抵押质押物的所得等也归属“风险备用金账户”。<br />\r\n6、金额上限规则，即当“风险备用金帐户”内金额超过当时平台上所有债权本金金额的10%时，p2p借贷系统有权将超出部分转出该账户，转出部分归p2p借贷系统所有。<br />\r\n</p>\r\n<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">“风险备用金账户”资金管理原则：</h3>\r\n<p>p2p信贷将审慎管理“风险备用金账户”资金，并就账户及资金使用情况对理财人进行定期（按季度/月）披露。具体披露方式及解释权归p2p信贷所有。</p>\r\n<h3 style=\"border-bottom:medium none;border-left:medium none;border-top:medium none;border-right:medium none;\">附表：《p2p信贷风险备用金账户?产品垫付规则明细表》</h3>\r\n<p style=\"position:relative;text-align:center;\"><img border=\"0\" alt=\"\" src=\"./public/images/aq/benjinhelp.jpg\" /></p>\r\n<p class=\"b\">注：信用认证标中与部分渠道合作的产品风险金计提标准不适用上表规则，将根据合作渠道的具体情形单独设定。</p>',8,1457977748,1457977748,0,1,'',0,0,658,48,'','','','','',''),(34,'账户安全','','<h3>第三方资金托管</h3>\r\n<p>p2p信贷目前对客户交易资金的保管完全按照\"专户专款专用\"的标准模式进行运作，客户在p2p信贷的交易资金是可以完全放心的。</p>\r\n<ul id=\"anquan_step\" class=\"clearfix\"><li><a href=\"./#zha_stpe1\">第 1 步：牢记p2p信贷系统官方网址，警惕欺诈网站</a></li>\r\n<li><a href=\"./#zha_stpe2\">第 2 步：用邮箱注册一个p2p信贷系统账号</a></li>\r\n<li><a href=\"./#zha_stpe3\">第 3 步：设置高强度的\"登录密码\"</a></li>\r\n<li><a href=\"./#zha_stpe4\">第 4 步：多给电脑杀毒</a></li>\r\n</ul>\r\n<h3 id=\"zha_stpe1\">第 1 步：牢记p2p信贷官方网址，警惕欺诈网站</h3>\r\n<p>请牢记p2p信贷的官方网址是http://www.fanwe.com，不要点击来历不明的链接访问p2p信贷。您可将p2p信贷的官网链接添加到浏览器的收藏夹中，以便您的下次登录。</p>\r\n<h3 id=\"zha_stpe2\">第 2 步：用邮箱注册一个p2p信贷系统账号</h3>\r\n<p>您可以用一个常用的电子邮箱注册一个p2p信贷账号，您将用该邮箱接收来自p2p信贷的验证、提醒等重要通知邮件。</p>\r\n<h3 id=\"zha_stpe3\">第 3 步：设置高强度的\"登录密码\"</h3>\r\n<p>什么是高强度的登录密码，怎么设置会更安全？您在密码设置时，最好使用数字和字母混合，不要使用纯数字或纯字母。强烈建议不要把\"登录密码\"设置成生日、姓名拼音或是邮箱名，这些都是容易被他人猜到的形式。</p>\r\n<h3 id=\"zha_stpe4\">第 4 步：多给电脑杀毒</h3>\r\n<p>及时更新操作系统补丁，升级新版浏览器，安装反病毒软件和防火墙并保持更新；避免在网吧等公共场所使用网上银行，不要打开来历不明的电子邮件等。</p>\r\n<p>电脑中毒会怎么样？ 如果电脑一直中毒，病毒会容易获取您的账户信息。</p>\r\n<p>电脑怎么杀毒？ 我们推荐支付宝安全联盟，联盟提供了很多免费的杀毒软件下载。</p>',9,1457977748,1457977748,0,1,'',0,0,619,49,'','','','','',''),(35,'隐私保护','','<h3>\r\n\t我们有哪些措施保障您的隐私安全\r\n</h3>\r\n<ul id=\"anquanli\">\r\n\t<li>\r\n\t\tp2p信贷系统严格遵守国家相关法律法规，对用户的隐私信息进行严格的保护。\r\n\t</li>\r\n\t<li>\r\n\t\t我们采用业界最先进的加密技术，用户的注册信息、账户收支信息都已进行高强度的加密处理，不会被不法分子窃取到。\r\n\t</li>\r\n\t<li>\r\n\t\tp2p信贷系统设有严格的安全系统，未经允许的员工不可获取您的相关信息。\r\n\t</li>\r\n\t<li>\r\n\t\tp2p信贷系统绝不会将您的账户信息、银行信息以任何形式透露给第三方。\r\n\t</li>\r\n</ul>\r\n<h3>\r\n\t个人信息安全：\r\n</h3>\r\n<p>\r\n\tp2p信贷系统是一个实名认证平台，p2p信贷系统会保证用户信息隐私的安全，用户在平台上交流的过程中，也要时刻注意保护个人隐私，截图注意覆盖个人信息，不要透露真实姓名与住址等，以防个人信息被盗取造成损失。\r\n</p>',14,1457977748,1472021062,0,1,'',0,0,816,50,'','','','','',''),(36,'严格的贷前审核','','<div class=\"lca_coninfo\">贷前审核：<br />\r\n在客户提出借款申请后，p2p信贷系统会对客户的基本资料进行分析。通过网络、电话及其他可以掌握的有效渠道进行详实、仔细的调查。避免不良客户的欺诈风险。在资料信息核实完成后，根据个人信用风险分析系统进行评估，由经验丰富的贷款审核人员进行双重审核确认后最终决定批核结果。</div>',10,1457977748,1457977748,0,1,'',0,0,1070,51,'','','','','',''),(37,'完善的贷中贷后管理','','<div class=\"lca_coninfo\">贷中审查：<br />\r\n贷中审核人员会对借款中客户资料的有效期、资料属性及客户的还款状态进行实时监控，对客户信息变动进行更新。保持与客户的畅通联系，避免失去联系导致借款产生风险。对异常客户转入贷后管理系统。</div>\r\n    <div class=\"lca_coninfo\">贷后管理：<br />\r\n如果用户逾期未归还贷款，贷后管理部门将第一时间通过短信、电话等方式提醒用户进行还款，如果用户在5天内还未归还当期借款，p2p信贷将会联系该用户的紧急联系人、直系亲属、单位等督促用户尽快还款。如果用户仍未还款，交由专业的高级催收团队与第三方专业机构合作进行包括上门等一系列的催收工作，直至采取法律手段。</div>',10,1457977748,1457977748,0,1,'',0,0,979,52,'','','','','',''),(38,'五大重要守则','','<h3>安全补丁更新：</h3>\r\n<p>些常用的计算机软件的保安漏洞可被病毒作者和黑客利用，来进入那些未安装安全补丁程序的计算机，盗取资料。一旦发现这种情况，软件出版商便会推出安全补丁程序来堵塞这些漏洞。您可定期浏览软件出版商的网站，对操作系统和应用软件进行安全补丁更新。 </p>\r\n<h3>防病毒软件：</h3>\r\n<p>安装防病毒软件，定期更新软件及安装最新的病毒定义文件，有效保障计算机免受病毒侵袭。 </p>\r\n<h3>个人防火墙：</h3>\r\n<p>安装防火墙，帮助保护您的计算机系统不会在连接互联网时受到侵袭，可阻止资料在未经您授权下传入或传出您的计算机。 </p>\r\n<h3>反间谍程序：</h3>\r\n<p>间谍软件可运行在用户计算机上用以监测及收集用户上网信息的程序，能够监测和搜集用户的上网信息，比如获取您输入的个人信息，包括密码、电话号码、信用卡帐号及身份证号码。间谍软件往往作为某些服务的「免费」下载程序的一部分下载到个人计算机中，或在未经您同意或知晓的情况下被下载到您的计算机中。我们强烈建议您安装并使用较有信誉的反间谍软件产品以保护您的计算机免受间谍软件的侵害。 </p>\r\n<h3>密码设置注意事项：</h3>\r\n<p>密码是取得您的网上户口数据的钥匙，因此您必须紧记将密码妥为保密。密码可以是任何字符，包括数字、字母、特殊字符等。长度在6～16位之间，区分英文字母大小写。密码最好是包含字母、数字、特殊字符的组合，不要设置成常用数字，如：生日、电话号码等，也不要设为一个单词。密码的位数应该超过六位，经常修改密码，并为重要服务例如网上理财服务设置独立的密码。 </p>',11,1457977748,1457977748,0,1,'',0,0,931,53,'','','','','',''),(39,'避免私下交易','','<p>p2p信贷系统建议用户避免尝试私下交易。私下交易的约束力极低，不受《合同法》的保护，造成逾期的风险非常高，同时您的个人信息将有可能被泄漏，存在遭遇诈骗甚至受到严重犯罪侵害的隐患。 </p>',11,1457977748,1457977748,0,1,'',0,0,1082,54,'','','','','',''),(40,'担保机构','','<div class=\"b\">\r\n\t<div class=\"b\">\r\n\t\t<div class=\"b\">\r\n\t\t\t<img src=\"./public/attachment/201603/30/11/56fb45c2af391.png\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</div>\r\n</div>',14,1457977748,1461107570,0,1,'index.php?ctl=manageagency&act=login',0,0,1805,2,'','','','','',''),(41,'安全保障','','<div class=\"b\">\r\n\t<img src=\"./public/attachment/201603/30/11/56fb45c2af391.png\" alt=\"\" /><br />\r\n</div>',12,1457977748,1461101458,0,1,'',0,0,1410,1,'','','','','',''),(42,'贷款利率、期限、方式','','<div class=\"b\">\t贷款金额有限制吗</div>\r\n<div>\t信用贷款金额最高为人民币100万元，信用审核员会根据您提交的p2p借贷认证材料情况给予您信用额度（即您可以申请贷款金额的上限）。<br />\r\n机构担保贷款与智能理财标贷款视合作机构资质及实际情况设定贷款金额。</div>\r\n<div class=\"b\">\tp2p信贷的贷款期限和还款方式 </div>\r\n<div>\t目前信用贷款您可以选择的借款期限3个月、6个月、9个月、12个月、18个月、24个月 。还款方式是按月<a href=\"./help.html#b_1\">等额本息</a>还贷。</div>\r\n<div class=\"b\">\t在p2p信贷贷款是否需要抵押、担保</div>\r\n<div>   不需要，在p2p信贷上的贷款都是以借款人的信用评级为基础的，不涉及到抵押物及其他人的担保，免去了繁杂的手续和可能由抵押物引起的纠纷。 </div>\r\n<div class=\"b\">\t作为借款人，我的贷款利率是如何确定的</div>\r\n<div>\t借款用户可跟据自身情况，参考网站对各信用等级借款人设定的相应贷款利率下限及网站近期的成交贷款利率自行设定可接受的利率。在同等情况下，贷款利率越高的贷款，成功（<a href=\"./help.html#q2\">满标</a>）的概率越大。</div>\r\n<div class=\"b\">\t如何查询我的贷款协议</div>\r\n<div>\t1.\t如果您已在网上成功的贷款贷款，您可以在网站上访问“我的p2p信贷”-“偿还贷款”-“贷款协议”；</div>\r\n<div>\t2.\t如果您已在网上成功的投标理财，您可以在网站上访问“我的p2p信贷”-“我的投资”-“回收中的贷款”-“贷款协议”；</div>\r\n<div>\t3.\t您也可以访问“我要贷款”-“工具箱”-查看“<a href=\"./borrow/toolsPage.action?type=tools_contact\" target=\"_blank\">贷款协议范本</a>”。</div>',15,1457977748,1457977748,0,1,'',0,0,0,10,'','','','','',''),(43,'如何申请贷款','','<div class=\"b\">\t如何在p2p信贷上申请贷款</div>\r\n<div>\t第一步：免费注册为p2p信贷用户<br />\r\n\t第二步：填写个人信息、发布借款列表<br />\r\n\t第三步：上传信用认证材料<br />\r\n\t第四步：筹集并获得贷款<br />\r\n</div>',15,1457977748,1457977748,0,1,'',0,0,0,9,'','','','','',''),(44,'发布借款列表','','<div class=\"b\">\t如何发布借款列表</div>\r\n<div>\t借款人访问“我要贷款”，选择“申请贷款”，根据提示填写贷款信息，在确认无误后点击发布即可创建一条<a href=\"./lend/lendPage.action\" target=\"_blank\">借款列表</a>。</div>\r\n<div>\t注：您通过p2p信贷认证后发布的相关信息越完整，资料越丰富，获得贷款的机会就会越高。</div>\r\n  <div class=\"b\">\t借款列表状态</div>\r\n<div>\t借款人发布借款列表后，在未将合格的认证资料上传完毕并获得p2p信贷给出的信用等级和信用额度（全部通过四项必要信用认证）前，借款列表将处于“提交资料”状态，不能被任何理财人投标。在借款人全部通过四项必要信用认证且得到信用等级和信用额度后，借款列表将进入“马上投标”状态，即开始筹集贷款。</div>\r\n<div class=\"b\">\t是否可以修改已发布的借款列表</div>\r\n<div>\t不可以。在用户发布借款列表之后，不可以对已发布的贷款进行修改。请用户在发布贷款时务必认真填写各项信息。</div>',15,1457977748,1457977748,0,1,'',0,0,0,8,'','','','','',''),(45,'申请信用额度','','<div class=\"b\">\t什么是信用额度 </div>\r\n<div>\t借款人在全部通过四项“必要信用认证”后，可以继续上传材料进行各项“可选信用认证”，在人人贷审核员完成对所提供材料的审核工作后，借款人会从人人贷获得一个相应的信用等级和信用额度。信用额度既是借款人单笔贷款的上限也是借款者累积尚未还清贷款的上限。例如，如果一个借款人信用额度为5万元，则在没有其他贷款的情况下，用户可以发布总额最高为5万元的贷款请求，也可以分多次发布贷款请求，但尚未还清贷款（以整笔贷款金额计算）的总额不得超过5万元。</div>\r\n<div class=\"b\">\t什么时候可以申请信用额度、如何申请</div>\r\n<div>\t成为借款人后，您在上传认证资料进行各项信用认证后可以先得到一个信用额度暂不发布贷款列表，在您需要贷款的时候，用相应额度发布贷款需求。</div>',15,1457977748,1457977748,0,1,'',0,0,0,7,'','','','','',''),(46,'p2p信贷认证','','<div class=\"b\">\t借款人必要信用认证</div>\r\n<div>\t贷款必须全部通过的认证项目，不可缺少。（为了保证审核效率，确保贷款用户尽快通过审核，我们将优先为四项必要认证材料上传齐全的用户提供审核服务。）。</div>\r\n<div style=\"padding-left:0px;\"> <div class=\"b\">\t身份证认证</div>\r\n<div>\t您上传的身份证扫描件需和您绑定的身份证一致，否则将无法通过认证。认证说明：<br />\r\n 1、请您上传您本人第二代身份证正、反两面照片。<br />\r\n 2、请确认您上传的资料是清晰的、未经修改的数码照片（可以是彩色扫描图片）。<br />\r\n<p style=\"font-weight:bold;\">每张图片的尺寸不大于3M。</p>\r\n认证有效期： 永久</div>\r\n <div class=\"b\">\t工作认证 </div>\r\n<div>\t您的工作状况是p2p信贷评估您信用状况的主要依据。请您填写真实可靠的工作信息。认证说明：<br />\r\n 上传资料说明：<br />\r\n如果您满足以下 1种以上的身份，例如：您有稳定工作，且兼职开淘宝店。我们建议您同时上传两份资料，这将有助于提高您的借款额度和信用等级 <p style=\"font-weight:bold;\">1、 工薪阶层：</p>\r\n请上传以下资料的照片或扫描件：（建议两项或两项以上）<br />\r\na) 劳动合同。 <br />\r\nb) 加盖单位公章的在职证明。<br />\r\n c) 带有姓名及照片的工作证。<br />\r\n <p style=\"font-weight:bold;\">2、 私营企业主:</p>\r\n请上传以下全部三项资料的照片或扫描件：<br />\r\n a) 企业的营业执照。 <br />\r\nb) 企业的税务登记证。 <br />\r\nc) 店面照片（照片内需能看见营业执照）。<br />\r\n <p style=\"font-weight:bold;\">3、网商：</p>\r\n请上传以下资料的照片或扫描件：<br />\r\n a) 请上传网店主页和后台的截屏(需要看清网址）。<br />\r\n b) 支付宝（或其他第三方支付工具）的至少3张最近3个月的商户版成功交易记录的截屏图片。 <br />\r\nc) 营业执照（如果有的话提供，不是必须的）。 <br />\r\nd) 备注：如果是淘宝专职卖家，店铺等级必须为3钻以上（含3钻）。<br />\r\n 认证条件： 工薪阶层需入职满6个月，私营企业主和淘宝商家需经营满一年<br />\r\n 认证有效期： 6个月 <br />\r\n</div>\r\n<div class=\"b\">\t个人信用报告认证 </div>\r\n<div>个人信用报告是由中国人民银行出具，全面记录个人信用活动，反映个人信用基本状况的文件。本报告是p2p信贷了解您信用状况的一个重要参考资料。 您信用报告内体现的信用记录，和信用卡额度等数据，将在您发布借款时经p2p信贷工作人员整理，在充分保护您隐私的前提下披露给p2p信贷借出者，作为借出者投标的依据。<br />\r\n        认证说明： <br />\r\n1、上传您的个人信用报告原件的照片，每页信用报告需独立照相，并将整份信用报告按页码先后顺序完整上传。<br />\r\n 2、请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。 <br />\r\n认证条件： 信用记录良好 <br />\r\n认证有效期： 6个月 <br />\r\n<p style=\"font-weight:bold;\">如何办理个人信用报告？</p>\r\n 办理个人信用报告，可由本人或委托他人到中国人民银行征信中心办理本人的信用报告，其中被委托人称为代理人。 <br />\r\n（一）本人查询信用报告 <br />\r\n携带本人有效身份证件原件及一份复印件（其中复印件留给征信分中心备查），到中国人民银行各地征信分中心查询。 有效身份证件包括：身份证（第二代身份证须复印正反两面）、军官证、士兵证、护照、港澳居民来往内地通行证、 台湾同胞来往内地通行证、外国人居留证等。 <br />\r\n（二）委托他人查询信用报告 <br />\r\n需要携带的材料有委托人及代理人双方的身份证件原件及复印件、授权委托书。其中身份证件复印件和授权委托书留给 征信分中心备查。委托书格式请与当地征信分中心联系取得。<br />\r\n 全国各地征信中心联系方式查询 <br />\r\n<a href=\"http://www.pbccrc.org.cn/kefuzhongxin_303.html\" target=\"_blank\">http://www.pbccrc.org.cn/kefuzhongxin_303.html</a><br />\r\n 认证有效期： 6个月 <br />\r\n</div>\r\n<div class=\"b\">\t收入认证 </div>\r\n您的银行流水单以及完税证明，是证明您收入情况的主要文件，也是p2p信贷评估您还款能力的主要依据之一。<br />\r\n认证说明： <br />\r\n上传资料说明：<br />\r\n如果您满足以下 1种以上的身份，例如：您有稳定工作，且兼职开淘宝店。<br />\r\n 我们建议您同时上传两份资料，这将有助于提高您的借款额度和信用等级。<br />\r\n <p style=\"font-weight:bold;\">1、 工薪阶层：</p>\r\n<p>请上传以下一项或多项资料：<br />\r\n a) 最近连续六个月工资卡银行流水单的照片或扫描件，须有银行盖章，或工资卡网银的电脑截屏。<br />\r\n b) 最近连续六个月的个人所得税完税凭证。 <br />\r\nc) 社保卡正反面原件的照片以及最近连续六个月缴费记录（注：可在社保网站查询到为准）。<br />\r\n d) 如果工资用现金形式发放，请提供近半年的常用银行储蓄账户流水单，须有银行盖章，或工资卡网银的电脑截屏。 <br />\r\n</p>\r\n<p style=\"font-weight:bold;\">2、 私营企业主:</p>\r\n请上传以下一项或多项资料的照片或扫描件：<br />\r\n a) 最近连续六个月个人银行卡流水单，须有银行盖章，或网银的电脑截屏。 <br />\r\nb) 最近连续六个月企业银行流水单，须有银行盖章；或近半年企业的纳税证明。<br />\r\n <p style=\"font-weight:bold;\">3、 网商：</p>\r\n请上传以下全部两项资料的照片或扫描件：<br />\r\n a) 最近连续六个月个人银行卡流水单，须有银行盖章，或网银的电脑截屏。<br />\r\nb) 如果是淘宝商家请上传近半年淘宝店支付宝账户明细的网银截图。 <br />\r\n认证条件： 收入需较稳定，如果是私营企业主及淘宝商家月均流水需在20000以上 <br />\r\n认证有效期： 6个月 <br />\r\n如何办理银行流水单？ <br />\r\n银行流水单是银行卡最近一段时间内的资金交易记录，是确认借入者收入状况的重要证明，银行流水单 是p2p借贷用以评价借入者还款能力的重要凭证之一。 <br />\r\n<p style=\"font-weight:bold;\">办理流程</p>\r\n 前往最近的工资卡所在银行，提供工资卡及本人身份证原件，要求银行打印工资卡最近半年的流水单。<br />\r\n 如何办理个人所得税完税证明？<br />\r\n一、委托公司会计代办 <br />\r\n联系所在公司（负责申报个人所得税）会计，委托会计办理需提交纳税人有效身份证件原件及复印件、受托人有效身份证件原件及 复印件及委托协议原件，并填写《开具个人所得税完税证明申请表》即可。<br />\r\n 二、本人办理 <br />\r\n1、向所在公司会计咨询公司进行缴税的税务所。<br />\r\n 2、本人携带有效身份证件原件及复印件，前往公司缴税的税务所，填写《开具个人所得税完税证明申请表》即可领取完税证明。 <br />\r\n<br />\r\n                              </div>\r\n    <div class=\"b\">\t可选信用认证 </div>\r\n您可以选择上传的认证项目，只要通过了这些可选信用认证，将会提高您的“信用等级”和“信用额度” 。 <br />\r\n<div style=\"padding-left:0px;\"> <div class=\"b\">房产证明 </div>\r\n房产证明是证明借入者资产及还款能力的重要凭证,p2p信贷会根据借款者提供的房产证明给与借入者一定的信用加分。 <br />\r\n 认证说明： 1、请上传以下任意一项或多项资料。  <br />\r\na) 购房合同。  <br />\r\nb) 银行按揭贷款合同。 <br />\r\n c) 房产局产调单及收据。 <br />\r\n 2、请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。 <br />\r\n认证条件： 必须是商品房  <br />\r\n每张图片的尺寸不大于1.5M。 <br />\r\n 认证有效期： 永久  <br />\r\n<div class=\"b\">购车证明 </div>\r\n购车证明是证明借入者资产及还款能力的重要凭证之一，p2p信贷会根据借入者提供的购车证明给与借入者一定的信用加分。         <br />\r\n认证说明：  <br />\r\n1、请上传您所购买车辆行驶证原件的照片。  <br />\r\n2、请上传您和您购买车辆的合影（照片须体现车牌号码）。  <br />\r\n3、请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。  <br />\r\n认证有效期： 永久  <br />\r\n<div class=\"b\">结婚证明</div>\r\n 借入者的婚姻状况的稳定性，是p2p信贷考核借款人信用的评估因素之一，通过p2p信贷结婚认证，您将获得一定的信用加分。  <br />\r\n认证说明： 1、请您上传以下资料  <br />\r\n1) 您结婚证书原件的照片 <br />\r\n 2) 您配偶的身份证原件的照片。如果持有第二代身份证，请上传正反两面  <br />\r\n照片。如果持有第一代身份证，仅需上传正面照片。  <br />\r\n3) 您和配偶的近照合影一张  <br />\r\n2、请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。  <br />\r\n认证条件： 您的配偶同意您将其个人资料提供给p2p借贷  <br />\r\n认证有效期： 永久  <br />\r\n<div class=\"b\">学历认证 </div>\r\n借出者在选择借款列表投标时，借入者的学历也是一个重要的参考因素。为了让借出者更好、更快地相信您的学历是真实的，强烈建议您对学历进行在线验证。  <br />\r\n学历认证方法：  <br />\r\n一、2001年至今获得学历，需学历证书编号 <br />\r\n1、点击 <a href=\"http://www.chsi.com.cn/xlcx/\" target=\"_blank\">网上学历查询。</a>  <br />\r\n2、选择“零散查询”。  <br />\r\n3、输入证书编号、查询码（通过手机短信获得，为12位学历查询码）、姓名、以及验证码进行查询。  <br />\r\n4、查询成功后，您将查获得《教育部学历证书电子注册备案表》。  <br />\r\n5、将该表右下角的12位在线验证码<a href=\"./public/images/xueli_1.jpg\" target=\"_blank\">（见样本图01）</a>，输入下面的文本框。  <br />\r\n6、点击提交审核。  <br />\r\n二、1991年至今获得学历，无需学历证书编号 <br />\r\n1、点击 <a href=\"http://www.chsi.com.cn/xlcx/\" target=\"_blank\"> 网上学历查询</a>。  <br />\r\n2、选择“本人查询”。  <br />\r\n3、注册学信网账号。  <br />\r\n4、登录学信网，点击“学历信息”。  <br />\r\n5、选择您的最高学历，并点击“申请验证报告”（申请过程中，您需通过手机短信获得12位学历查询码，此查询码与p2p借贷所需验证码不同）。  <br />\r\n6、申请成功后，您将获得12位在线验证码<a href=\"./public/images/xueli_2.jpg\" target=\"_blank\">（见样本图02）</a>  <br />\r\n7、将12位在线验证码输入下面的文本框  <br />\r\n8、点击提交审核  <br />\r\n认证条件： 大专或以上学历（普通全日制）  <br />\r\n认证有效期： 永久  <br />\r\n技术职称认证  <br />\r\n技术职称是经专家评审、反映一个人专业技术水平并作为聘任专业技术职务依据的一种资格，不与工资挂钩，是p2p信贷考核借款人信用的评估因素之一，通过p2p信贷技术职称认证证明，您将获得一定的信用加分。  <br />\r\n认证说明：  <br />\r\n1、请上传您的技术职称证书原件照片。  <br />\r\n2、请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。 <br />\r\n认证条件： 国家承认的二级及以上等级证书。例如律师证、会计证、工程师证等  <br />\r\n每张图片的尺寸不大于1.5M。  <br />\r\n认证有效期： 永久  <br />\r\n<div class=\"b\">视频认证 </div>\r\n什么是视频认证？只有通过视频认证您才能获得贷款，您只需要在视频认证页面上传您本人的视频，并提交，即可申请视频认证。您也可以选择与p2p信贷客服在线上进行视频认证。&nbsp;</div>\r\n<div style=\"padding-left:0px;\">认证说明：  <br />\r\n1、视频中诵读内容请按如下文字诵读： 我是 ***，我在p2p信贷的用户名是***，我的身份证号是 ***********************，现在我正在做p2p信贷的视频确认。我在此做出以下承诺：我愿意接受p2p信贷的使用条款和借款协议；我提供给p2p信贷的信息及资料均是真实有效的；我愿意对我在p2p信贷上的行为承担全部法律责任；在我未能按时归还借款时，我同意p2p信贷采取法律诉讼、资料曝光等一切必要措施。&nbsp;</div>\r\n<div style=\"padding-left:0px;\"> <span style=\"color:red;\">2、读完声明后，请您将身份证正面(有身份证号)对准摄像头，并保持5秒</span><br />\r\n3、您可以联系右侧的在线客服进行视频确认。如果您选择在线进行视频确认，在做完以上声明后，我们的视频审核员会与您进行几分钟简单的交流。<br />\r\n4、请按上述内容要求录制视频，如不符合要求均不能通过视频认证 <br />\r\n(1)上传视频认证文件大小 不得超过50M<br />\r\n(2)请上传真实有效的本人的视频。<br />\r\n(3)视频文件格式可以是RMVB、WMV 或 AVI类型的文件。<br />\r\n(4).视频认证必须图像清晰，声音清楚<br />\r\n(5).视频认证必须衣冠整洁，禁止出现抽烟，赤裸等形象<br />\r\n只有通过视频认证您才能获得贷款，您只需要在视频认证页面将视频文件发送至与您对应客服的邮箱，并勾选\'使用邮件发送\'后提交,即可进行视频认证  <br />\r\n认证有效期： 永久  <br />\r\n<div class=\"b\">手机详单认证 </div>\r\n手机流水单是最近一段时间内的详细通话记录，是p2p借贷用以验证借入者真实性的重要凭证之一。您的手机详单不会以任何形式被泄露。   <br />\r\n认证说明：  <br />\r\n1、请您上传您绑定的手机号码最近3个月的手机详单原件的照片。如详单数量较多可分月打印并上传  <br />\r\n每月前5日部分（每月详单均需清晰显示机主手机号码）。  <br />\r\n2、请确认您上传的资料是清晰的、未经修改的数码照片（不可以是扫描图片）。  <br />\r\n每张图片的尺寸不大于1.5M。  <br />\r\n认证有效期： 永久  <br />\r\n如何办理手机详单  <br />\r\n前往最近的手机运营商营业厅，提供手机服务密码或机主身份证明即可打印。 <br />\r\n<div class=\"b\">居住地证明</div>\r\n 居住地的稳定性，是p2p信贷考核借款人的主要评估因素之一，通过p2p信贷居住地证明，您将获得一定的信用加分。&nbsp;</div>\r\n<div style=\"padding-left:0px;\">认证说明：  <br />\r\n1、请上传以下任何一项可证明现居住地址的证明文件原件的照片。  <br />\r\n1) 用您姓名登记的水、电、气最近三期缴费单；  <br />\r\n2) 用您姓名登记固定电话最近三期缴费单；  <br />\r\n3) 您的信用卡最近两期的月结单；  <br />\r\n4) 您的自有房产证明；  <br />\r\n5) 您父母的房产证明，及证明您和父母关系的证明材料。  <br />\r\n2、请确认您上传的资料是清晰的、未经修改的数码照片（不可以是扫描图片）。  <br />\r\n每张图片的尺寸不大于1.5M。  <br />\r\n认证有效期： 6个月  <br />\r\n<!-- <div class=\"b\">实地审核申请</div>\r\n 实地审核申请是p2p借贷了解您信用状况的一个重要参考资料。您的实地审核申请通过审核后，将在您发布借款时经p2p借贷工作人员整理，在充分保护您隐私的前提下披露给p2p借贷借出者，作为借出者投标的依据。  <br/>\r\n申请资格：  <br/>\r\n1、目前实地审核申请仅对经营类客户开放。  <br/>\r\n2、借款申请额在3万以上。  <br/>\r\n3、申请人必须已经提交四项必要信用认证资料。  <br/>\r\n4、申请人名下有固定资产，经营时间满一年。 <br/>\r\n注：目前仅对北京六环以内地区开放  <br/>\r\n借款人认证资料说明  <br/>\r\np2p借贷\"对资料的认证仅限于如下方式：  <br/>\r\n1. 对用户提交的书面资料的照片文件进行真实性审查。  <br/>\r\n2. 对用户上传的照片资料的内容与其申报的信息的一致性审查。  <br/>\r\n3. p2p借贷承诺在认证中保持中立、审慎的态度，但p2p借贷不对借款人的行为提供任何保证。  <br/>\r\n4. p2p借贷的认证不能避免出贷款项出现违约的风险，亦不免除借款人应当承担的各种责任。 <br/>\r\n --></div>',15,1457977748,1457977748,0,1,'',0,0,0,6,'','','','','',''),(47,'认证项目说明','','<div class=\"b\">p2p信贷对资料的认证仅限于如下方式：</div>\r\n<div>   1. 对用户提交的书面资料的照片文件进行真实性审查。</div>\r\n<div>\t2. 对用户上传的照片资料的内容与其申报的信息的一致性审查。 </div>\r\n<div>   3. p2p信贷贷承诺在认证中保持中立、审慎的态度，但P2P借贷不对借款人的行为提供任何保证。</div>\r\n<div>   4. p2p信贷的认证不能避免出贷款项出现违约的风险，亦不免除借款人应当承担的各种责任。</div>',15,1457977748,1457977748,0,1,'',0,0,0,5,'','','','','',''),(48,'信用等级和信用额度','','<div class=\"b\">\t什么是信用等级 ：</div>\r\n<div>p2p信贷认证体系包括信用等级和信用额度。信用等级是借款人的信用属性，也是理财人判断借款人违约风险的重要依据之一。通常来讲借款人信用等级越高，其违约率越低，相应的其贷款成功率越高。信用等级由认证分数转化而来，具体请参考信用等级的分数区间。目前认证等级的等级由高到低分为：AA、A、B、C、D、E、HR。</div>\r\n<div class=\"b\">\t信用等级的分数区间：</div>\r\n<div>\t每个信用等级都有一个信用分数的范围，具体可以见下表：</div>\r\n<div>\t<table width=\"692\" border=\"0\" cellspacing=\"1\" style=\"text-align:center;background:#000;\">\t\t<tbody><tr style=\"background:#fff;\">\t\t\t<td width=\"15%\">信用等级</td>\r\n \t\t\t<td width=\"10%\">HR</td>\r\n\t\t\t<td width=\"10%\">E</td>\r\n\t\t\t<td width=\"10%\">D</td>\r\n\t\t\t<td width=\"10%\">C</td>\r\n\t\t\t<td width=\"10%\">B</td>\r\n\t\t\t<td width=\"10%\">A</td>\r\n\t\t\t<td width=\"10%\">AA</td>\r\n\t\t</tr>\r\n\t\t<tr style=\"background:#fff;\">\t\t\t<td>分数区间</td>\r\n\t\t\t<td>0-99</td>\r\n\t\t\t<td>100-109</td>\r\n\t\t\t<td>110-119</td>\r\n\t\t\t<td>120-129</td>\r\n\t\t\t<td>130-144</td>\r\n\t\t\t<td>145-159</td>\r\n\t\t\t<td>160+</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n</div>\r\n<div class=\"b\">\t什么是信用额度</div>\r\n<div>\t借款人在全部通过四项“必要信用认证”后，可以继续上传材料进行各项“可选信用认证”，在p2p信贷审核员完成对所提供材料的审核工作后，借款人会从p2p信贷获得一个相应的信用等级和信用额度。信用额度既是借款人单笔贷款的上限也是借款者累积尚未还清贷款的上限。例如，如果一个借款人信用额度为5万元，则在没有其他贷款的情况下，用户可以发布总额最高为5万元的贷款请求，也可以分多次发布贷款请求，但尚未还清贷款（以整笔贷款金额计算）的总额不得超过5万元。</div>\r\n<div class=\"b\">\t如何获得信用等级及信用额度</div>\r\n<div>\t访问“我要贷款”?“p2p信贷认证”，根据提示完成四项“必要信用认证”及用户根据自身情况可自己可完成的“可选信用认证”后，即可获得信用等级及信用额度。</div>\r\n<div class=\"b\">\t如何查看我的信用等级</div>\r\n<div>\t访问“我的p2p信贷”??“我的p2p信贷”??“p2p信贷认证”，您就可以看到您的信用等级，及您进行的各种信用认证的情况。</div>\r\n<div class=\"b\">\t如何提高我的信用等级（分数）</div>\r\n<div>   您可以通过申请“可选信用认证“来提高您的信用分数。另外您在p2p信贷网站上良好的借贷记录也会增加您的信用分数。</div>\r\n<div style=\"font-style:italic;\">\t注：提高信用等级可以增加理财人贷款成功的概率，提高贷款成功率，我们建议借款人在贷款前根据实际情况尽量多完成信用认证。</div>\r\n<div class=\"b\">\t为什么我获得了信用等级与信用额度，但我无法申请贷款</div>\r\n<div>\t您无法申请贷款的原因可能是由于没有全部通过四项“必要信用认证”。<br />\r\n\t如果还有问题请在工作时间联系在线客服或拨打网站服务热线：400-888-8888</div>\r\n<div class=\"b\">\t我某一项信用认证被驳回，是否可以进行重新认证？</div>\r\n<div>   如果您在某项信用认证中，资料提交发生错误或资料需要更新，您可以重新进行该项信用认证。</div>\r\n   <div class=\"b\">   为什么我提交的附加信用认证，3个工作日后还没有收到结果？</div>\r\n<div>  只有当您通过全部的必要信用认证后，p2p信贷才会认证您的可选信用认证信息。所以您没有收到结果的原因可能是您没有通过全部的必要信用认证。</div>',15,1457977748,1457977748,0,1,'',0,0,0,4,'','','','','',''),(49,'视频确认、贷款成功','','<div class=\"b\">\t什么是视频确认</div>\r\n<div>\t为了保证贷款的真实有效，借款人在发布借款需求后需及时进行视频确认。视频确认的内容包括：借款人对自我身份的认证及宣读贷款承诺书。</div>\r\n<div class=\"b\">\t视频确认的时间及形式</div>\r\n<div>\t形式1：在贷款列表出于资料审核状态（“等待材料”状态），在借款列表进入筹款阶段（“马上投标”状态），借款人可与对应信用审核员约定视频确认时间，进行时时视频通话进行确认。</div>\r\n<div>\t形式2：在借款列表进入筹款阶段（“马上投标”状态），借款人可按网站规定格式、大小及内容自行录制确认视频后上传至该地址，上传后等待信用审核工作人员查看并予以最终确认。</div>\r\n<div class=\"b\">\t什么是贷款成功</div>\r\n<div>\t理财人发布借款列表后，须至少通过四项必要信用认证并，此后借款人会得到相应的信用等级和信用额度，此时借款人的借款列表可被理财人投标，即开始筹集贷款。当借款列表满标且借款人通过视频确认后，p2p信贷信审工作组会对借款列表做最后的判定，当您的借款列表得到放款批准时即为贷款成功，您所筹集的资金将划入您的p2p信贷账户中。</div>\r\n <div class=\"b\">\t贷款成功后如何提取现金</div>\r\n<div>\t当一个借款列表得到放款批准即为贷款成功后，p2p信贷将会将您筹集到的资金划入您的p2p借贷账户，您可在网站上点击“我的p2p信贷”?“充值提现”，填写提现信息。资金将在申请提现后1~2个工作日内到达您指定的银行账户。为了保障您的资金尽快到账，请您使用提现页面推荐的全国性银行申请提现。</div>',15,1457977748,1457977748,0,1,'',0,0,0,3,'','','','','',''),(50,'还款','','<div class=\"b\">\t如何还款</div>\r\n<div>\t若账户中余额大于当期还款在还款日系统会代贷款者自动扣缴当期还款，若借款人需要手动还款，请访问“我的p2p信贷”??“贷款管理”??“偿还贷款”。</div>\r\n<div>\t若账户余额不足支付当期还款，可以通过网银为<a href=\"./#q18\" target=\"_self\">账户充值</a>。</div>\r\n<div class=\"b\">\t借入者能否提前还款</div>\r\n<div>\t1.\t借款人可以随时进行提前还款。具体的操作方法是访问“我的p2p信贷”??“贷款管理”??“偿还贷款”，点击右上角的“还清此笔贷款”。</div>\r\n<div>\t2.\t提提前还款的用户需要支付给理财人贷款剩余本金的1%作为违约金，不用再支付后续的利息及管理费用。公式如下： </div>\r\n<div>\t提前还款应还金额= 剩余本金+ 当期本息及账户管理费+提前还款违约金</div>\r\n<div>\t请用户注意提前归还部分贷款不视为提前还款，仍需支付全部贷款利息及账户管理费。 </div>',15,1457977748,1457977748,0,1,'',0,0,0,2,'','','','','',''),(51,'逾期还款','','<div class=\"b\">\t如果逾期还款，会有什么惩罚</div>\r\n<div>\t如果逾期还款，借款人要承担罚息与逾期后的管理费用，并会被扣去相应的信用分数。所以p2p信贷强烈建议用户避免逾期还款，一旦发生逾期请尽快还清贷款。</div>\r\n<div class=\"b\">\t逾期还款超过30天，会造成什么样的后果</div>\r\n<div>\t若用户违约逾期还款超过30天，p2p信贷有权将该用户的有关资料正式备案在“不良信用记录”，列入全国个人信用评级体系的黑名单（“不良信用记录”数据将为银行、电信、担保公司、人才中心等有关机构提供个人不良信用信息）此不良记录将保存7年。同时保留对该用户采取法律措施的权利，由此所产生的所有法律后果和费用（包括但不限于律师费）将由该用户来承担。</div>\r\n<div class=\"b\">\t贷款逾期后的罚息如何计算</div>\r\n<div>\t自逾期开始之后，正常利息停止计算。按照下面公式计算罚息：</div>\r\n<div>\t罚息总额 = 逾期本息×对应罚息利率×逾期天数；</div>\r\n<div>\t<table width=\"692\" border=\"0\" cellspacing=\"1\" style=\"text-align:center;background:#000;\">\t\t<tbody><tr style=\"background:#fff;\">\t\t\t<td>逾期天数</td>\r\n\t\t\t<td>1?30天</td>\r\n\t\t\t<td>31天以上</td>\r\n\t\t</tr>\r\n\t\t<tr style=\"background:#fff;\">\t\t\t<td>罚息利率</td>\r\n\t\t\t<td>0.05%</td>\r\n\t\t\t<td>0.1%</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n</div>\r\n<div class=\"b\">\t贷款逾期后的管理费用如何计算</div>\r\n<div>\t自逾期开始之后，正常管理费用停止计算。按照下面公式计算：</div>\r\n<div>\t逾期后管理费总额=逾期本息×对应逾期管理费率×逾期天数；</div>\r\n<div>\t<table width=\"692\" border=\"0\" cellspacing=\"1\" style=\"text-align:center;background:#000;\">\t\t<tbody><tr style=\"background:#fff;\">\t\t\t<td>逾期天数</td>\r\n\t\t\t<td>1?30天</td>\r\n\t\t\t<td>31天以上</td>\r\n\t\t</tr>\r\n\t\t<tr style=\"background:#fff;\">\t\t\t<td>逾期管理费率</td>\r\n\t\t\t<td>0.1%</td>\r\n\t\t\t<td>0.5%</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n</div>',15,1457977748,1457977748,0,1,'',0,0,0,1,'','','','','',''),(52,'费用、合同、理财金额限','','<div class=\"b\">\t理财人在p2p信贷上投资需要交哪些费用</div>\r\n<div>\t理财人仅需向第三方支付平台（快钱、支付宝等）缴纳账户充值与提现的费用，p2p借贷对理财人不收取任何费用。详情请见“<a href=\"./index.php?ctl=aboutfee\" target=\"_blank\">费用</a>”。</div>\r\n<div class=\"b\">\t电子合同有效吗</div>\r\n<div>\t我国新合同法第十一条规定: 书面形式合同是指合同书、信件和数据电文(包括电报、电传、传真、电子数据交换和电子邮件)等可以有形地表现所载内容的形式。因此电子合同属于书面形式的合同一种，是受到法律保护的。另外p2p信贷平台中的合同文本都由经济法律师起草的，保证了经过这个平台的交易是具备法律效力的。</div>\r\n<div class=\"b\">\t理财人的理财金额是否有限制 </div>\r\n<div>\t理财人的理财金额没有上限。</div>\r\n<div class=\"b\">p2p信贷现在是否提供线下借贷服务</div>\r\n<div>\t目前p2p信贷暂不提供线下借贷业务，用户需在网上完成交易。</div>',16,1457977748,1457977748,0,1,'',0,0,0,5,'','','','','',''),(53,'开始理财','','<div class=\"b\">\t如何开始理财</div>\r\n<div>\t访问“我要理财”? 根据提示，填写相应的信息。通过“身份证绑定”、“手机绑定”，即可成为理财人。</div>\r\n<div class=\"b\">\t理财人为什么要做身份绑定？有什么好处</div>\r\n<div>\t为了保障理财人资金的安全性，将p2p信贷账号实名绑定，以及保证理财人是年满18岁的具有完全民事行为能力的中国公民，从而保证借贷合同的有效性，p2p信贷要求所有理财人必须通过身份证认证。身份认证过程简便，且认证信息只用于核实用户身份，P2P借贷对于所有资料将严格保密。</div>',16,1457977748,1457977748,0,1,'',0,0,0,4,'','','','','',''),(54,'投标','','<div class=\"b\">\t投标前我需要注意的事项：</div>\r\n<div>\t1、认真阅读该借款列表的详细信息（包括贷款金额，利息率，贷款期限、贷款者信用等级等），以确定您所要投的标符合您的风险承受能力和所要求的投资回报率。</div>\r\n<div>\t2、应知道若您所投标的借款人发生违约，违约损失需要由该标的所有理财人共同承担。</div>\r\n<div>\t3、投标前请您核实自己将要理财的金额，确认无误后再进行操作。</div>\r\n<div>\t4、您也可以参考网站的“<a href=\"./index.php?ctl=usagetip\" target=\"_blank\">使用技巧</a>”。</div>\r\n<div class=\"b\">\t如何分散投资风险</div>\r\n<div>\t1.\t请尽量分散您的投资，这样可以降低单一借款人违约对您的投资收益的影响。例如您可以把5000元借给10个借款人。</div>\r\n<div>\t2.\t请在同等收益的情况下投标给<a href=\"./index.php?ctl=helpcenter#q48\">信用等级</a>较高的借款人。</div>\r\n<div>\t3.\t浏览网站关于<a href=\"./index.php?ctl=usagetip\" target=\"_blank\">使用技巧</a>的文章。</div>\r\n<div class=\"b\">\t信用等级的高低代表什么</div>\r\n<div>\t一般情况下，用户信用等级越高，表明个人信用越好，借款违约的可能性越小。</div>\r\n<div class=\"b\">\t投标后是否可以取消</div>\r\n<div>\t您在投标后不允许取消，若此标<a href=\"./index.php?ctl=helpcenter#q41\">满标</a>并放款后，您账户上的冻结金额自动将转入该标借款人账户。若此标<a href=\"./index.php?ctl=helpcenter#q41\">流标</a>，则您账户上的<a href=\"./index.php?ctl=helpcenter#q41\">冻结金额</a>自动转为用户可用金额。</div>',16,1457977748,1457977748,0,1,'',0,0,0,3,'','','','','',''),(55,'收取还款','','<div class=\"b\">\t如何收取还款</div>\r\n<div>\t借款人在规定的还款时间内将钱充值到与p2p信贷合作的第三方支付平台上，p2p信贷系统会发送邮件通知所有理财人。理财人可按个人需求选择<a href=\"./index.php?ctl=helpcenter#q51\">提现</a>，或继续投资（出借）。</div>\r\n<div>\t注：借款人也可能提前偿还全部贷款或者在到期日前手动提前偿还贷款，请理财人注意查收p2p信贷发出的通知。</div>\r\n<div class=\"b\">\t借款人能否提前还款 </div>\r\n<div>\t借款人可以提前偿还贷款，如果借款人提前偿还全部贷款，需要额外支付给理财人贷款剩余本金的1%作为违约金，不用再支付后续的利息及管理费用。公式如下：</div>\r\n<div>\t提前还款应还金额= 剩余本金+ 当期本息及账户管理费+提前还款违约金</div>',16,1457977748,1457977748,0,1,'',0,0,0,2,'','','','','',''),(56,'坏账','','<div class=\"b\">\t借款人逾期后再还款，理财人可以收到罚息吗</div>\r\n<div>\t是的，请参考 “<a href=\"./index.php?ctl=helpcenter#q51\">贷款逾期后的罚息如何计算</a>”。</div>\r\n<div class=\"b\">\t借款人逾期还款，p2p信贷将如何帮助理财人催收贷款</div>\r\n<div>p2p信贷有一套完善的催收机制，通过电话短信提醒、上门拜访、法律诉讼等多种方式，有效的保证了平台上绝大部分借款人的及时还款。延迟还款的借款人需按约定交纳罚息和违约金。</div>',16,1457977748,1457977748,0,1,'',0,0,0,1,'','','','','',''),(57,'智能理财标','','<div class=\"b\">\t什么是智能理财标？</div>\r\n<div>\t智能理财标是p2p信贷推出的全新理财产品系列。产品基于高保障的战略合作，精选大量质押、抵押贷款需求和供应链金融服务相关贷款需求供理财人选择。投资智能理财标，理财者的本金与利息将受到保障。回款方式与投资期限均更为灵活，当前智能理财标为每月还息，到期还本，之后还会逐步开发更具灵活性的系列化产品。在安全稳定、灵活便捷的前提下，保证了较高的理财收益。</div>\r\n<div class=\"b\">\t为什么智能理财标的额度为百万级别？</div>\r\n<div>\t1、精挑渠道，细选借款用户，此类用户信用更优，还款能力更强；2、质押物、抵押物、供应链金融各环节等大幅增进借款人的信用级别，提高违约代价，同时p2p信贷与渠道合作有更强的处理此类贷款逾期的能力；3、日常实时监控更具保障力度。</div>\r\n<div class=\"b\">\t为什么说可以提高资金使用率？</div>\r\n<div>   因为智能理财标前期已经通过严格的审核流程，所以智能理财标满标当日即可放款，无需更多等待时间。并且智能理财标的回款方式更为灵活，本金回款更为集中（当前为每月还息，到期还本），省去了循环投标的操作，投资期间无需操心，坐享收益。</div>\r\n<div class=\"b\">\t如果智能理财标逾期，p2p信贷如何处理？</div>\r\n<div>\t如果智能理财标发生逾期，但借款人在逾期的30天内进行了还款，借款人在偿还理财人应得利息的基础上，将额外支付罚息； 如果逾期30天后贷款人没有进行还款，在第31天时，p2p信贷风险准备金将赔付理财人应得的所有本金及利息，并额外赔偿30天（等待期）的利息予理财人，相应的，该标债权将由理财人转移至p2p信贷风险准备金。之后该债权收回的全部资金将归p2p信贷风险准备金所有。对于智能理财标，p2p信贷将收取年化1%-2%的服务费（不同合作渠道会有所不同）全部存于风险准备金账户用于p2p信贷智能理财本息保障计划。<br />\r\n\t例：用户在5月1日获得贷款100万，年化利息为9%，借款期限3个月。理财人全体应在6月1日、7月1日得到利息7,500元，并在8月1日获得7,500+100万元（每月付息，到期还本）。如果贷款人在6月1日未按时还款，并一直没有偿还应还款项，理财人手中债权会在7月1日（逾期后第31天）转移到p2p借贷手中，并获得当月应得利息（7,500元）、额外赔偿的30天利息（7,500元）以及本金（100万元）。获赔的1,015,000元将根据理财人投资比例立即打到理财人的p2p借贷账户中。</div>\r\n<div class=\"b\">\t借款期限都有哪些选择？</div>\r\n<div>\t经过科学的分析并进一步贴近贷款者及理财人的需求，智能理财标的期限目前最低至1个月，以自然月为单位，最高12个月，具有极强的流动性。后续的，更具灵活性的产品也会针对具体的实际贷款需求和理财人需求相应开发。</div>\r\n<div class=\"b\">   什么是供应链金融？</div>\r\n<div>   供应链金融是指基于对供应链管理程度和核心企业信用资质的掌握，对供应链核心企业和上下游多个环节的企业提供的金融产品和服务。该种灵活的融资模式会根据特定产品供应链上的历史交易数据和贸易特性，以企业间贸易行为所产生的确定未来现金流为直接还款来源。</div>\r\n<div class=\"b\">   应收账款保障产品是什么？</div>\r\n<div>   应收账款保障产品是p2p信贷智能理财标系列的供应链金融产品之一。该产品以供应链上下游企业间历史交易数据为审核依据，以借款企业特定账户中的应收账款作为保障。p2p信贷风险管理部门会严格定期监控该特定应收账款账户的资金流动情况，一旦借款用户逾期，该账户中的届时所有资金及未来待收资金将全部用于偿还所有未清偿本息。</div>\r\n<div class=\"b\">   仓单保障产品是什么？</div>\r\n<div>   仓单保障产品是p2p信贷智能理财标系列的供应链金融产品之一。该产品以供应链上下游企业间物流环节的流通数据为审核依据，以借款企业在p2p信贷委托仓库内的在仓货物作为保障。p2p借贷风险管理部门会严格定期监控委托仓库内在仓货物流通及价格变动情况。一旦借款用户逾期，p2p信贷会在委托仓储方的协助下，对于在仓货物进行处置变卖，变卖后的资金将全部用于偿还所有未清偿本息。</div>',17,1457977748,1457977748,0,1,'',0,0,0,4,'','','','','',''),(58,'机构担保标','','<div class=\"b\">\t什么是机构担保标？</div>\r\n<div>   是指p2p信贷的合作伙伴为相应的借款提供连带保证，并负有连带保证责任。所谓连带保证责任即连带保证人对债务人负连带责任，无论主债务人的财产是否能够清偿债务，债权人均可向保证人要求其履行保证义务。</div>\r\n<div class=\"b\">p2p信贷如何选择合作或机构？</div>\r\n<div>\t通过严格的考察，p2p信贷会选择具备丰富的个人信用审核经验、较长经营历史及雄厚的资金实力的机构合作展开该项业务。</div>\r\n<div class=\"b\">p2p信贷有什么手段防范合作伙伴带来的风险？</div>\r\n<div>p2p信贷与合作伙伴签订了合作协议，一旦合作伙伴违背其应承担的连带保证责任，p2p信贷有权通过法律手段进行追偿，同时p2p信贷会通过自有的严格的审核系统对合作伙伴的相关业务进行双重审核，严控风险。</div>\r\n<div class=\"b\">\t机构担保标与网站个人发布的借款的区别是什么？</div>\r\n<div>   由于有合作伙伴为借款人提供担保，机构担保标能够为理财人提供本息保障；筹标时间为四天，缩短借款、理财人双方的资金流转周期；满标后立即放款，可提高审核效率和放款速度。</div>\r\n<div class=\"b\">\t如果机构担保标逾期，p2p信贷如何处理？</div>\r\n<div>\t合作机构承担借款的连带保证责任，若此类借款逾期，合作机构将代借款人偿付此笔借款的本息及相关费用。</div>\r\n<div class=\"b\">\t借款人的资质如何审核？</div>\r\n<div>\t借款人通过合作伙伴在全国各地的网点进行借款申请，由合作伙伴对其借款资质进行全面审核，审核内容包括但不限于借款人信用报告、收入、财产的资料审核和实地考察等，p2p信贷负责通过自己的风控手段进行复审。</div>',17,1457977748,1457977748,0,1,'',0,0,0,3,'','','','','',''),(59,'实地认证标','','<div class=\"b\">\r\n\t什么是“实地认证标”？\r\n</div>\r\n<div>\r\n\t“实地认证标”是p2p信贷推出的一款全新产品。该产品延续了p2p信贷借贷求真务实的经营理念，在原有严格审核的基础上，增加了p2p信贷前端工作人员对借款人情况的实地走访、审核调查以及后续的贷中、贷后服务环节，进一步加强风险管理控制，达到了双重保障的效果。\r\n</div>\r\n<div class=\"b\">\r\n\t“实地认证标”与“信用认证标”的区别是什么？\r\n</div>\r\n<div>\r\n\t“实地认证标”相对“信用认证标”增添了实地认证审核，进一步保障了理财用户资金安全；同时采用本息保障的赔付方式，使得您理财更加省心、放心。\r\n</div>\r\n<div class=\"b\">\r\n\t“实地认证标”如果产生坏账，将如何垫付？\r\n</div>\r\n<div>\r\n\tp2p信贷风险备用金将对此类产品的本金和利息提供双重保障。一旦该产品借款发生逾期，p2p信贷风险备用金将优先代借款人偿付此笔借款的本息及相关费用。<span class=\"html-tag\" style=\"font-family:monospace;font-size:medium;line-height:normal;\">&lt;a <span class=\"html-attribute-name\">href</span>=\"<a class=\"html-attribute-value html-external-link\" target=\"_blank\" href=\"http://www.fanwe.com/lvyou\">http://www.fanwe.com/lvyou</a>\" <span class=\"html-attribute-name\">target</span>=\"<span class=\"html-attribute-value\">_blank</span>\"&gt;</span><span style=\"font-family:monospace;font-size:medium;line-height:normal;\">圣代千行旅游系统</span><span class=\"html-tag\" style=\"font-family:monospace;font-size:medium;line-height:normal;\">&lt;/a&gt;</span>\r\n</div>',17,1457977748,1457977748,0,1,'',0,0,0,2,'','','','','',''),(60,'充值方式','','<div class=\"b\">\t如何给我的账户充值</div>\r\n<div>\t<div>1.进入“我的p2p信贷-充值提现页面”，输入要充值的金额，点击充值按钮，将弹出国通付或快钱付款界面。</div>\r\n\t<div>2.选择付款银行，点击确认无误按钮，按提示完成付款。</div>\r\n\t<div>3.\t付款后，显示成功付款后，跳转到p2p信贷充值页面，显示充值成功。</div>\r\n\t<div>4.\t您可以通过资金记录查看充值的金额及历史记录。</div>\r\n</div>',18,1457977748,1457977748,0,1,'',0,0,0,3,'','','','','',''),(61,'如何充值','','<div class=\"b\">\t如何给我的账户充值</div>\r\n<div>\t<div>1.进入“我的p2p信贷-充值提现页面”，输入要充值的金额，点击充值按钮，将弹出国付通或快钱付款界面。</div>\r\n\t<div>2.选择付款银行，点击确认无误按钮，按提示完成付款。</div>\r\n\t<div>3.\t付款后，显示成功付款后，跳转到p2p信贷充值页面，显示充值成功。</div>\r\n\t<div>4.\t您可以通过资金记录查看充值的金额及历史记录。</div>\r\n</div>',18,1457977748,1457977748,0,1,'',0,0,0,2,'','','','','',''),(62,'提现','','<div class=\"b\">\t如何提取现金</div>\r\n<div>\t<div>您可以随时将您在“p2p信贷”账号中的可用余额申请提现到您现有的任何一家银行的账号上。 </div>\r\n\t<div>注意：请确保您填写的银行账号的开户人姓名和您在p2p信贷上提供的身份证上的真实姓名一致，并提供一张可以申请提现的银行账号，否则提现无法成功。 </div>\r\n</div>\r\n<div class=\"b\">\t在申请取现时，如何填写正确的开户行支行名称</div>\r\n<div>\t<div>用户在申请取现时，一定要确保自己填写的开户行支行名称正确。 </div>\r\n\t<div>一般的开户行支行名称都是由 xx银行+xx分行+xx支行 组成的。 </div>\r\n\t<div>如：</div>\r\n\t<div>招商银行上海分行新客站支行 </div>\r\n\t<div>工商银行四川省攀枝花市分行 </div>\r\n\t<div>农业银行深圳分行长城支行 </div>\r\n\t<div>交通银行北京崇文门支行 </div>\r\n\t<div>如果用户不清楚开户行支行名称，可以打电话到当地所在银行的营业网点询问或者登录该银行网站查找。 </div>\r\n</div>\r\n<div class=\"b\">\t为什么我申请取现失败？ </div>\r\n<div>\t<div>造成您取现失败的原因可能有以下几种： </div>\r\n\t<div> ?&nbsp;p2p信贷账号未绑定本人身份证 </div>\r\n\t<div> ? 银行开户行信息错误 </div>\r\n\t<div> ? 银行账号/户名错误，或是账号和户名不符 </div>\r\n\t<div> ? 使用信用卡提现 </div>\r\n\t<div> ? 银行账户冻结或正在办理挂失 </div>\r\n\t<div>如果遇到以上情况，我们会在收到支付机构转账失败的的通知后解除您的资金冻结（手续费不退还），请您不必担心资金安全。 </div>\r\n</div>',18,1457977748,1457977748,0,1,'',0,0,0,1,'','','','','',''),(63,'注册登录','','<div class=\"b\">\t如何成为p2p信贷注册用户</div>\r\n<div>\t<div>1.\t进入p2p信贷首页，点击右上角“免费注册”按钮。</div>\r\n\t<div>2.\t根据提示信息，填写您的注册邮箱、密码，点击“免费注册”。</div>\r\n\t<div>3.\t注册邮箱为用户的用户名，为后续接收站内消息及账单的唯一渠道，注册后此邮箱不可修改。</div>\r\n</div>\r\n<div class=\"b\">\t如何登录p2p信贷</div>\r\n<div>\t<div>注册成为p2p信贷用户后,您就可以使用账号登录p2p借贷了：</div>\r\n\t<div>1.\t进入p2p信贷首页，点击右上角“登录”按钮。</div>\r\n\t<div>2.\t输入您的账号(电子邮件)及密码，点击“登录”按钮。</div>\r\n</div>\r\n<div class=\"b\">\t如何找回我的密码</div>\r\n<div>\t<div>如果您遗忘了密码，可以在网站用户登录页面，点击“忘记密码了”按钮，填写自己的Email地址信息找回密码。</div>\r\n\t<div>1.\t点击首页“登录”---点击“忘记密码”。</div>\r\n\t<div>2.\t填写您当时注册的邮箱，点击“发送到我的邮箱”。</div>\r\n\t<div>3.\t提示邮件发送成功。</div>\r\n\t<div>4.\t根据提示到您的邮箱中将会收到一封标题为“重设密码”的信件,点击信中的链接。</div>\r\n\t<div>5.\t根据提示密码重置成功。</div>\r\n</div>\r\n<div class=\"b\">\t设置密码</div>\r\n<div>\t您注册时输入的密码可以是数字或者英文字母，对于英文字母我们同时设置了大小写的区分。注册后您可以随时在“我的p2p借贷”--“个人设置”?“修改密码”中修改您所设定的密码。</div>\r\n<div class=\"b\">\t账户密码安全常识</div>\r\n<div>\t<div>请仔细阅读以下常见的安全措施：</div>\r\n\t<div>1.\t密码要保密，且定期更改。</div>\r\n\t<div>2.\t请使用较长、复杂的字母数字组合以提高密码强度，不要用生日等容易被别人猜中的密码。</div>\r\n\t<div>3.\t如果使用了密码取回功能，请您及时删除我们发送给您的载有密码的邮件。</div>\r\n\t<div>4.\t请记住不要与任何人共享您的密码。如果您已经与他人共享了密码，我们强烈建议您尽快更改。</div>\r\n\t<div>5.\t您可能在不经意间使计算机受到病毒、木马、间谍软件、广告软件的感染，这些软件也可能记录并盗走您的密码！所以，请安装和使用杀毒软件。</div>\r\n</div>',19,1457977748,1457977748,0,1,'',0,0,1,3,'','','','','',''),(64,'我的p2p信贷','','<div class=\"b\">\t如何修改个人资料</div>\r\n<div>\t访问“我的p2p信贷”? “个人设置”?“修改个人信息”-，即可编辑个人资料。</div>\r\n<div class=\"b\">\t如何取消p2p信贷的邮件和站内信的提醒</div>\r\n<div>\t访问“我的p2p信贷”? “个人设置”?“通知设置”-，即可修改。</div>',19,1457977748,1457977748,0,1,'',0,0,0,2,'','','','','',''),(65,'意见反馈、举报','','<div class=\"b\">\t对网站有任何建议或意见，如何反馈</div>\r\n<div>\t<div>您可以发站内信给用户“p2p信贷客服”，我们会及时给您回馈。</div>\r\n\t<div>发站内信请访问网站上“我的p2p信贷”-“我的p2p信贷”-“站内信”。</div>\r\n</div>\r\n<div class=\"b\">\t遇到其他用户恶意骚扰怎么办</div>\r\n<div>\t如遇到情况严重的恶意骚扰，请举报该用户给p2p信贷工作人员。我们核实后会尽快采取处理措施。</div>\r\n<div class=\"b\">\t遇到别人盗用我的资料假冒我怎么办</div>\r\n<div>\t如遇到此类情况，您可以联系p2p借贷的在线客服或拨打我们的客服热线400-888-8888来向我们说明情况，我们会尽快采取处理措施，以确保您信息和资金的安全。</div>\r\n<div class=\"b\">\t如何截屏并保存图片</div>\r\n<div>\t<div>一、使用PrintScreen键</div>\r\n\t<div>1、首先，在出现想要截的画面的时候，按下键盘上的PrintScreen键。</div>\r\n\t<div>2、在\"开始\"→\"所有程序\"→\"附件\"选\"画图\"，这会打开Windows系统自带的画图程序(mspaint.exe)选择\"编辑\"→\"粘贴\"(或者直接用Ctrl+V热键)，将截下来的图粘贴到画图程序中。</div>\r\n\t<div>3、将图片进行保存，选择\"文件\"→\"另存为\"，在出现的另存为对话框中选择保存类型为 JPEG（*.JPG;*.JPEG;*.JPE;*.JFIF），然后输入文件名，点击保存。</div>\r\n\t<div>二、使用QQ截屏</div>\r\n\t<div>1、打开QQ对话框。</div>\r\n\t<div>2、点击Ctrl+Alt+A键，用鼠标选取想截屏的画面。</div>\r\n\t<div>3、点击“保存”，在出现的对话框中选择保存类型为 JPEG（*.JPG;*.JPEG;），然后输入文件名，点击保存。</div>\r\n\t<div>三、使用其他截屏工具</div>\r\n\t<div>说明： 请不要用任何其他图片编辑软件编辑。如果发现用户存在用其他图片编辑软件的情况，您将会被加入系统黑名单。</div>\r\n</div>',19,1457977748,1457977748,0,1,'',0,0,0,1,'','','','','',''),(66,'管理团队','','',2,1457977748,1461871990,0,1,'',0,0,2104,55,'','','','','',''),(67,'2014-5-9   3月份运营数据：成交金额1530万','','<p></p>\r\n<div><b><span style=\"color:#f10b00;\">&nbsp;3月份运营数据：成交金额1530万，投资人收益980万</span></b><br />\r\n</div>\r\n<p></p>',5,1457977748,1457977748,0,1,'',0,0,1394,55,'p2p信贷','网络贷款','网贷','','3月份运营数据','尊敬的p2p信贷用户：\r\n     经过团队为期两个月的筹备、测试，p2p信贷终于和各位朋友见面了！\r\n \r\n     您在p2p信贷上能够接触到全新的借款和理财模式，体验到技术进步带来的便捷与实惠。也欢迎各位邀请自己的亲戚、朋友、同事来使用p2p信贷，让更多的人能够感受到网络互助平台带来的前所未有的借贷体验。\r\n \r\n     为庆祝网站上线，网站目前免收成交费用。请大家把握机会，多多尝试借款~~\r\n \r\n \r\n \r\np2p信贷团队\r\n2013年3月4日'),(73,'常规问题','','<p cl