# Data for table "p2p_baofoo_recharge"
#


#
# Structure for table "p2p_carry"
#

DROP TABLE IF EXISTS `p2p_carry`;
CREATE TABLE `p2p_carry` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `class_name` varchar(255) NOT NULL,
  `is_effect` tinyint(1) NOT NULL,
  `online_pay` tinyint(1) NOT NULL,
  `fee_amount` decimal(20,4) NOT NULL COMMENT '手续费用的计费值',
  `name` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `total_amount` decimal(20,4) NOT NULL COMMENT '总操作金额',
  `config` text NOT NULL,
  `logo` varchar(255) NOT NULL,
  `sort` int(11) NOT NULL,
  `fee_type` tinyint(1) NOT NULL,
  `pay_fee_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '支付公司收费类型',
  `pay_fee_amount` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '支付公司收费收费',
  `reserve` varchar(255) DEFAULT NULL,
  `exted` tinyint(3) DEFAULT '0',
  `ext1` varbinary(2000) DEFAULT NULL,
  `ext2` varbinary(2000) DEFAULT NULL,
  `ext3` varbinary(2000) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

