#
# Structure for table "p2p_conf"
#

DROP TABLE IF EXISTS `p2p_conf`;
CREATE TABLE `p2p_conf` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '配置名称',
  `value` text NOT NULL COMMENT '设定值',
  `group_id` int(11) NOT NULL DEFAULT '0' COMMENT '1:基础配置 2:图片配置 3:站点配置 4:会员相关配置 5:邮件与短信 6:借款配置 7:会员奖励 8:扩展配置',
  `input_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '配置输入的类型 0:文本输入 1:下拉框输入 2:图片上传 3:编辑器 4:密码 5:文本域',
  `value_scope` text NOT NULL COMMENT '取值范围',
  `is_effect` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有效',
  `is_conf` tinyint(1) NOT NULL COMMENT '是否可配置 0: 可配置  1:不可配置',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `tip` text NOT NULL COMMENT '提示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=298 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

