DROP TABLE IF EXISTS `p2p_deal_dream`;
CREATE TABLE `p2p_deal_dream` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '梦想名称',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `is_effect` tinyint(1) DEFAULT '1' COMMENT '是否有效',
  `is_delete` tinyint(1) DEFAULT '0' COMMENT '是否删除',
  `index` int(11) DEFAULT '0' COMMENT '排序',
  `dream_amount` decimal(10,2) DEFAULT '0.00' COMMENT '梦想总金额',
  `min_loan_money` decimal(10,2) DEFAULT '100.00' COMMENT '最低额度',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `create_date` date NOT NULL DEFAULT '0000-00-00' COMMENT '创建日期',
  `rate` decimal(10,2) DEFAULT '0.00' COMMENT '年利率',
  `update_time` int(11) DEFAULT '0' COMMENT '更新时间',
  `update_date` date DEFAULT '0000-00-00' COMMENT '更新日期',
  `load_money` decimal(10,2) DEFAULT '0.00' COMMENT '已完成多少',
  `success_time` int(11) DEFAULT '0' COMMENT '完成时间',
  `success_date` date DEFAULT '0000-00-00' COMMENT '完成日期',
  `end_time` int(11) DEFAULT '0' COMMENT '结束时间',
  `end_date` date DEFAULT '0000-00-00' COMMENT '结束日期',
  `is_normal` tinyint(3) DEFAULT '1' COMMENT '是否正常结束',
  `status` tinyint(3) NOT NULL DEFAULT '1' COMMENT '0正常结束,1进行中,2已完成,3提前结束',
  `dream_sn` varchar(50) DEFAULT '' COMMENT '编号',
  `dream_to_user` int(11) DEFAULT '0' COMMENT '关联用户',
  `contract_id` int(11) DEFAULT '0' COMMENT '合同模板',
  `RESERVE1` varchar(512) DEFAULT '' COMMENT '保留字段1',
  `RESERVE2` varchar(512) DEFAULT '' COMMENT '保留字段2',
  `RESERVE3` varchar(512) DEFAULT '' COMMENT '保留字段3',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

