DROP TABLE IF EXISTS `p2p_deal_dream_load`;
CREATE TABLE `p2p_deal_dream_load` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deal_id` int(11) NOT NULL DEFAULT '0' COMMENT '我的梦想ID',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '我的梦想用户ID',
  `user_name` varchar(50) NOT NULL DEFAULT '' COMMENT '我的梦想用户名',
  `index` int(11) DEFAULT '1' COMMENT '存入序号',
  `money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '存入金额',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '存入时间',
  `create_date` date NOT NULL DEFAULT '0000-00-00' COMMENT '记录投资日期,方便统计使用',
  `end_time` int(11) DEFAULT '0' COMMENT '结束时间',
  `end_date` date DEFAULT '0000-00-00' COMMENT '记录结束日期,方便统计使用',
  `space_total_days` int(1) DEFAULT '0' COMMENT '间隔总天数',
  `space_month` int(11) DEFAULT '0' COMMENT '间隔月份',
  `space_days` int(11) DEFAULT '0' COMMENT '间隔天数',
  `is_over` tinyint(1) DEFAULT '0' COMMENT '是否已结清',
  `yesterday_interest_money` decimal(10,2) DEFAULT '0.00' COMMENT '昨日收益',
  `interest_money` decimal(10,2) DEFAULT '0.00' COMMENT '总收益',
  `is_has_loans` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否转账到平台',
  `msg` varchar(100) DEFAULT NULL COMMENT '备注',
  `RESERVE1` varchar(256) DEFAULT '' COMMENT '保留字段1',
  `RESERVE2` varchar(256) DEFAULT '' COMMENT '保留字段2',
  `RESERVE3` varchar(256) DEFAULT '' COMMENT '保留字段3',
  PRIMARY KEY (`id`),
  KEY `deal_id` (`deal_id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE
