  `bad_msg` text NOT NULL COMMENT '失败原因',
  `create_time` int(11) NOT NULL COMMENT '添加时间',
  `update_time` int(11) NOT NULL COMMENT '处理时间',
  `contract_id` int(11) NOT NULL COMMENT '借款合同',
  `tcontract_id` int(11) NOT NULL COMMENT '转让合同',
