  PRIMARY KEY (`id`),
  KEY `idx0` (`user_id`,`status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='授信额度申请';

