  `pAccount` varchar(30) DEFAULT NULL COMMENT '担保方账户 否 担保方类型为1时，IPS托管账户号（个人） 担保方类型为0时，由IPS颁发的商户号 ',
  `pMemo1` varchar(100) DEFAULT NULL,
  `pMemo2` varchar(100) DEFAULT NULL,
  `pMemo3` varchar(100) DEFAULT NULL,
