#
# Structure for table "p2p_msg_template"
#

DROP TABLE IF EXISTS `p2p_msg_template`;
CREATE TABLE `p2p_msg_template` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `content` text NOT NULL,
  `is_update` tinyint(3) DEFAULT '0' COMMENT '模板是否更新',
  `is_effect` tinyint(3) DEFAULT '0' COMMENT '是否有效',
  `type` tinyint(1) NOT NULL,
  `is_html` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=93 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

