INSERT INTO `p2p_msg_template` VALUES (3,'TPL_MAIL_USER_VERIFY','尊敬的用户您的验证码是【{$verify.code}】，此验证码只能用来注册。',1,1,1,1),(4,'TPL_MAIL_USER_PASSWORD','尊敬的用户您的验证码是【{$verify.code}】。',1,1,1,1),(5,'TPL_SMS_PAYMENT','尊敬的用户{$payment_notice.user_name}，您所下订单{$payment_notice.notice_sn}金额{$payment_notice.money_format}于{$payment_notice.pay_time_format}支付成功。',1,1,0,0),(6,'TPL_MAIL_PAYMENT','尊敬的用户{$payment_notice.user_name}，您所下订单{$payment_notice.notice_sn}金额{$payment_notice.money_format}于{$payment_notice.pay_time_format}支付成功。',1,1,1,0),(9,'TPL_SMS_VERIFY_CODE','您的验证码为{$verify.code}，请于{$verify.time}分钟内正确输入，如非本人操作，请忽略此短信。',1,1,0,0),(10,'TPL_DEAL_NOTICE_SMS','又有新借款啦！{$notice.deal_name}，欢迎来投标www.xxx.com。',1,1,0,0),(16,'TPL_MAIL_DEAL_FAILED','<p>尊敬的用户{$notice.user_name}：&nbsp; </p>\n<p>遗憾的通知您，您于{$notice.deal_publish_time}发布的借款“{$notice.deal_name}”流标，您的本次借款行为失败。&nbsp;</p><p>您借款失败的可能原因为：&nbsp; </p>\n<br>\n<br>\n1. 您没能按时提交四项必要信用认证的材料。\n<br>\n<br>\n2. 您在招标期间没有筹集到足够的借款。&nbsp;&nbsp; \n<p>如果您属于认证未通过流标，为了您能够成功贷款，请凑齐申请贷款所需要的材料。您可以点击<a href=\"{$notice.help_url}\" target=\"_blank\">需要提供哪些材料？</a>来了解更多所需材料的详情。进行更多的信用认证将有助您获得更高的贷款额度。</p>\n<p>如果您属于招标到期流标，为了您能够成功贷款，请适度提高贷款利率，将有助您更快的获得贷款。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>点击 <a href=\"{$notice.send_deal_url}\">这里</a>重新发布借款。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>感谢您对我们的支持与关注。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>{$notice.site_name}&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>注：此邮件由系统自动发送，请勿回复！&nbsp; </p>\n<p>如果您有任何疑问，请您查看 <a href=\"{$notice.help_url}\" target=\"_blank\">帮助</a>，或访问 <a href=\"{$notice.site_url}\" target=\"_blank\">客服中心</a></p>\n<p>如果您觉得收到过多邮件，可以点击 <a href=\"{$notice.msg_cof_setting_url}\" target=\"_blank\">这里</a>进行设置</p>',1,1,1,1),(17,'TPL_MAIL_LOAD_FAILED','<p>尊敬的用户{$notice.user_name}：&nbsp; </p>\n<p>遗憾的通知您，您于{$notice.deal_load_time}所投的借款“{$notice.deal_name}”流标，您的本次投标行为失败。&nbsp;</p><p>您所投的借款失败的可能原因为：&nbsp; </p>\n<br>\n<br>\n1. 借款者没能按时提交四项必要信用认证的材料。\n<br>\n<br>\n2. 借款者在招标期间没有筹集到足够的借款。&nbsp;&nbsp; \n<p>感谢您对我们的支持与关注。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>{$notice.site_name}&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>注：此邮件由系统自动发送，请勿回复！&nbsp; </p>\n<p>如果您有任何疑问，请您查看 <a href=\"{$notice.help_url}\" target=\"_blank\">帮助</a>，或访问 <a href=\"{$notice.site_url}\" target=\"_blank\">客服中心</a></p>\n<p>如果您觉得收到过多邮件，可以点击 <a href=\"{$notice.msg_cof_setting_url}\" target=\"_blank\">这里</a>进行设置</p>',1,1,1,1),(18,'TPL_DEAL_THREE_SMS','尊敬的用户{$notice.user_name}，您的融资标的“{$notice.deal_name}”本期还款日期为{$sh_notice.repay_time}(遇周末及法定节假日提前至上一个工作日)，待还款金额{$sh_notice.repay_money}元，请及时充值，确保账户余额充足，避免因逾期产生信用记录瑕疵和催收费用。登陆http://www.xxx.com查看。',1,1,0,0),(19,'TPL_MAIL_DEAL_MSG','<p>尊敬的用户{$notice.user_name}：</p>\r\n<p>您好，用户{$notice.msg_user_name}对您发布的借款列表“{$notice.deal_name}”进行了以下留言：</p>\r\n<p>“{$notice.message}”</p>\r\n<p>请您登录{$notice.site_name}借款详情页面查看答复。</p>\r\n<p>点击 <a href=\"\"{$notice.deal_url}\"\" target=\"\"_blank\"\">这里</a>进行答复。</p>\r\n<p>感谢您对我们的支持与关注！</p>',1,0,1,1),(20,'TPL_MAIL_DEAL_REPLY_MSG','<p>尊敬的用户{$notice.user_name}：</p>\r\n<p>您好，用户{$notice.msg_user_name}回复了您对借款列表“{$notice.deal_name}”的留言。具体回复如下：</p>\r\n<p>“{$notice.message}”</p>\r\n<p>点击 <a href=\"\"{$notice.deal_url}\"\" target=\"\"_blank\"\">这里</a>查看借款列表详情或进行投标。</p>\r\n<p>感谢您对我们的支持与关注！</p>\r\n<p>{$notice.site_name</p>',1,0,1,1),(21,'TPL_DEAL_THREE_EMAIL','<p>尊敬的用户{$notice.user_name}：&nbsp; </p>\n<p>您的借款“<a href=\"{$notice.deal_url}\">{$notice.deal_name}</a>”本期还款日是{$notice.repay_time_d}日，还款金额{$notice.repay_money}元，请按时还款。【{$notice.site_name}】 </p>\n<p>点击 <a href=\"{$notice.repay_url}\">这里</a>进行还款。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>感谢您对我们的支持与关注。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>{$notice.site_name}&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>注：此邮件由系统自动发送，请勿回复！&nbsp; </p>\n<p>如果您有任何疑问，请您查看 <a href=\"{$notice.help_url}\" target=\"_blank\">帮助</a>，或访问 <a href=\"{$notice.site_url}\" target=\"_blank\">客服中心</a></p>\n<p>如果您觉得收到过多邮件，可以点击 <a href=\"{$notice.msg_cof_setting_url}\" target=\"_blank\">这里</a>进行设置</p>',1,1,1,1),(22,'TPL_DEAL_HALF_EMAIL','