#
# Structure for table "p2p_peizi_conf"
#

DROP TABLE IF EXISTS `p2p_peizi_conf`;
CREATE TABLE `p2p_peizi_conf` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '名称',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:天天;1:周;2:月',
  `money_list` varchar(255) NOT NULL COMMENT 'type=0,1申请借款(实盘)资金(2000, 3000,5000,10000 等)以逗号分割;type=2 倍率列表,以逗号分割',
  `min_money` int(10) NOT NULL DEFAULT '0' COMMENT 'type=0,1;最小借款资金\r\ntype=2;最小本金资金',
  `max_money` int(10) NOT NULL DEFAULT '0' COMMENT 'type=0,1;最大借款资金\r\ntype=2;最大本金资金',
  `contract_id` int(10) NOT NULL DEFAULT '0' COMMENT '我已阅读并同意',
  `manage_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '一次性业务审核费',
  `is_holiday_fee` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否周末节假日免费',
  `day_month_list` varchar(255) DEFAULT NULL,
  `rate_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'type=0时，有效; 0:按借款金额收取利率；1按每天的实际交易金额,收取利率',
  `is_effect` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0:启用;1:禁用',
  `sort` int(10) NOT NULL DEFAULT '0' COMMENT '排序',
  `brief` varchar(255) NOT NULL COMMENT '简介',
  `merge_rate_show` tinyint(1) NOT NULL DEFAULT '0' COMMENT '前台合并利息展示，即将:利率与服务费合并; 0:分开展示;1:合并展示',
  `pre_deposit_info` varchar(255) DEFAULT NULL COMMENT '预存款简介',
  `invest_commission_rate` decimal(5,4) DEFAULT '0.0000' COMMENT '投资者获得交易佣金差比率;如果填0,则所有的佣金差，都有平台获得;填:0.4则；40%投资者;60%平台',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='配资参数表';

#
# Data for table "p2p_peizi_conf"
#


#
# Structure for table "p2p_peizi_conf_lever_coefficient_list"
#

DROP TABLE IF EXISTS `p2p_peizi_conf_lever_coefficient_list`;
CREATE TABLE `p2p_peizi_conf_lever_coefficient_list` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `pid` int(10) NOT NULL,
  `lever` int(10) NOT NULL DEFAULT '0' COMMENT '倍数',
  `warning_coefficient` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '警戒系数\r\n警戒金额=投入本金*倍数 + 投入本金 * 倍数 * 警戒系数',
  `open_coefficient` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '平仓系数\r\n平仓金额=投入本金*倍数 + 投入本金 * 倍数 * 平仓系数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='不同倍率下的警戒，平仓系数以及分成比率';

#
# Data for table "p2p_peizi_conf_lever_coefficient_list"
#


#
# Structure for table "p2p_peizi_conf_lever_list"
#

DROP TABLE IF EXISTS `p2p_peizi_conf_lever_list`;
CREATE TABLE `p2p_peizi_conf_lever_list` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `pid` int(10) NOT NULL,
  `min_money` int(10) NOT NULL DEFAULT '0' COMMENT 'if peiziconf.type=2 最小本金 else 最小借款金额',
  `max_money` int(10) NOT NULL DEFAULT '0' COMMENT 'if peiziconf.type=2 最大本金 else 最大借款金额',
  `lever_list` varchar(255) NOT NULL COMMENT '倍数 列表(15,10,5)，以逗号分割',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='配资位数限制';

#
# Data for table "p2p_peizi_conf_lever_list"
#


#
# Structure for table "p2p_peizi_conf_lever_money_list"
#

DROP TABLE IF EXISTS `p2p_peizi_conf_lever_money_list`;
CREATE TABLE `p2p_peizi_conf_lever_money_list` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `pid` int(10) NOT NULL,
  `lever` int(10) NOT NULL DEFAULT '0' COMMENT '倍数',
  `min_month` int(10) NOT NULL DEFAULT '0' COMMENT '包月，最小开始',
  `max_month` int(10) NOT NULL DEFAULT '0' COMMENT '包月，最大值',
  `min_money` int(10) NOT NULL DEFAULT '0' COMMENT '0至10000',
  `max_money` int(10) NOT NULL DEFAULT '0' COMMENT '0至10000',
  `warning_coefficient` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '警戒系数\r\n警戒金额=投入本金*倍数 + 投入本金 * 倍数 * 警戒系数',
  `open_coefficient` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '平仓系数\r\n平仓金额=投入本金*倍数 + 投入本金 * 倍数 * 平仓系数',
  `rate1` decimal(5,4) NOT NULL DEFAULT '0.0000',
  `rate2` decimal(5,4) NOT NULL DEFAULT '0.0000',
  `rate3` decimal(5,4) NOT NULL DEFAULT '0.0000',
  `rate4` decimal(5,4) NOT NULL DEFAULT '0.0000',
  `limit_info` varchar(255) NOT NULL COMMENT '仓位限制消息',
  `is_show_today` tinyint(1) NOT NULL DEFAULT '1' COMMENT '开始交易时间，是否显示：今天(节假日，周末及下午1:30后，也不显示）',
  `payoff_rate` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '客户获得的抽成盈利比例;暂时只针对周周盈',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='日利率表 0至10000, 日利率1，日利率2，日利率3，日利率4';

#
# Data for table "p2p_peizi_conf_lever_money_list"
#


#
# Structure for table "p2p_peizi_conf_rate_list"
#

DROP TABLE IF EXISTS `p2p_peizi_conf_rate_list`;
CREATE TABLE `p2p_peizi_conf_rate_list` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `pid` int(10) NOT NULL,
  `min_lever` int(10) NOT NULL DEFAULT '1' COMMENT '最小倍率区间',
  `max_lever` int(10) NOT NULL DEFAULT '10' COMMENT '最大倍率区间',
  `min_month` int(10) NOT NULL DEFAULT '0' COMMENT 'type=2;时，有效;月最小开始',
  `max_month` int(10) NOT NULL DEFAULT '0' COMMENT 'type=2;时，有效;月最大结束',
  `min_money` int(10) NOT NULL DEFAULT '0' COMMENT '0至10000',
  `max_money` int(10) NOT NULL DEFAULT '0' COMMENT '0至10000',
  `site_rate` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '平台收取的:管理费率',
  `rate1` decimal(5,4) NOT NULL DEFAULT '0.0000',
  `rate2` decimal(5,4) NOT NULL DEFAULT '0.0000',
  `rate3` decimal(5,4) NOT NULL DEFAULT '0.0000',
  `rate4` decimal(5,4) NOT NULL DEFAULT '0.0000',
  `payoff_rate` decimal(5,3) DEFAULT '1.000' COMMENT '盈利分成比;填入0.7则，实际盈利的70%归操盘者；30%归平台',
  `invest_payoff_rate` decimal(5,3) NOT NULL DEFAULT '0.000' COMMENT '出资者与平台的分成比【出资者获得=股票盈利*(1-payoff_rate)*invest_payoff_rate】',
  `limit_info` varchar(255) NOT NULL COMMENT '仓位限制消息',
  `is_show_today` tinyint(1) NOT NULL DEFAULT '1' COMMENT '开始交易时间，是否显示：今天(节假日，周末及下午1:30后，也不显示）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='日利率表 0至10000, 日利率1，日利率2，日利率3，日利率4';

