  `interest_rate` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT 'type=0每次，可获得投资金额 利息收益的 n%, 作为返利;\r\ntype=1每次，可获得平台 服务费收益的 n%, 作为返利',
