#
# Structure for table "p2p_peizi_order"
#

DROP TABLE IF EXISTS `p2p_peizi_order`;
CREATE TABLE `p2p_peizi_order` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `peizi_name` varchar(255) NOT NULL,
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `invest_user_id` int(10) NOT NULL DEFAULT '0' COMMENT '出资人',
  `deal_id` int(10) NOT NULL DEFAULT '0' COMMENT '关联理财标ID',
  `order_sn` varchar(50) NOT NULL COMMENT '订单编号',
  `peizi_conf_id` int(10) NOT NULL DEFAULT '0' COMMENT '配资配置表',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '配资类型;0:天;1周；2月',
  `rate_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'type=0时，有效; 0:按借款金额收取利率；1按每天的实际交易金额,收取利率',
  `rate` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '利率',
  `rate_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '每日或每月利息费用【出资人收取】',
  `site_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '服务费 = 借款金额×管理费率【按天或月收取】【平台收取的】',
  `site_rate` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '服务费率【每日/月收取】[平台收取的]',
  `manage_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '平台收取配资人的，成交服务费或是一次性业务审核费用(相当于p2p的满标服务费)',
  `score` int(10) NOT NULL DEFAULT '0' COMMENT '借款者获得积分',
  `cost_money` int(10) NOT NULL DEFAULT '0' COMMENT '本金',
  `borrow_money` int(10) NOT NULL DEFAULT '0' COMMENT '借款金额',
  `trade_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '计息金额,用于计算rate_money,site_money的基数,按借款金额计算=p2p_peiziorder.borrow_money；如果按实际使用资金计息方式则为=\r\n1、当天新增+	===》利息，佣金\r\n2、当天卖出+	===》利息，佣金\r\n3、当天持有+（不含：当天新增，卖出部分）===》利息',
  `trade_date` date NOT NULL COMMENT '计息金额统计日期',
  `stock_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当前帐户股票市值(帐户余额+股票市值）',
  `stock_date` date DEFAULT NULL COMMENT '当前帐户股票市值 记录时间',
  `re_cost_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '返还保证金, 有可能出现负数; 出现负数时,则说明：配资者的本金不够还亏损',
  `lever` int(10) NOT NULL DEFAULT '0' COMMENT '配资倍率',
  `warning_coefficient` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '警戒系数',
  `warning_line` int(10) NOT NULL DEFAULT '0' COMMENT '亏损警戒线',
  `open_coefficient` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '平仓系数',
  `open_line` int(10) NOT NULL DEFAULT '0' COMMENT '亏损平仓线',
  `time_limit_num` int(10) NOT NULL DEFAULT '0' COMMENT '资金使用期限',
  `begin_date` date DEFAULT NULL COMMENT '开始交易时间(启息时间)',
  `end_date` date DEFAULT NULL COMMENT '预计操作结束时间',
  `create_time` datetime NOT NULL COMMENT '订单创建时间',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT 'status:0:正在申请;1:支付成功;2:验证通过;3:验证失败;4:筹款成功;5:筹款失败;6:开户成功;7:开户失败;8:平仓结束;9:已撤消',
  `memo` varchar(255) DEFAULT NULL COMMENT '订单备注',
  `op_memo` varchar(255) DEFAULT NULL COMMENT '审核未通过的原因',
  `first_rate_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '首次收取的利息费用(或预存款)',
  `contract_id` int(10) NOT NULL DEFAULT '0' COMMENT '借款合同',
  `stock_sn` varchar(255) DEFAULT NULL COMMENT '分配的，股票帐户',
  `stock_pwd_encrypt` varbinary(255) DEFAULT NULL COMMENT '分配的，股票密码',
  `last_fee_date` date DEFAULT NULL COMMENT '最后(近)一次扣费日期（日，月利率)',
  `next_fee_date` date DEFAULT NULL COMMENT '下次扣费日期',
  `payoff_rate` decimal(5,3) NOT NULL DEFAULT '1.000' COMMENT '盈利比如：0.7则，实际盈利的70%归操盘者；30%归平台',
  `invest_payoff_rate` decimal(5,3) NOT NULL DEFAULT '0.000' COMMENT '出资者与平台的分成比',
  `stock_pwd` varchar(255) DEFAULT NULL COMMENT '分配的，股票密码',
  `user_payoff_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '用户获得盈利',
  `invest_payoff_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '出资人分成=股票盈利*(1-payoff_rate)*invest_payoff_rate',
  `site_payoff_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '平台获得的盈利金额',
  `other_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '平仓时的，收取的其它费用',
  `other_memo` varchar(255) DEFAULT NULL COMMENT '收费的其它费用备注',
  `is_holiday_fee` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0;type=0时有效;1周末节假日免费',
  `admin_id` int(10) NOT NULL DEFAULT '0' COMMENT '分配的专职管理员',
  `is_today` tinyint(1) NOT NULL DEFAULT '0' COMMENT '交易开始时间(0:下一交易日;1:今天)',
  `is_arrearage` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1:自动继费失败',
  `invest_commission_rate` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '投资者获得交易佣金差比率;如果填0,则所有的佣金差，都有平台获得;填:0.4则；40%投资者;60%平台',
  `total_site_commission_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '平台累计，收到：佣金',
  `total_invest_commission_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '投资者累计，收到：佣金',
  `total_site_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已收服务费总和',
  `total_rate_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已收利息总和',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `bad_msg` text NOT NULL COMMENT '流标原因',
  `p_invest_user_id` int(10) NOT NULL DEFAULT '0' COMMENT '投资者推荐人',
  `invite_invest_money_rate` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '投资推荐人p_user_id获得的: 投资人投资金的n%作为返利',
  `invite_invest_interest_rate` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '投资推荐人p_invest_user_id获得的:投资人利息收益的n%作为返利',
  `invite_invest_commission_rate` decimal(5,4) NOT NULL DEFAULT '0.0000' COMMENT '投资推荐人p_invest_user_id获得的:投资人佣金收益的 n%作为返利',
  `invite_invest_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '投资返利【投资推荐人p_invest_user_id获得的: 投资金额返利 = borrow_money * invite_invest_money_rate】',
  `p_user_id` int(10) NOT NULL DEFAULT '0' COMMENT '配资者推荐人',
  `invite_borrow_money_rate` decimal(5,4) DEFAULT '0.0000' COMMENT '借款推荐人p_user_id获得的: 借款人借款的n%作为返利',
  `invite_borrow_interest_rate` decimal(5,4) DEFAULT '0.0000' COMMENT '借款推荐人p_user_id获得的: 平台服务费收益的n%作为返利',
  `invite_borrow_commission_rate` decimal(5,4) DEFAULT '0.0000' COMMENT '借款推荐人p_user_id获得的: 平台佣金收益的 n%作为返利',
  `invite_borrow_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '借款返利【借款推荐人p_user_id获得的: 借款金额返利 = borrow_money * invite_borrow_money_rate】',
  `sort` int(10) NOT NULL DEFAULT '0' COMMENT '前台显示排序',
  `invest_begin_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '投资开始时间',
  `invest_end_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '投资结束时间',
  `view_info` varchar(255) NOT NULL COMMENT '展示资料',
  `load_score` int(10) NOT NULL COMMENT '投资者返积分值',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

