DROP TABLE IF EXISTS `p2p_peizi_order_fee_list`;
CREATE TABLE `p2p_peizi_order_fee_list` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `user_id` int(10) NOT NULL COMMENT '配资者ID',
  `invest_user_id` int(10) NOT NULL DEFAULT '0' COMMENT '出资者',
  `peizi_order_id` int(10) NOT NULL,
  `create_date` datetime DEFAULT NULL,
  `has_pay` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否支付;0:未支付;1:已支付',
  `fee_date` date NOT NULL COMMENT '日期',
  `fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `fee_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '费用类型;1:业务审核费;2:日利息;3:月利息;4:其它费用',
  `memo` varchar(255) NOT NULL COMMENT '备注',
  `borrow_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '借款金额=p2p_peiziorder.borrow_money',
  `trade_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '计息金额,用于计算rate_money,site_money的基数,按借款金额计算=p2p_peiziorder.borrow_money；如果按实际使用资金计息方式则为=\r\n1、当天新增+	===》利息，佣金\r\n2、当天卖出+	===》利息，佣金\r\n3、当天持有+（不含：当天新增，卖出部分）===》利息',
  `rate_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '利息费,出资者收取rate_money=trade_money * p2p_peiziorder.rate',
  `site_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '服务费,平台收取site_money=trade_money * p2p_peiziorder.site_rate',
  `site_commission_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '平台获得的交易佣金',
  `invest_commission_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '投资者获得的交易佣金',
  `p_invest_user_id` int(10) NOT NULL DEFAULT '0' COMMENT '投资者推荐人',
  `invite_invest_interest_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '投资推荐人（p_invest_user_id）获得的: 投资人利息收益的n%返利 = rate_money * p2p_peiziorder.invite_invest_interest_rate',
  `invite_invest_commission_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '投资推荐人（p_invest_user_id）获得的: 投资人佣金收益的n%返利 = invest_commission_money * p2p_peiziorder.invite_invest_commission_rate',
  `p_user_id` int(10) NOT NULL DEFAULT '0' COMMENT '配资者推荐人',
  `invite_borrow_interest_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '借款推荐人（p_user_id）获得的: 平台利息收益的n%返利 = site_money * p2p_peiziorder.invite_borrow_interest_rate',
  `invite_borrow_commission_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '借款推荐人（p_user_id）获得的: 平台佣金收益的n%返利 = site_commission_money * p2p_peiziorder.invite_borrow_commission_rate',
  `is_commission` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1:佣金费用记录;一个订单;一天只有一条记录',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='费用日志表';

