#

DROP TABLE IF EXISTS `p2p_peizi_order_trade`;
CREATE TABLE `p2p_peizi_order_trade` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `trade_sn` varchar(255) NOT NULL COMMENT '定位串',
  `order_id` int(10) NOT NULL DEFAULT '0' COMMENT '订单号',
  `trade_date` date NOT NULL COMMENT '交易日期',
  `stock_type` varchar(50) NOT NULL COMMENT '证券类别',
  `trade_type` varchar(50) NOT NULL COMMENT '交易类别',
  `stock_code` varchar(50) NOT NULL COMMENT '证券代码',
  `stock_name` varchar(50) NOT NULL COMMENT '证券名称',
  `num` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '成交数量',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '成交价格',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '成交金额',
  `total_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '清算金额',
  `commission_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '佣金',
