#
# Structure for table "p2p_site_money_log"
#

DROP TABLE IF EXISTS `p2p_site_money_log`;
CREATE TABLE `p2p_site_money_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '关联用户',
  `user_short_name` varchar(64) DEFAULT NULL COMMENT '用户名',
  `money` decimal(20,2) NOT NULL COMMENT '操作金额',
  `memo` text NOT NULL COMMENT '操作备注',
  `type` tinyint(2) NOT NULL COMMENT '7提前回收，9提现手续费，10借款管理费，12逾期管理费，13人工充值，14借款服务费，17债权转让管理费，18开户奖励，20投标管理费，22兑换，23邀请返利，24投标返利，25签到成功，26逾期罚金（垫付后），27其他费用',
  `create_time` int(11) NOT NULL COMMENT '操作时间',
  `create_time_ymd` date NOT NULL COMMENT '操作时间 ymd',
  `create_time_ym` int(6) NOT NULL COMMENT '操作时间 ym',
  `create_time_y` int(4) NOT NULL COMMENT '操作时间 y',
  `input_user_id` bigint(20) DEFAULT NULL COMMENT '操作者ID',
  `input_user_short_name` varchar(64) DEFAULT NULL COMMENT '操作者用户名',
  `relaserialno` varchar(32) DEFAULT NULL COMMENT '关联流水号',
  `comment` varchar(255) DEFAULT NULL COMMENT '关联备注',
  PRIMARY KEY (`id`),
  KEY `idx0` (`user_id`,`type`,`create_time`) USING BTREE,
  KEY `idx1` (`user_id`,`type`,`create_time_ymd`) USING BTREE,
  KEY `idx2` (`user_id`,`type`) USING BTREE,
  KEY `create_time_ymd` (`create_time_ymd`) USING BTREE,
  KEY `idx3` (`type`,`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1410 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='网站收益日志表';

