#
# Structure for table "p2p_site_money_report"
#

DROP TABLE IF EXISTS `p2p_site_money_report`;
CREATE TABLE `p2p_site_money_report` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `report_date` date NOT NULL DEFAULT '0000-00-00' COMMENT '报表日期',
  `year` int(4) NOT NULL DEFAULT '0' COMMENT '年',
  `month` tinyint(2) NOT NULL DEFAULT '0' COMMENT '月',
  `day` tinyint(2) NOT NULL DEFAULT '0' COMMENT '日',
  `money` double(20,2) DEFAULT NULL COMMENT '当天总收入',
  `loan_fee` double(20,2) DEFAULT NULL COMMENT '借款管理费|融资风险管理费',
  `service_fee` double(20,2) DEFAULT NULL COMMENT '融资服务费',
  `xiwei_fee` double(20,2) DEFAULT NULL COMMENT '席位费',
  `inte_fee` double(20,2) DEFAULT NULL COMMENT '利息管理费',
  `acct_fee` double(20,2) DEFAULT NULL COMMENT '账户管理费',
  `checkout_fee` double(20,2) DEFAULT NULL COMMENT '提现手续费',
  `checkin_fee` double(20,2) DEFAULT NULL COMMENT '充值手续费',
  `vip_fee` double(20,2) DEFAULT NULL COMMENT 'VIP会员费',
  `licai_fee` double(20,2) DEFAULT NULL COMMENT '理财管理费',
  `zhaiquan_fee` double(20,2) DEFAULT NULL COMMENT '债权转让手续费',
  `ziliao_fee` double(20,2) DEFAULT NULL COMMENT '资料审核费',
  `OtherFee1` double(20,2) DEFAULT NULL COMMENT '其他费用1',
  `OtherFee2` double(20,2) DEFAULT NULL COMMENT '其他费用2',
  `OtherFee3` double(20,2) DEFAULT NULL COMMENT '其他费用3',
  `OtherFee4` double(20,2) DEFAULT NULL COMMENT '其他费用4',
  `OtherFee5` double(20,2) DEFAULT NULL COMMENT '其他费用5',
  `OtherFee6` double(20,2) DEFAULT NULL COMMENT '其他费用6',
  `OtherFee7` double(20,2) DEFAULT NULL COMMENT '其他费用7',
  `OtherFee8` double(20,2) DEFAULT NULL COMMENT '其他费用8',
  `Attribute1` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4465 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

