  KEY `multi_key` (`is_effect`,`create_time`) USING BTREE,
  KEY `index_01` (`fav_id`,`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=509 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

