#
# Structure for table "p2p_user_active_log"
#

DROP TABLE IF EXISTS `p2p_user_active_log`;
CREATE TABLE `p2p_user_active_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `create_time` int(11) NOT NULL,
  `point` int(11) NOT NULL,
  `score` int(11) NOT NULL,
  `money` decimal(11,4) NOT NULL COMMENT '钱',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

#
# Data for table "p2p_user_active_log"
#


#
# Structure for table "p2p_user_address"
#

DROP TABLE IF EXISTS `p2p_user_address`;
CREATE TABLE `p2p_user_address` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `name` varchar(50) NOT NULL COMMENT '收货人姓名',
  `address` varchar(255) NOT NULL COMMENT '用户地址',
  `phone` varchar(20) NOT NULL COMMENT '用户电话',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否默认地址',
  `provinces_cities` varchar(100) NOT NULL COMMENT '省市',
  `zip_code` varchar(20) NOT NULL COMMENT '邮编',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

#
# Data for table "p2p_user_address"
#


#
# Structure for table "p2p_user_auth"
#

DROP TABLE IF EXISTS `p2p_user_auth`;
CREATE TABLE `p2p_user_auth` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `m_name` varchar(255) NOT NULL,
  `a_name` varchar(255) NOT NULL,
  `rel_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

#
# Data for table "p2p_user_auth"
#


#
# Structure for table "p2p_user_autobid"
#

DROP TABLE IF EXISTS `p2p_user_autobid`;
CREATE TABLE `p2p_user_autobid` (
  `user_id` int(11) NOT NULL,
  `fixed_amount` decimal(20,0) NOT NULL,
  `min_rate` decimal(20,0) NOT NULL,
  `max_rate` decimal(20,0) NOT NULL,
  `min_period` int(11) NOT NULL,
  `max_period` int(11) NOT NULL,
  `min_level` int(11) NOT NULL,
  `max_level` int(11) NOT NULL,
  `retain_amount` decimal(20,0) NOT NULL,
  `is_effect` tinyint(4) NOT NULL,
  `last_bid_time` int(11) NOT NULL COMMENT '最后一次投标时间',
  `deal_cates` text NOT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

