# Data for table "p2p_user_autobid"
#


#
# Structure for table "p2p_user_bank"
#

DROP TABLE IF EXISTS `p2p_user_bank`;
CREATE TABLE `p2p_user_bank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `bank_id` int(11) DEFAULT NULL,
  `bankcard` varchar(30) DEFAULT NULL,
  `real_name` varchar(20) DEFAULT NULL,
  `region_lv1` int(11) DEFAULT NULL,
  `region_lv2` int(11) DEFAULT NULL,
  `region_lv3` int(11) DEFAULT NULL,
  `region_lv4` int(11) DEFAULT NULL,
  `bankzone` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `bank_id` (`bank_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

