#

INSERT INTO `p2p_user_credit_type` VALUES (1,'实名认证','credit_identificationscanning','./public/credit/1.jpg','您上传的身份证扫描件需和您绑定的身份证一致，否则将无法通过认证。','<div class=\"lh22\">\n\t1、请您上传您<span class=\"f_red\">本人身份证原件</span>的照片。如果您持有第二代身份证，请上传正、反两面照片。\n</div>\n<div class=\"lh22\">\n\t如果您持有第一代身份证，仅需上传正面照片。\n</div>\n<div class=\"lh22\">\n\t2、请确认您上传的资料是清晰的、未经修改的数码照片（不可以是扫描图片）。\n</div>\n<div class=\"lh22\">\n\t每张图片的尺寸<span class=\"f_red\">不大于1.5M</span>。\n</div>','','',3,0,1,1,1,10,1),(2,'工作认证','credit_contact','./public/credit/2.jpg','您的工作状况是评估您信用状况的主要依据。请您填写真实可靠的工作信息。','上传资料说明：<br />\n如果您满足以下 1种以上的身份，例如：您有稳定工作，且兼职开淘宝店。<br />\n我们建议您同时上传两份资料，这将有助于提高您的借款额度和信用等级 <br />\n<br />\n<table class=\"f12\" cellspacing=\"1\" style=\"background:#ccc;\">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<h4>\n\t\t\t\t\t工薪阶层：\n\t\t\t\t</h4>\n请上传以下<span class=\"f_red\">至少两项</span>资料的照片或扫描件：\n\t\t\t</td>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\ta) 劳动合同。\n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\tb) 加盖单位公章的在职证明。\n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\tc) 带有姓名及照片的工作证。\n\t\t\t\t</div>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<h4>\n\t\t\t\t\t私营企业主:\n\t\t\t\t</h4>\n请上传以下<span class=\"f_red\">全部三项</span>资料的照片或扫描件：\n\t\t\t</td>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\ta) 企业的营业执照。\n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\tb) 企业的税务登记证。\n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\tc) 店面照片（照片内需能看见营业执照）。\n\t\t\t\t</div>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<h4>\n\t\t\t\t\t网商：\n\t\t\t\t</h4>\n请上传以下资料的照片或扫描件：\n\t\t\t</td>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\ta) 请上传网店主页和后台的截屏(需要看清网址）。\n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\tb) 支付宝（或其他第三方支付工具）的至少3张最近3个月的商户版成功交易记录的截屏图片。\n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\tc) 营业执照（如果有的话提供，不是必须的）。\n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\">\n\t\t\t\t\td) 备注：如果是淘宝专职卖家，店铺等级必须为3钻以上（含3钻）。\n\t\t\t\t</div>\n\t\t\t</td>\n\t\t</tr>\n\t</tbody>\n</table>','工薪阶层需入职满6个月，私营企业主和淘宝商家需经营满一年','',4,6,1,1,2,10,1),(3,'信用报告','credit_credit','./public/credit/3.jpg','个人信用报告是由中国人民银行出具，全面记录个人信用活动，反映个人信用基本状况的文件。本报告是p2p信贷了解您信用状况的一个重要参考资料。 您信用报告内体现的信用记录，和信用卡额度等数据，将在您发布借款时经网站工作人员整理，在充分保护您隐私的前提下披露给借出者，作为借出者投标的依据。','<div>\n\t<div class=\"lh22\">\n\t\t1、个人信用报告需<span class=\"f_red\">15日内</span>开具。\n\t</div>\n\t<div class=\"lh22\">\n\t\t2、上传您的<span class=\"f_red\">个人信用报告原件</span>的照片，每页信用报告需独立照相，并将整份信用报告按页码先后顺序完整上传。 <br />\n<a href=\"#creditDiv\" id=\"creditGuy\" class=\"f_blue\">如何办理个人信用报告？</a> <br />\n<a href=\"http://www.pbccrc.org.cn/zxzx/lxfs/lxfs.shtml\" target=\"_blank\" class=\"f_blue\">全国各地征信中心联系方式查询</a> \n\t</div>\n\t<div class=\"lh22\">\n\t\t3、请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。\n\t</div>\n</div>','','上传央行信用报告',2,6,1,0,3,10,1),(4,'收入认证','credit_incomeduty','./public/credit/4.jpg','您的银行流水单以及完税证明，是证明您收入情况的主要文件，也是评估您还款能力的主要依据之一。','上传资料说明：<br />\n如果您满意以下 1种以上的身份，例如：您有稳定工作，且兼职开淘宝店。 <br />\n我们建议您同时上传两份资料，这将有助于提高您的借款额度和信用等级。 <br />\n<table class=\"f12\" cellspacing=\"1\" style=\"background:#ccc;\">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<h4>\n\t\t\t\t\t工薪阶层：\n\t\t\t\t</h4>\n请上传右侧<span class=\"f_red\">一项或多项</span>资料：\n\t\t\t</td>\n\t\t\t<td class=\"wb\">\n\t\t\t\t<div class=\"lh22\" style=\"padding:0 10px;\">\n\t\t\t\t\ta) 最近连续六个月工资卡银行流水单的照片或扫描件，须有银行盖章，或工资卡网银的电脑截屏。<br />\n<a href=\"#bankDiv\" id=\"bankGuy\" class=\"f_blue\">如何办理银行流水单？</a> \n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\" style=\"padding:0 10px;\">\n\t\t\t\t\tb) 最近连续六个月的个人所得税完税凭证。<br />\n<a href=\"#dutyDiv\" id=\"dutyGuy\" class=\"f_blue\">如何办理个人所得税完税证明？</a> \n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\" style=\"padding:0 10px;\">\n\t\t\t\t\tc) 社保卡正反面原件的照片以及最近连续六个月缴费记录。\n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\" style=\"padding:0 10px;\">\n\t\t\t\t\td) 如果工资用现金形式发放，请提供近半年的常用银行储蓄账户流水单，须有银行盖章，或工资卡网银的电脑截屏。。\n\t\t\t\t</div>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<h4>\n\t\t\t\t\t私营企业主:\n\t\t\t\t</h4>\n请上传右侧<span class=\"f_red\">一项或多项</span>资料的照片或扫描件：\n\t\t\t</td>\n\t\t\t<td class=\"wb\">\n\t\t\t\t<div class=\"lh22\" style=\"padding:0 10px;\">\n\t\t\t\t\ta) 最近连续六个月个人银行卡流水单，须有银行盖章，或网银的电脑截屏。<br />\n<a href=\"#bankDiv\" id=\"bankGuy2\" class=\"f_blue\">如何办理银行流水单？</a> \n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\" style=\"padding:0 10px;\">\n\t\t\t\t\tb) 最近连续六个月企业银行流水单，须有银行盖章；或近半年企业的纳税证明。\n\t\t\t\t</div>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td class=\"pl10 pr10 wb\">\n\t\t\t\t<h4>\n\t\t\t\t\t网商：\n\t\t\t\t</h4>\n请上传右侧<span class=\"f_red\">全部两项</span>资料的照片或扫描件：\n\t\t\t</td>\n\t\t\t<td class=\"wb\">\n\t\t\t\t<div class=\"lh22\" style=\"padding:0 10px;\">\n\t\t\t\t\ta) 最近连续六个月个人银行卡流水单，须有银行盖章，或网银的电脑截屏。<br />\n<a href=\"#bankDiv\" id=\"bankGuy2\" class=\"f_blue\">如何办理银行流水单？</a> \n\t\t\t\t</div>\n\t\t\t\t<div class=\"lh22\" style=\"padding:0 10px;\">\n\t\t\t\t\tb) 如果是淘宝商家请上传近半年淘宝店支付宝账户明细的网银截图。\n\t\t\t\t</div>\n\t\t\t</td>\n\t\t</tr>\n\t</tbody>\n</table>','收入需较稳定，私营企业主及淘宝商家月均流水需在20000以上','上传完税证明',6,6,1,0,4,10,1),(5,'电子印章','credit_seal','./public/credit/6.jpg','电子印章将会在借款协议那边使用。','<div class=\"lh22\">\n                        \t电子印章认证必须为<span class=\"f_red\">GIF</span>或者<span class=\"f_red\">PNG</span>的<span class=\"f_red\">背景透明</span>图片。\n                        </div>','','电子印章',1,0,1,0,5,2,0),(6,'房产认证','credit_house','./public/credit/15.jpg','房产证明是证明借入者资产及还款能力的重要凭证,根据借款者提供的房产证明给与借入者一定的信用加分。','1、 请上传以下任意一项或多项资料。\n<div class=\"pl15\">\n\t<div class=\"lh22\">\n\t\ta) <span class=\"f_red\">购房合同以及发票。</span> \n\t</div>\n\t<div class=\"lh22\">\n\t\tb) <span class=\"f_red\">银行按揭贷款合同。</span> \n\t</div>\n\t<div class=\"lh22\">\n\t\tc) <span class=\"f_red\">房产局产调单及收据。</span> \n\t</div>\n</div>\n2、 请确认您上传的资料是清晰的、未经修改的数码照片或<span class=\"f_red\">彩色扫描</span>图片。 每张图片的尺寸<span class=\"f_red\">不大于3M</span>。','必须是商品房','上传房产证明',4,0,1,0,6,3,0),(7,'购车认证','credit_car','./public/credit/12.jpg','购车证明是证明借入者资产及还款能力的重要凭证之一，根据借入者提供的购车证明给与借入者一定的信用加分。','<div class=\"lh22\">\n\t1、请上传您所购买<span class=\"f_red\">车辆行驶证</span>原件的照片。\n</div>\n<div class=\"lh22\">\n\t2、请上传您和您购买车辆的<span class=\"f_red\">合影（照片须露出车牌号码）</span>。\n</div>\n<div class=\"lh22\">\n\t3、请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。\n</div>','','上传汽车证明',4,0,1,0,7,3,0),(8,'学历认证','credit_graducation','./public/credit/10.jpg','出者在选择借款列表投标时，借入者的学历也是一个重要的参考因素。为了让借出者更好、更快地相信您的学历是真实的，强烈建议您对学历进行在线验证。','<div class=\"f14 f_red\">一、2001年至今获得学历，需学历证书编号</div>\n<div class=\"pl15\">\n<div class=\"lh22\">\n\t1、点击 <a href=\"http://www.chsi.com.cn/xlcx/\" target=\"_blank\" class=\"f_blue\">网上学历查询</a>。\n</div>\n<div class=\"lh22\">\n\t2、选择“零散查询”。\n</div>\n<div class=\"lh22\">\n\t3、输入证书编号、查询码（通过手机短信获得，为12位学历查询码）、姓名、以及验证码进行查询。\n</div>\n<div class=\"lh22\">\n\t4、查询成功后，您将查获得《教育部学历证书电子注册备案表》。\n</div>\n<div class=\"lh22\">\n\t5、将该表<span class=\"f_red\">右下角的12位在线验证码</span><a href=\"./public/images/xueli_1.jpg\" target=\"_blank\" class=\"f_blue\">（见样本图01）</a>，输入下面的文本框。\n</div>\n<div class=\"lh22\">\n\t6、点击提交审核。\n</div>\n</div>\n<div class=\"f14 f_red\">\n\t二、1991年至今获得学历，无需学历证书编号\n</div>\n<div class=\"pl15\">\n<div class=\"lh22\">\n\t1、点击 <a href=\"http://www.chsi.com.cn/xlcx/\" target=\"_blank\" class=\"f_blue\">网上学历查询</a>。\n</div>\n<div class=\"lh22\">\n\t2、选择“本人查询”。\n</div>\n<div class=\"lh22\">\n\t3、注册学信网账号。\n</div>\n<div class=\"lh22\">\n\t4、登录学信网，点击“学历信息”。\n</div>\n<div class=\"lh22\">\n\t5、选择您的最高学历，并点击“申请验证报告”（申请过程中，您需通过手机短信获得12位学历查询码，此查询码与{function name=\"app_conf\" v=\"SHOP_TITLE\"}所需验证码不同）。\n</div>\n<div class=\"lh22\">\n\t6、申请成功后，您将获得<span class=\"f_red\">12位在线验证码</span><a href=\"./public/images/xueli_2.jpg\" target=\"_blank\" class=\"f_blue\">（见样本图02）</a> \n</div>\n<div class=\"lh22\">\n\t7、将12位在线验证码输入下面的文本框\n</div>\n<div class=\"lh22\">\n\t8、点击提交审核\n</div>\n</div>','大专或以上学历（普通全日制）','',0,0,1,1,8,10,0),(9,'技术职称认证','credit_titles','./public/credit/9.jpg','技术职称是经专家评审、反映一个人专业技术水平并作为聘任专业技术职务依据的一种资格，不与工资挂钩，是考核借款人信用的评估因素之一，通过技术职称认证证明，您将获得一定的信用加分。','<div class=\"lh22\">\n\t1、请上传您的技术职称证书原件照片。\n</div>\n<div class=\"lh22\">\n\t2、 请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。 每张图片的尺寸<span class=\"f_red\">不大于1.5M</span>。\n</div>','国家承认的二级及以上等级证书。例如律师证、会计证、工程师证等','上传技术职称认证',2,0,1,1,9,2,0),(10,'视频认证','credit_videoauth','./public/credit/8.jpg','什么是视频认证？只有通过视频认证您才能获得贷款，您只需要在视频认证页面上传您本人的视频，并提交，即可申请视频认证。您也可以选择与p2p信贷客服在线上进行视频认证。','<div class=\"lh22\">\n\t1、视频录制要求：\n\t<div>\n\t\t（1）视频认证文件大小<span class=\"f_red\">不得超过50M</span><br />\n（2）\t请上传真实有效的本人的视频<br />\n（3）\t视频文件格式可以是RMVB、WMV、mp4 、 AVI等类型的文件<br />\n（4）\t视频认证必须图像清晰，声音清楚<br />\n（5）\t视频认证必须衣冠整洁，禁止出现抽烟，赤裸等形象\n\t</div>\n</div>\n<div class=\"lh22\">\n\t2、视频录制内容。请针对本次借款录制视频，视频中需包括以下内容：\n\t<div>\n\t\t<span class=\"b\">（1）：首先，请朗读以下文字：</span>我是 ***，我在{function name=\"app_conf\" v=\"SHOP_TITLE\"}的用户名是***，我的身份证号是 ***********************，现在我正在做{function name=\"app_conf\" v=\"SHOP_TITLE\"}的视频确认。我在此做出以下承诺：我愿意接受{function name=\"app_conf\" v=\"SHOP_TITLE\"}的使用条款和借款协议；我提供给{function name=\"app_conf\" v=\"SHOP_TITLE\"}的信息及资料均是真实有效的；我愿意对我在{function name=\"app_conf\" v=\"SHOP_TITLE\"}上的行为承担全部法律责任；在我未能按时归还借款时，我同意{function name=\"app_conf\" v=\"SHOP_TITLE\"}采取法律诉讼、资料曝光等一切必要措施。\n\t</div>\n\t<div>\n\t\t<span class=\"b\">（2）：读完声明后，请您将身份证正面(有身份证号)对准摄像头，并保持5秒，需要保证画面中能同时看到您和您的身份证，并且身份证内容清晰可见。</span>\n\t</div>\n</div>\n<div class=\"lh22\">\n\t3、视频提交办法：您可以选择下列方法之一进行视频认证的提交：\n\t<div>\n\t\t（1）您可以联系右侧的在线QQ客服进行视频文件的提交。\n\t</div>\n\t<div>\n\t\t（2）您可以将视频文件发送至<a name=\"app_conf\"></a>{function name=\"app_conf\" v=\"REPLY_ADDRESS\"}，请在邮件中注明您的{function name=\"app_conf\" v=\"SHOP_TITLE\"}用户名及真实姓名。\n\t</div>\n\t<div>\n\t\t（3）当您通过上述两种方式之一提交过视频认证文件之后，请选择下面的选项并点击“提交审核”。\n\t</div>\n</div>','','',0,0,1,1,10,2,0),(11,'手机实名认证','credit_mobilereceipt','./public/credit/7.jpg','手机流水单是最近一段时间内的详细通话记录，是验证借入者真实性的重要凭证之一。您的手机详单不会以任何形式被泄露。','<div class=\"div22\">\n\t1、请您上传您绑定的手机号码<span class=\"f_red\">最近3个月的手机详单</span>原件的照片。如详单数量较多可分月打印并上传\n</div>\n<div class=\"lh22\">\n\t<span class=\"f_red\">每月前5日部分</span>（每月详单均需清晰显示机主手机号码）。\n</div>\n<div class=\"lh22\">\n\t2、请确认您上传的资料是清晰的、未经修改的数码照片（不可以是扫描图片）。\n</div>\n<div class=\"lh22\">\n\t每张图片的尺寸<span class=\"f_red\">不大于1.5M</span>。\n</div>','','上传手机流水单',4,0,1,1,11,10,0),(12,'居住地认证','credit_residence','./public/credit/5.jpg','居住地的稳定性，是考核借款人的主要评估因素之一，通过居住地证明，您将获得一定的信用加分。','<div class=\"lh22\">\n\t1、请上传以下任何一项可证明<span class=\"f_red\">现居住地址</span>的证明文件原件的照片。\n</div>\n<div class=\"lh22\">\n\t1) 用您姓名登记的水、电、气最近三期缴费单；\n</div>\n<div class=\"lh22\">\n\t2) 用您姓名登记固定电话最近三期缴费单；\n</div>\n<div class=\"lh22\">\n\t3) 您的信用卡最近两期的月结单；\n</div>\n<div class=\"lh22\">\n\t4) 您的自有房产证明；\n</div>\n<div class=\"lh22\">\n\t5) 您父母的房产证明，及证明您和父母关系的证明材料。\n</div>\n<div class=\"lh22\">\n\t2、请确认您上传的资料是清晰的、未经修改的数码照片（不可以是扫描图片）。\n</div>\n<div class=\"lh22\">\n\t每张图片的尺寸<span class=\"f_red\">不大于1.5M</span>。\n</div>','','上传居住地证明',4,6,1,1,12,2,0),(13,'结婚认证','credit_marriage','./public/credit/11.jpg','借入者的婚姻状况的稳定性，是考核借款人信用的评估因素之一，通过结婚认证，您将获得一定的信用加分。777','<div class=\"lh22\">\n\t1、请您上传以下资料\n</div>\n<div class=\"lh22\">\n\t1) 您<span class=\"f_red\">结婚证书</span>原件的照片\n</div>\n<div class=\"lh22\">\n\t2) 您配偶的身份证原件的照片。如果持有第二代身份证，请上传正反两面\n</div>\n<div class=\"lh22\">\n\t照片。如果持有第一代身份证，仅需上传正面照片。\n</div>\n<div class=\"lh22\">\n\t3) 您和配偶的<span class=\"f_red\">近照合影</span>一张\n</div>\n<div class=\"lh22\">\n\t2、请确认您上传的资料是清晰的、未经修改的数码照片或扫描图片。\n</div>','您的配偶同意您将其个人资料提供给本站','上传结婚证书',4,0,1,1,13,2,0),(14,'公司认证','credit_company','','','','','公司营业执照',2,0,0,1,1,10,0);

